INSERT INTO `mountain` VALUES ('1103030100','북한산','서울특별시 강북구ㆍ성북구ㆍ종로구ㆍ은평구, 경기도 고양시ㆍ양주시',836,'m47.jpg','서울특별시','서울의 진산 북한산은 조선조 초기에는 삼각산(三角山)으로 불렀다. 삼각산이란 이름은 〈신증동국여지승람〉에 \'삼각산은 양주의 경계에 있다. 일명 화산(華山)이라 하고, 신라시대에는 부아악(負兒岳)이라고 불렀다.이 산은 경성(京城)의 진산으로 동명왕의 아들 온조가 한산(漢山)에 이르러 부아악에 올라가서 살 만한 곳을 살폈다\'는 기록이 있으며, \'백운봉 (白雲峰, 지금의 백운대), 인수봉 (仁壽峰), 만경봉 (萬景峰,지금의 만경대)등 세 봉우리가 있으므로 그렇게 이름한 것이다\'라고 유래를 기록하고 있다. 북한산성에 대해서는 〈신증동국여지승람〉과 〈북한지〉에 상세히 기록되어 있다. 북한산성은 백제 온조왕이 터를 잡았고 그후 개루왕 때 성터를 쌓았다는 기록이 있으며, 조선시대에 임진왜란, 병자호란을 치른 뒤 숙종 37년(1711년)에 시작하여, 6개월 만인 그해 10월에 완공하였다 한다. 북한산성은 험한 산세를 이용하여 정상을 기점으로 서쪽 산자락부터 원효봉, 염초봉, 백운대, 만경대, 용암봉, 문수봉, 나한봉, 나월봉, 용출봉, 의상봉까지 연결하여 쌓은 산성으로 총 길이가 10km에 달한다. 당시 산성에는 14개의 성문을 냈는데, 산성의 정문 격인 대서문을 중심으로 북쪽으로 수문, 서암문(시구문), 북문, 백운대를 지나 위문, 용암문, 대동문, 보국문, 대성문, 대남문, 청수동암문, 대서문에서 북서쪽으로 이어지는 산성에는, 부황동암문, 가사동암문이 설치되었다.현재는 대부분 성문을 복원하였다. 북한산에 수많은 등산로 거미줄 같이 얽혀 있어 산행시 주의를 요하는 곳이다. 북한산의 산행 들머리는 대표적으로 여섯 군데를 꼽고 있다. 우이동 기점, 4.19탑 기점, 정릉 기점, 세검정 기점, 불광동 기점, 구파발 북한산성 기점으로 구분할 수 있다.',';명산의 3대조건 구비한 바위의 성채;북한산은 성채다. 최고봉 백운대를 비롯하여 인수봉, 노적봉, 의상봉, 보현봉 등 걸출한 암봉들이 험준한 산세를 이루고 여기 의지하여 사람들이 진짜 성을 쌓았다. 썩 높은 산은 아니지만 주변에 어깨를 겨룰 대상이 없어 눈 닿는 곳이면 어디서나 보인다. 북으로 개성, 남으로 안성에 이르기까지. 백운산~운악산~용문산~치악산 라인 이서(以西)에는 덮을 자가 없는 것이다. 세 뿔처럼 솟은 정상부의 봉만미가 타의 추종을 불허하게 인상적이다. 우이동계곡, 북한산성계곡, 평창동계곡 등에는 폭포와 암반계류의 계곡미도 갖추었다. 정상에 서면 일의대수(一衣帶水) 한강이 햇볕에 반짝이고있다. 이야말로 명산의 3대 조건을 완벽하게 맞추고있는 것이다. 백운대에서 보현봉에 이르는 장엄한 주릉에서 원효봉능선, 상장봉능선, 진달래능선, 칼바위능선, 형제봉능선, 향로봉능선, 의상봉능선이 방추차의 실처럼 뻗어나가며 그만한 수의 계곡을 만든 까닭에 천만 서울사람들이 시도 때도 없이 찾아도 다 품어 안는다. 인수봉, 노적봉, 수리봉을 메주처럼 빚어놓고 “자일과 해머, 하켄, 카라비너로 젊음을 태워보세” 외치는 클라이머들 세계의 산을 누비도록 훈련시키기도 한다. 북한산은, 태어날 때부터 수도의 진산이 될 자격이 있었다.','37.658652777777775','126.97799166666667','11305104'),('1105040200','관악산','서울특별시 관악구ㆍ금천구, 경기도 안양시ㆍ과천시',632,'m10.jpg','서울특별시','관악산은 서울시 관악구와 금천구, 경기도 과천시와 안양시에 걸쳐 있어 북한산,도봉산과 더불어 누구나 쉽게 찾는 친근한 산이다. 멀리서 보면 온통 바위로 뒤덮여 있는 산세를 가진 관악산은 해발은 낮으나 등산로 곳곳에 위험한 암릉이 있어 조심해야 한다.관악산은 예로부터 불의 산(火山)이라 하여 조선 태조가 궁터를 지금의 경복궁 자리로 옮길 때, 무학대사가 이곳은 관악산과 마주 보이는 자리로 관악산의 화기가 궁을 눌러서 내우외환이 끊이지 않을 것이라며 반대했지만, 정도전의 남쪽에 한강이 가로질러 있어서 영향이 없을 것이라는 주장을 받아 들여 지금의 경복궁을 창건하였다 한다. 그후 태종때 왕자의 난, 세조의 왕위 찬탈, 임진왜란, 병자호란, 그리고 경복궁에 발생한 수차례의 화재가 발생한 것을 풍수지리설로 해석하는 이도 있다. 대원군은 경복궁을 재건할 때 관악산의 화기를 누르기 위해 경복궁 정문인 광화문 앞에 바다의 신으로 상상의 동물인 해태 조각상을 만들어 세웠다.관악산 연주대는 고려가 망하자 남은 유신 열 사람이 관악산 절에 숨어살며 경복궁을 바라보며 통곡을 했다 하여, 임금을 사모한다는 뜻으로 연주대(戀主臺)라 불려 지게 되었다 한다. 이성계가 연주암을 중창한 뒤, 태종의 두 아들인 양녕대군과 효령대군은 태종이 왕위를 셋째 충녕대군(세종)에게 물려줄 뜻을 알고 관악산에 입산하였다 한다. 예전에 관악산을 삼성산이라 부른 것은 신라의 고승 원효,의상,윤필이 이 산에서 세 승려가 일막,이막,삼막의 세 암자를 짓고 따로 수도하여 득도하였다 하여 붙여진 것으로 전해지고 있다. 임진왜란때 일막,이막은 소실되고 삼막사(三幕寺)만 남았다는 것이다.',';광화문 해태 세우게한 화성의 극치;옛 과천현의 진산이지만 정면은 서울쪽이다. 거기다 산세가 화성(火星)의 극치를 이뤄 불꽃 너울이 상봉으로 수렴, 하늘을 태우는 듯하다. 해질녁에 뚝섬쪽에서 보면 정말 불 붙은 듯한 바 광화문 앞에 해태상을 둔 이유는 그 불기운이 경복궁으로 옮겨붙을까 우려해서다. 과천쪽은 그러나 지릉들의 기세가 너무 센 중구난방의 산세다. 올려다보는 시선이 급해 벌떼에 쏘인 까까머리 같다. 그렇지만 들판이 좁아 저으기 바라볼 수도 없다. 봉만미가 너무 빼어나 계곡미는 별로다. 남북에 암반계류는 있으나 수량이 적어 폭포와 담소(潭沼)를 이루지 못한다. 북쪽 서울대 입구에서 신림사거리까지는 굽이굽이 계곡에 간간이 암반이 드러나지만 주변이 일찌기 개간되고 시가화되면서 자취를 감춰버렸다. 반면 한강 너머로 남산과 보현봉, 아득히 삼각산 세 뿔이 그림 같으니 가히 명산이라 할 만하다. 맑은 날에는 서해바다도 보이는 \"큰 강과 바다를 끼고있는 산\" 이다.','37.444469444444444','126.96389722222223','41290107'),('1110010100','도봉산(자운봉)','서울특별시 도봉구, 경기도 의정부시 호원동ㆍ양주시 장흥면',740,'m27.jpg','서울특별시','도봉산은 서울 근교의 산으로 예로부터 북한산과 하나의 산으로 취급되어 왔다. 우이령을 경계로 북한산과 나란히 솟아 있어 현재 두 산을 북한산국립공원에 함께 포함시키고 있다. 북한산 면적 55㎢에 비해 도봉산은 약 24㎢로 절반에 불과하나 산세가 아름다워 등산객이 끊이지 않는 곳이다.주능선상에는 최고봉인 자운봉을 비롯해 만장봉, 선인봉, 주봉 등의 암봉과 서쪽으로 다섯개의 암봉이 나란히 줄지어 있는 오봉이 있다. 선인봉, 만장봉, 주봉, 우이암은 각기 거대한 암벽들이다. 도봉산은 우람한 기암괴석과 뾰족히 솟은 암봉들이 장관을 이루며, 사방으로 뻗은 계곡을 따라 녹음이 우거져 명소를 만들고 있다.사계절 모두 즐겨 찾는 산이지만 가을이면 단풍의 물결이 여느 산 못지 않다. 도봉산의 3대 계곡은 문사동계곡, 망월사계곡(원도봉계곡), 보문사계곡(무수골) 이다. 이 계곡들이 바로 산행기점과 연결된다. 도봉산은 등산코스가 다양한데 그 중에서 우이동, 도봉유원지, 망월사역(장수원), 성황당 코스가 대표적이다. 도봉산의 주봉은 자운봉(740.2m)으로, 정상을 기점으로 등산로가 사방으로 거미줄 같이 수십 가닥이 펼쳐져 있다. 모두 합쳐 100여개의 산행 코스가 있다. 그 중 도봉산 등산로의 핵심은 포대능선으로, 이 산의 등뼈를 이루는 포대능선-자운봉-칼바위-우이암 능선으로 이어진다. 포대능선은 능선 중간에 대공포진지인 포대(砲臺)가 있었다고 해서 붙여진 이름이다. 도봉산 산행 들머리는 수 없이 많지만 크게 분류하면, 안골유원지, 회룡사입구, 원도봉유원지, 도봉유원지, 성황당, 우이동, 송추 7개 코스를 꼽을 수 있다. 빼어난 암릉미를 자랑하는 도봉산은 어느 코스이든 바위 암릉이 곳곳에 도사리고 있어 주의가 필요하다. 수도권 등산객이 많이 몰리는 휴일에는 주능선인 포대능선 등에 정체 현상이 벌어질 정도로 붐빈다. 갈림길이 무수히 많아 길을 잃을 수 있으므로 사전에 지도를 꼼꼼히 챙겨야 되는 산이다.',';봉만미 탁월한 비 오는 날의 산수화;봉만미(峰巒美)가 탁월하게 빼어난 산이다. \"\"푸른 하늘 깎아세운 만 길 봉우리(靑天削出萬丈峰)\"\"라 읊었던 옛 시인의 표현이 무릎을 치게 만드는 장쾌한 선인봉을 비롯해 그 뒤에 중첩된 만장봉, 자운봉, 신선봉, 서쪽 끝의 기이한 다섯 봉우리 오봉에 이르기까지 모두 빛나는 화강암으로 되어있어 시 속의 \"\"푸른 하늘\"\"을 더욱 푸르게 한다. 이렇게 암골(岩骨)이 두드러진 산이라 주릉이 거의 암봉릉이다. 사이사이 진짜 암릉인 포대능선, 칼바위능선도 있지만 대개는 솔숲 그늘 사이 암봉을 돌고 도는 시원한 산길이다. 그래 도봉산행은 구름이 산수화를 연출하는 우중(雨中)산행을 최고로 꼽는다. 솟음이 우세하고 바위가 많아 계곡 수량은 적다. 그렇지만 계류미는 뛰어나니 비 오는 날이 새삼 제격이다. 반면에 뒷자락 송추계곡은 다르다. 온통 푸른 숲천지가 뿜어내는 맑은 물이 세 개의 송추폭에다 송추유원지의 긴 와폭과 담(潭)까지 만들어두고 있다. 그래서 도봉은 이땅에서 가장 등산로가 촘촘한 산, 가장 사랑받는 산이다. 주말마다 산을 찾는 빠꼼이 서울산객들, 일요일에는 되도록이면 이 산을 피할 정도니까.','35.29250833333333','128.91917222222222','41150102'),('1303011500','비슬산','대구광역시 달성군 옥포면ㆍ유가면ㆍ가창면, 경상북도 청도군 각북면',1083,'m48.jpg','대구광역시','경상북도 청도군과 대구광역시 달성군의 경계에 있는산, 최고봉은 대건봉이며 남쪽으로는 조화봉, 관기봉과 이어지며 유가사쪽에서 올려다보면 정상을 떠받치고 있는 거대한 바위능선이 우뚝 솟아있다. 정상에서 바라보는 낙동강의 경치가 아름답고 봄철에는 철쭉, 진달래 가을에는 억새군락이 볼만하다. 스님바위, 코끼리바위, 형제바위등의 이름난 바위와 달성군 옥포면의 용연사를 비롯하여 용문사, 유가사등의 사찰이 산재한다. 정상인 대견봉에서 남쪽 능선을 따라 988봉 - 조화봉으로 이어진다. 조화봉 능선에서 서쪽으로 대견사 터 - 1034봉으로 이어지며 1034봉에 팔각정 전망대가 설치되어 있다. 정상에서 북으로 이어지는 능선은 앞산으로 가는 안내표시가 되어 있다.정상에서 조화봉 까지 약 4km에 걸친 능선은 988봉 주변에 바위가 있을 뿐 육산(흑산)으로 큰 나무들이 없는 시야가 탁 트이는 초원 같은 이 능선에 가을에는 억새가, 봄에는 군락을 이룬 진달래가 붉게 물들인다. 진달래 군락사이에 싸리나무 등 잡목들이 섞여 있으나 진달래가 더 많다.비슬산 진달래는 정상부근, 988봉 부근 아래, 대견사 터 산자락 등 크게 3군데에 군락을 이루고 있다. 대견사터 북쪽 광활한 30여만평의 산자락이 대규모 진달래 군락지이며, 진달래가 가장 곱고 밀집되어 있는 곳은 988봉 부근 아래 산자락이다. 진달래는 4월 중순부터 물들기 시작해 4월 말에 절정에 달한다. 4월 하순경 참꽃(진달래)제가 열린다.',';돌의 바다 품은 진달래 명산;대구를 분지로 만드는 두 산은 팔공산과 비슬산이다. 화강암질의 팔공산이 산세가 웅장하여 아버지 산이라면 안산암질의 비슬산은 온화하고 부드러워 어머니 산이라 할 만하다. 비슬산은 우리나라에서 다섯 손가락에 꼽는 진달래 명산이다. 평탄한 정상부에 위치한 진달래 군락지는 봄이면 꽃바다를 이룬다. 진달래와 더불어 비슬산이 갖춘 명품은 바위다. 비슬산의 바위는 아름다울뿐만 아니라 신기하다. 절벽 밑에 부채꼴 모양으로 쌓인 돌무더기와 암괴류가 만들어내는 풍경은 과히 돌의 바다라 할 만하다.','35.67774166666666','128.5175416666667','27710340'),('1304461200','팔공산','경상북도 군위군 부계면, 영천시 신녕면, 대구광역시 동구',1192,'m90.jpg','경상북도','경북 경산시의 북쪽에 위치한 해발1,192.3m 산이고. 관봉은 852m 봉우리로써 아주 험준한 산은 아니고 보통인은 등산하기에 알맞고 능선부위에 암반이 많은 곳으며, 자연경관이 좋고 관봉에서는 전망도 좋으며. 일년내내 불자신도와 등산객이 가장많은 장소이다.',';삼국통일의 도장, 대구의 진산;신라의 중악(中岳) 팔공산은 대구산악인의 모산이며 약사신앙의 1번지다. 이름은 대구, 칠곡, 인동(현 구미 인의동 일대), 신녕, 의흥, 영천, 하양, 경산 등 여덟 마을에 걸쳐 있어 붙여졌다. 가산에서 갓바위까지 주릉만 26km다. 기슭에는 파계사, 부인사, 동화사, 은해사, 제2석굴암 등 이름난 절이 많다.? 최적 탐방 시기 :&nbsp;사계절 아름다움, 매년 10월 초순경 [달구벌축제]가 열림? 볼거리 : 관봉석조여래좌상. 장군바위.선본사.약사암.용덕사.용주암.원효암.천성사.불굴사.봄에는 진달래와 연산홍이 피고 여름에는 울창한 숲과 맑은 물이 있으며, 가을은 전국에서 제일 아름다운 단풍거리가 순환도로를 따라 전개되어 진풍경을 연출하고 있으며, 겨울은 설경과 설화가 아름답게 조화를 이룬다.? 숲길 명소 : 비로봉(毘盧峰)을 중심으로 하여 동·서로 16km에 걸친 능선 경관이 아름답다. ? 문화재 : 석조여래좌상(갓바위), 장군바위.천성사','36.01653611111111','128.69533055555556','47720330'),('1401990600','마니산','인천광역시 강화군 화도면',472,'m30.jpg','인천광역시','우리나라에서&nbsp;다섯번째로 큰 섬인 강화도에는 고려산, 혈구산, 진강산, 마니산 등 400m 이상의 4개산이 남북으로 일직선상에 솟아 있는데 그 중 제일 높은 산이 마니산이다. 〈고려사〉〈세종실록지리지〉〈태종실록〉 등 조선 초기에 발간된 문헌에는 머리산, 우두머리산이란 뜻의 마리산(摩利山) 또는 두악(頭嶽)으로 쓰여 있다. 그래서 지금도 마리산이라는 이름을 혼용해서 사용하고 있지만, 오랫 동안 마니산이라 불러왔는데 새삼 마리산이라고 하여 혼동을 줄 필요는 없을 것같다. 마니산은 비교적 낮고 수도권에 가까운 거리에 있어 친정을 찾는 기분으로 편하게 찾을 수 있다. 해발이 낮더라도 주능선이 암릉으로 되어 있으니 등산의 묘미도 한껏 만끽할 수 있는 산이다. 동남으로 가느다랗게 뻗은 능선을 따라 오르다 보면 망망한 서해를 조망할 수 있다. 조국순례 안내판이 있는 \'개미허리\'에서 98개의 계단길을 올라가면 사적 제 136호인 \'참성단\'(塹星壇)을 만날 수 있다. 이곳에서 매년 개천절과 전국체전때마다 성화가 채화된다. 참성단은 단군 왕검 재위 51년(BC2283년)에 운사(雲師)인 배달신(倍達臣)이 마리산에 쌓은 제단으로, 〈삼국사기〉에 의하면,고구려.신라.백제의 여러 왕들이 이 곳에서 하늘에 제사를 지냈다. 고려 공민왕 때와 조선 인조.숙종 때 각각 보수되어 현재 이른다. 이 단은 화강석을 쌓아올려 만든 것으로, 밑부분은 둥글고 윗부분은 사각형이며, 높이가 총6m에 달한다. 참성단 위에 오르면, 동쪽으로 정상이 손에 잡힐 듯 가깝게 보이고, 남쪽 아래로는 푸른 물결이 넘실거리는 넓은 바다가 발아래로 펼쳐지고, 동남쪽 멀리 인천시가지가 아득히 보인다. 정상 서쪽 산기슭에는 신라 선덕여왕 8년(639년)에 창건했다는 정수사와 함허대사(涵虛大師)가 수도하였다는 함허동천이 자리잡고 있다. 함허동천에는 1백여m의 암반위로 물이 흐르고, 암반에는 함허대사가 새겼다는 \'涵虛洞天\'(함허동천)이란 글자가 음각 되어 있다. 외침을 자주 받았던 고려가 부처의 힘으로 나라를 지켜 보려고 강화도에서 크게 불사를 펼쳤던 까닭인지 강화도에는 내력 있는 절이 많다.',';암골미 뛰어난 최고 전망대;경기도 최대의 섬 강화도에서 최고 높은 산이다. 단군왕검이 세 봉우리 중 가운데것에 참성단(사적 136호)을 세우고 하늘에 제사를 지내며 고조선의 안녕을 기원했다는 산으로 몇 해 전 풍수들이 마니산을 가장 기가 센 곳으로 지목하기도 했다. 신증동국여지승람에 있는 전설인데, 이 산이 쓰기로는 마니산이지만 부르기로는 마리산인 데 근거했을 것이다. 1977년에 국민관광지로 지정되었으며, 참성단의 유명세로 많은 이들이 오래 전부터 즐겨 찾는 명승지다. 암골미가 뛰어난 데다 이중환의 명산 제2조건 \"\"큰 바다를 끼고있을 것\"\"을 갖춰 전망을 따를 데가 없다. 염하(鹽河)나 석모도와의 사이 개(浦)처럼 강 같은 바다, 장봉도와 사이의 호수 같은 바다, 서쪽의 망망대해가 가슴을 탁 트이게 한다. 신라 선덕여왕 8년(639년)에 희정선사가 창건한 정수사 등이 산자락에 있어 문화유적 답사지로도 좋으며 해안의 진, 보, 돈대 등 호국문화재를 둘러볼 수도 있다.','37.615541666666665','126.42968055555556','28710340'),('1704041600','신불산','울산광역시 울주군 삼남면ㆍ상북면',1159,'m57.jpg','울산광역시','취서산은 일명 영취산으로 불리고 있으며, 이 산의 산자락에는 3대 사찰 중 하나인 통도사가 자리잡고 있다. 취서산 정상에서 신불산 정상까지 이어지는 억새능선이 유명하며, 신불산 산자락에는 홍류폭포와 작천정이 유명하다. 취서산과 신불산은 영남 알프스의 7개 봉우리에 속하는 산으로 광활한 억새밭으로 이름 난 곳이다. 경부고속도로를 부산 방면으로 내려가다가 언양인터체인지에서부터 통도사인터체인지 사이에 오른쪽으로 고속도로로 나란히 길게 뻗어 있으며 두 산은 같은 주능선에 가까이 붙어 있어 산행도 연결해서 하고 있다.',';광활한 억새초원 자랑하는 언양의 진산;영취산과의 사이에 신불평원이라는 광활한 산상 억새초원을 펼친 이색지대다. 동쪽으로는 공룡능선이라는 긴 암봉릉이 뻗어나가 산록 육덕(肉德) 자랑만 하는 주변 산들과 구별된다. 그럼에도 썩 튀지는 않아 간월, 가지, 상운, 고헌의 천미터급 산으로 계속 이어지며 읍성 품은 오랜 고을 언양의 장대한 병풍을 이룬다.동쪽의 홍류폭포, 서쪽의 파래소폭포 또한 이웃 산들에는 없는 이채로움이다. 파래소폭포 하류에는 널따란 암반계류를 펼쳐 아름다운 2층 누각 작천정이 자리잡았다. 그리고 산 위에는 단조산성이 쌓여있으니 다섯 병풍축 가운데서도 특별히 선택받은 언양의 진산이다. 다섯 병풍축에 운문·재약산을 합하면 소위 \"영남알프스\"다. 유럽의 용마루 알프스를 본따 붙인 일본의 남북알프스가 다시 새끼를 친 것이다. 저들처럼 하얀 만년설은 없지만 대신 황금빛 억새밭을 자랑하는 노란 알프스다.','35.53936944444444','129.05410555555557','31710390'),('1704060100','가지산','울산광역시, 경상북도 청도군, 경상남도 밀양시',1241,'m4.jpg','울산광역시','',';개성 없는 영남알프스 그 최고봉;부산산악인들이 이름붙인 영남알프스는 낙동정맥 아랫부분의 천 미터 넘는 산들을 총칭하는 개념이다. 이 거울에 비친 下자 모양 산줄기는 그러나 고봉능선으로 이어진 탓에 낱낱으로는 썩 빼어난 것이 없다. 능선 안부와 정상의 고도차가 얼마 되지 않은 탓도 있다. 개활지가 펼쳐진 동쪽에서 볼 때 상봉들이 능선 전면으로 튀어나와 있지 않고 뒤로 물러나있다는 점도 이유다. 그래 가장 남쪽의 영취산을 제외하고는 다들 저 높은 데서 약간씩 오르내리는 대장벽의 일부일 따름이다. 최고봉이라는 가지산 역시 여럿 중의 하나에 다름아니다. 게다가, 능동산처럼 능선삼거리에 자리잡아 개성이 더욱 묻혀버렸다. 도립공원이라지만 북쪽 청도쪽은 또 둘밖에 안 되는 산길을 모두 막아버린 상태다.','35.27406944444444','126.40397222222222','47820350'),('2101021300','명지산','경기도 가평군 북면ㆍ하면',1252,'m33.jpg','경기도','경기도에서 화악산(1,468.3m)에 이어 두 번째로 높은 명지산은 정상을 오를 수 있는 산으로는 최고봉이다. 거대한 산맥을 이룬 명지산은 산 크기만큼이나 등산로도 많이 있으나 어느 길이나 정상까지 3시간 이상 소요된다. 서울에서 가까운 곳에 있으면서도 아직 오염되지 않은 깨끗한 계곡과 울창한 수림을 간직하고 있다. 가평천을 사이에 두고 화악산과 마주보고 있는 명지산은 정상을 기점으로 사방으로 산자락을 펼치며, 귀목봉, 사향봉, 백둔봉 등을 거느리고 있는 웅장한 산이다. 명지산의 울창한 수림은 일상에 지쳐 산을 찾는 이들을 포근히 감싸안는데 그 깊이를 가늠할 수 없다. 사계절이 다 아름다운 명지산은 특히 봄에는 진달래와 쩔쭉이 온산에 흐드러져 봄날의 산행을 즐기는 이들을 황홀경에 젖게 만든다. 가을 단풍은 가평 팔경 중 제 4경으로 지정 되었다. 우리나라 가을 산은 어디나 아름답지만 명지산의 단풍은 수십년 묵은 고목과 기암괴석들과 조화를 이루어 더욱 더 깊이를 더 한다. 또한 겨울에는 적설량이 많아 설화가 장관을 이뤄 겨울산행을 나선 이들을 반긴다. 명지산 입구인 익근리에서 약 1Km가량 올라가면 규모가 작은 사찰인 승천사가 나타나고, 이어서 2Km가량 더 가면 등산로 왼쪽으로 높이 6m에서 시원한 물줄기가 쏟아 내리는 명지폭포를 만나게 된다. 한여름 불볕더위도 식혀 버리는 명지폭포 아래 깊은 웅덩이는 옛날에 명주실 한타레가 다 들어갈 정도로 깊어 명지폭포로 이름이 붙여졌다 한다.',';수더분하나 깊은 맛이 있다;명지산은 하늘금 이쁜 명산은 아니지만 높고 깊은 맛이 있다. 경기도에서 가장 산이 많고 지대가 높은 가평군에 자리한 제2봉이기 때문이다. 특히 남쪽의 청우산(617.8m)에서 시작, 대금산(705.8m), 매봉(929.2m), 연인산(1068m)을 거쳐 올라오는 70리 능선길은 적설기 종주코스로 호(號)가 나있다. 이 능선은 북서계절풍을 가로막는 첫 1000미터 전후 산줄기다. 동쪽의 익근리계곡을 C자로 둘러싸는 산세여서 그쪽으로 등산로가 발달해 있다. 서쪽은 귀목고개에서 상판리로 향하거나 귀목봉(1036m) 너머 강씨봉고개에서 포천 일동으로 내려가게 돼있다. 그만큼 연계 교통이 불편한 까닭에 찾는 이들이 적어 호젓한 잇점은 있다. 봄철 나물산행의 적지다. 명지산행의 백미는 정상부에서 보는 산국(山國)의 파노라마다. 사방이 산으로 둘러싸인 절해고도 같은 막막함을 경기도에서 유일하게 경험할 수 있다. 6km나 되는 익근리계곡은 여름철 물놀이하기에 좋다. 가을 단풍도 이름이 있다. 육산이라 언뜻 수더분한 인상이지만 산이 크니 그만한 값은 한다.','37.941536111111105','127.43219722222223','41820350'),('2101023600','화악산(중봉)','경기도 가평군 북면, 강원도 화천군 사내면',1468,'m94.jpg','경기도','경기 5악 중의 으뜸인 화악산(1,468m)은 강원도와 경기도를 가르는 분기점에 우뚝 솟아 있는 산이다. 경기도의 최고봉이다. 화악산을 중심으로 동쪽에 매봉, 서쪽에 중봉이 위치하며 이들을 삼형제봉이라고도 한다. 여기서 발원하는 물은 화악천을 이루며 가평천의 주천이 되어 북한강으로 흘러든다. 정상 주변은 군사지역으로 출입이 금지되어 있어 가까운 곳에서 보는 것으로 만족해야 하는 점이 아쉽다. 지금은 정상 서남쪽 1km 거리에 있는 중봉 산행으로 화악산 정상을 대신하고 있다. 화악산 주능선에 오르면 가평, 춘천 일원을 굽어볼 수 있어 산행의 재미를 더해 준다.',';경기 제일봉 화악산;경기도 제일봉으로 경기 동북부와 강원도의 경계를 이루며 솟아있다. 한북정맥의 도마치봉(937m)에서 동남쪽으로 뻗은 산줄기가 석룡산(1155m)을 지나 솟구쳐 이루었고 이후 응봉(1436.3m), 촉대봉(1125m)으로 이어지며 \'경기의 알프스\'라 불릴 만한 산군을 형성하고있다. 마루금만이 아니라 곁가지까지 정맥으로 본다면 한북정맥 최고봉이다. 양감 있는 덩치에 정상부가 불룩한 장엄한 외관이다. 튼실한 양 어깨에 상고대라도 내려앉으면 아예 성산의 분위기를 풍긴다. 관청리 큰골 입구에서 보면 남릉의 가지 하나 가슴께에서 솟아올라 둔중한 육산 덩어리에 역동성을 부여한다. 정상 군부대 때문에 중봉까지밖에 못 간다는 사실 잊고 한달음에 치오르고 싶어진다. 남쪽 오림계곡에는 승원폭포와 옥녀탕이 있다. 서쪽 조무락골에는 쌍룡폭포와 복호등폭포, 그리고 와폭이 하나 있다. 이만하면 계곡미도 갖춘 셈. 목동에서 합쳐진 두 물은 가평천을 만든다. 흔히 경기 5악의 하나로 치는데 사실은 아니다. 악(岳)자는 들어가있지만 정상이 바위로 되지 않았다. 화악 자리에는 서울의 무악이 들어가야 맞다.','35.593275000000006','128.69160555555555','41820350'),('2101033200','축령산','경기도 남양주시 수동면, 가평군 상면',887,'m85.jpg','경기도','화도읍(마석)에서 북동쪽으로 12km 거리에 있는 축령산(887.1m)은 조종천과 수동천의 사이에 솟아 있다. 이 산에는 일명 \'남이바위\'라고 하는 바위가 있는데, 이는 조선시대 때 남이장이 이 곳에서 심신을 수련하였다 하여 붙여진 이름이라고 한다. 축령산의 울창한 수림과 계곡을 이용하여 자연 휴양림을 조성, 삼림욕장, 휴계소, 체육시설, 놀이시설, 야영장 등 편의 시설이 두루 갖추어 진 곳이다.',';원이름이 비령산인 수동계곡 명봉;경춘가도 마석을 지나 새터고개를 넘으면 잊었던 전설처럼 북한강이 나타난다. 이어 정태춘 노래 \'대성리에서\'의 대성리가 나오는데 그 직전 군계를 지날 때 보면 꽤 큰 내를 건너고있다. 수동유원지로 알려진 수동천이다. 이 수동천과 가평 조종천 사이에 있는 축령산은 국도에서 보이지 않고 교통도 불편해 오래도록 알려지지 않은 산이었다. 그러다 80년대 민주산악회 같은, 사람이 별로 없는 호젓한 대상지만 찾던 이들이 즐겨 다니면서 발길이 잦아지기 시작했다. 수동계곡으로 들어가 보면 축령산은 육산 줄기 위로 쑥 올라선, 준걸한 모습이다. 정상부가 바위로 되어있기 때문이다. 그래 암릉산행의 아슬아슬한 묘미가 있고 정상 조망도 좋다. 경기 중북부의 거의 모든 산과 삼각산, 도봉산의 파노라마가 펼쳐진다. 원이름은 비령산이었다. \'빌 축\'자을 새김으로 읽게 되어있는 이두였는데 이를 모르고 일제시대부터 축령산으로 써왔다. 정상 동북쪽과 동쪽에는 아직도 비령이라는 지명이 남아있다.','37.75270277777778','127.33396111111111','41360340'),('2101062700','운악산','경기도 가평군 하면, 포천시 화현면',935,'m64.jpg','경기도','청평에서 북동쪽으로 약 20km 떨어진 운악산은 일명 경기 소금강이라고 불리울 만큼 뛰어난 모습을 지니고 있다. 주봉인 망경대를 둘러싸고 커다란 바위들이 봉우리마다 구름을 뚫고 솟아 있으며, 오래된 절 현등사와 물 맑은 조종천은 매력을 한층 더해준다.',';조종현 진산이던 경기의 금강;경기5악의 하나인 운악산은 이름에 드러나 있듯 바위가 많은 명산이다. 산봉과 능선이 정상으로 수렴하는 산의 구도도 좋고 바위와 가을 단풍이 어우러진 모양도 아름답다. 그래서 \'경기의 금강\'으로 불린다. 동쪽 기슭에는 보조국사 지눌의 사리탑이 있는 현등사가 자리했다. 서쪽에는 수직의 소꼬리폭포, 30m 길이의 무지개폭포가 있어 빙벽등반을 즐기는 산악인들이 즐겨 찾는다. 한북정맥의 마지막 900m급으로 이 서남쪽으로는 기껏해야 600m급의 죽엽산, 계명산이 있을 뿐이다(산경표가 아니라 대동여지도를 따를 경우다). 아래쪽 경기도에도 이만한 산이 없다. 수계(水系)는 동쪽이 청평 안전유원지를 이루다 북한강으로 흘러드는 조종천, 서쪽은 포천천의 지류 명덕천이다. 따라서 조종천 유역, 옛이름이 조종현(朝宗縣)이었던 상면과 하면이 앞쪽이 되니 산세 또한 청평에서 현리로 넘어가는 서대고개에서 보아야 맞다. 운악산은 조종현의 치소(治所)였던 현리의 진산이었던 것이다.','37.75987222222222','127.17697777777778','41820345'),('2111091500','천마산','경기도 남양주시 오남읍, 화도읍',810,'m80.jpg','경기도','마석에서 서북쪽으로 4.5km 떨어져 있는 산으로 1983년 군립공원으로 지정되어 휴일이면 많은 사람이 몰리고 있다.특히 이 곳은 스키장과 청소년 심신수련장 등이 있으며, 산의 형세가 험하지 않고 나무가 울창하여 당일 등산코스로 알맞다. 1990년 11월 1일부터 야영장외 지역에서는 취사가 금지됐다.',';석 자만 더 길면 하늘을 만진다;천마산은 하늘 높이 솟아오른 산세가 빼어난 명산이다. 경춘국도를 타고 서울로 갈 때나 양평 서종면의 북한강변길을 가면서 보면 가히 군계일학이다. 자락의 평내와 마석, 오남리에 아파트숲이 들어차 호젓한 맛은 사라졌지만 본바탕은 어느 산에 대도 꿀리지 않을 만큼 준수하다. 그래 이곳을 지나던 이성계 \"\"가는 곳마다 청산은 많지만 저건 꼭 푸른 하늘에 홀(笏)을 꽂아놓은 것 같도다. 손이 석 자만 더 길다면 저 끝에서 하늘을 만질 수 있겠다(手長三尺可摩天)\"\"고 읊었다. 천마산이라는 넘치는 이름을 얻게 된 유래다. 정상부는 바위로 되어있지만 자락은 육산이라 봄철 신록과 가을 단풍이 곱다. \"\"화려한 슬픔\"\"이라고 할 만큼 아름다운 단풍이다. 스키장이 들어섰을 정도로 눈이 많아 겨울에는 설경도 볼 만하다. 거기다 북방식물인 만주바람꽃이 살 만큼 식생이 다양하다. 화도읍의 천마산 심신수련장 입구는 전나무숲이 좋다. 정상 암릉에는 노송이 휘늘어져 잊지 못할 풍경으로 남는다.','34.96219722222222','128.60226111111112','41360262'),('2112130200','소요산','경기도 동두천시, 포천시 신북면',588,'m55.jpg','경기도','서울에서 44km, 동두천시청에서 동북쪽으로 약 5km의 거리에 있는 소요산은 경치가 뛰어나 경기도의 \'소금강\'이라 불린다.',';원효대사 전설 서린 경기 소금강;소요산은 영국 기준으로는 산 축에도 못 드는 언덕이다. 그들은 2000피트, 609.6미터부터 마운틴으로 보기 때문이다. 그렇지만 이 풍수지리의 땅 사람들은 50미터 높이의 독립봉조차도 혈맥이 흐르는 곳이라면서 산 대접을 해주었다. 소요산처럼 바위가 불뚝불뚝 솟은 데는 더 말할 나위가 없다. 게다가 폭포와 탕, 소까지 즐비하니 격을 높여 명산으로 쳤다.원효폭포, 청량폭포, 선녀탕이 대표적 명승이다. 뒤집어진 C자 모양의 산 운두를 다 돈다 해도 서너 시간밖에 안 걸린다. 당나라 유학도 가다 말았던 원효가 여기까지 왔을 리 만무하지만 곳곳에 전설이 서려있는 까닭은 가까운 임진강이 백여 년 가량 신라의 국경이었기 때문일 것이다. 그래 산 속에 최전방 장졸들을 위한 절이 들어섰을 테고 설법 내용은 대체로 \"\"죽으면 미륵의 나라에서 환생한다\"\"는 미륵상생경이었으리니 그 이론을 세운 원효대사와 인연이 없지만은 않다.','35.52388333333333','126.61423888888888','41650340'),('2130093200','유명산','경기도 가평군 설악면, 양평군 옥천면',864,'m68.jpg','경기도','국립지리원 발행 지형도에도 마유산으로 표기하다가, 1973년 국토자오선 종주대가 이 산을 통과하면서 당시 대원 중 홍일점이었던 진유명씨의 이름을 따서 유명산으로 부르게 되었다.이 산은 정상에 이르는 능선이 완만하고 부드러우며, 산 전체에 갖가지 나무가 울창하여 봄부터 여름까지 하늘을 가릴 정도이고 여름이면 기암괴석과 우거진 숲이 조화를 이룬 계곡은 수량이 풍부해 절경을 이루고 있다.',';원이름은 마유산이다;대동여지도에 마유산으로 나오는 산인데 언제부턴가 유명산으로 불리게 되었다. 소문으로는, 산이름이 알려지지 않았을 때 이 산을 찾은 사람들이 일행 중 김유명이라는 여자 이름을 따서 붙였다고 한다. \'입구에 있는 가지계곡\'이라는 뜻의 입구지(入口枝)계곡도 그들의 작명인 듯하다. 바로 그 입구지계곡이 널리 알려져 있다. 용문산에서 흘러오는 그 계곡에 마당소, 용소, 박쥐소 같은 명소가 여럿 있기 때문이다. 억새밭이 펼쳐지는 정상에서의 전망도 좋은데 나무가 거의 없는 까닭에 패러글라이딩 활공장으로 각광받고 있다. 패러글라이더들은 설매재 자연휴양림쪽(동쪽)에서 올라오는 산판도로를 이용한다. 550미터쯤의 선어치고개로 이어지는 능선코스는 정상과의 고도차가 300m 남짓밖에 안 된다. 그래서 쉽게 정상에 설 수 있으므로 선어치를 경계로 이웃한 중미산까지 연계산행을 하는 이들도 많다. 이 경우 원점회귀도 쉽다.','37.57528333333334','127.48657222222222','41820310'),('2130103000','용문산','경기도 양평군 용문면ㆍ옥천면',1157,'m61.jpg','경기도','용문산은 경기도에서 네 번째로 높은 산으로 기암괴석과 고산준령을 고루 갖추고 있는 산이다. 본디 미지산이라는 이름으로 불리었는데, 조선을 개국하고 이태조가 등극하면서 \'용문산\'이라 바꿔 부르게 되었다고 한다. 정상은 입산통제 지역으로 우회하는 등산로가 이용되고 있다. 신라 선덕여왕때 창건한 용문사 사찰앞에는 높이 62m, 둘레 14m에 달하는 은행나무(천연기념울 제 30호)가 발걸음을 멈추게 한다.',';풀꽃 천지 숨기고있는 두루뭉실한 거산;용문산은 경인지역에서 설악산 갈 때 보게되는 큰 산이다. 44번 국도변에는 이보다 더 높은 산도 많지만 대개는 골짜기를 따라 이어진 도로에서 올려다보게 되어있어 규모를 느낄 수 없다. 그러나 용문산은 비산비야의 용문면 북쪽 끝에 병풍처럼 솟아있는 까닭에 위용이 쉽사리 잡힌다. 하지만 상봉은 바람을 넣어 부풀린 여의도 종합전시장처럼 두루뭉실, 장엄한 느낌밖에 없다. 반면 뾰족한 삼각뿔이 하늘을 찌르는 남릉의 백운봉은 두고두고 지워지지 않는 인상을 남긴다. 가을이나 겨울 이른 새벽에 물안개 위로 보이는 그 모습은 정말 소슬하다. 가파른 바위투성이 남면과 달리 부드러운 육산을 이루는 북면은 풀꽃 천지다. 이른 봄의 얼레지, 5월의 피나물 꽃밭을 인적 없는 호젓함 속에 만끽할 수 있다. 이는 국가시설물 때문에 정상에 서보지 못한 아쉬움을 벌충하고도 남는다. 가을에는 용문사의 은행나무가 볼거리다. 수많은 천년수(千年樹)들이 거의 \'마이가리\'지만 이건 진짜다.','38.477494444444446','127.85666111111111','41830400'),('2140140100','감악산','경기도 양주시 남면, 연천군 전곡읍, 파주시 적성면',675,'m5.jpg','경기도','예로부터 수덕이 뛰어나 삼각산의 영광을 뒷받침한 경기 오악중 북악에 속하는 이 산은 지형적 특성으로 삼국시대에부터 전략적인 요충지로 6.25전쟁 때까지 치열한 격전이 있던 곳이다. 그런 연유로 산자락 설마치계곡 양쪽으로 영국군 전전비와 대한의열단 전적비가 세워져 있다. 바위 사이로 검은빛과 푸른빛이 동시에 흘러나온다 하여 감악(紺岳), 즉 감색바위라고 하였다. 또한 조선 명종때 구월산 청석골을 거점으로 활약하던 임꺽정의 중간거점이 있던 곳으로 그와 연관된 지명이 곳곳에 산재해 있다. 정상에는 현재도 군사시설이 있으며, 북한산 진흥왕 순수비와 유사한 일명 삐뜰대왕비 설인귀비가 위치해 있다. 이 비는 아직도 전쟁때 탄흔자국을 가지고 있으며 파주군 향토유적 제 8호로 지정되어 있다. 전체적인 산세는 암릉과 작은 암봉들이 조화를 이루고 있으며 간간이 절벽지대가 있으므로 주의를 요한다.원래 감악사, 운계사, 범륜사, 운림사 등의 4개 사찰이 있었다는데 현재는 1970년 옛 운계사 터에 재창건한 범륜사만 남아 있다. 서울에서 그리 멀지 않으며, 의정부 북쪽 회천에서 양주시 남면을 지나 설마리를 거쳐 감악산 계곡을 따라 들어가면 높이 20여 미터에 달하는 운계폭포가 나온다. 폭포 뒤로 범륜사가 있고 그뒤로 전형적인 암산의 모습을 띤 감악산이 보인다. 맑은 날에는 개성의 송악산과 북한산이 보인다.',';검푸른 감색바위의 산;감악산은 경기 파주시 적성면과 양주군 남면 연천군 전곡읍에 걸쳐있다. ;산경표;에 의하면 한북정맥의 한강봉과 연결되어 그 지맥을 이루고 있다. 예로부터 개성 송악산, 가평 화악산, 과천 관악산, 포천 운악산과 함께 경기 5악의 하나로 알려져 왔으나 일반인에게는 그리 잘 알려져 있지 않았다. 휴전선에 인접해 있는 탓에 입산금지구역으로 묶여 있다가 몇 년 전부터 통제가 다소 완화되었기 때문이다. 그러나 여전히 등산로가 제한된다. 정상을 중심으로 산행이 가능한 등산로는 범륜사, 신암리, 원당리 방면이다. 감악사, 운계사, 범륜사, 운림사 등의 4개 사찰이 있었다는데 현재는 1970년 옛 운계사 터에 재창건한 범륜사만 남아있다. 장군봉 아래는 조선 명종 때 의적 임꺽정이 관군의 추적을 피해 숨어있었다는 임꺽정굴이 있다. 6·25전쟁 때는 격전지로 유명했는데 설마리 계곡에는 영국군 전적비와 대한의열단 전적비가 있다.','35.59557777777778','127.92811944444445','41630320'),('2142141300','백운산(포천)','경기도 포천시 이동면, 강원도 화천군 사내면',904,'m45.jpg','경기도','경기도 포천군 이동면과 강원도 화천군 사내면의 경계를 이루는 백운산은 부드러운 산세와 해발 660m 인 광덕고개에서 산행이 시작되므로 가볍게 산행을 즐기려는 사람들이 많이 찾는다. 주말을 이용해 가족과 함께 등반을 하기에도 적격인 곳이다. <br>광덕고개는 일명 \'카라멜고개\'라고 불리는데, 그렇게 불리는 데는 두 가지 설이 있다. 첫 번째 설은 도로가 비포장이었던 6.25때 이 지역을 관할하던 사단장이 광덕고개를 오를 때면 운전병의 졸음을 쫓기 위해 운전병에게 카라멜을 먹게 한 데에서 유래되었다는 것이다. <br>두번째 설은 광덕고개의 꾸불꾸불한 모양이 낙타의 등을 연상케 한다고 해서, 카멜(Camel: 낙타)이 카라멜로 변하여 카라멜고개로 불리게 되었다는 것이다. <br>백운산 정상 서쪽 아래로 4km에 이르는 백운계곡은 풍부한 수량과 빼어난 계곡미를 자랑한다. 계곡 곳곳에 넓적한 바위가 널려있어 아무데고 앉으면 쉼터가 될 정도로 등산인들이 쉬어가기 좋은 곳이다.',';백운계곡 유명한 포천의 명산;<br>하얀 구름을 머리에 이고 있는 산, 이름만 들어도 마음 설레이는 산이 백운산이다. <br>우리나라에는 백운산이 많다. 광양의 백운산, 함양의 백운산을 비롯해 남한에만 23개의 백운산이 있다. 그 중 경기도 포천의 백운산은 산자수명하기로 이름난 산이다. <br>경기의 최고봉인 화악산이 동남쪽으로 맥이 닿아 있고 북쪽의 광덕산과는 광덕고개(일명 카라멜고개)를 사이에 두었다. 백운계곡은 영평팔경의 하나로 꼽힐 만큼 계곡미가 뛰어나며 가을 단풍도 절경이다. 일동 온천타운에 들러 온천욕을 즐길 수도 있다.','38.07483611111111','127.44448333333334','41650380'),('2204113300','응봉산','강원도 삼척시 가곡면ㆍ원덕읍, 경상북도 울진군 북면',1000,'m69.jpg','강원도','응봉산은 강원도 삼척군과 경북 울진군의 경계를 이루며 산 주변에 전인미답의 여러 계곡들을 끼고 계곡탐험코스로 적합한 산이다. 응봉산을 중심으로 북쪽의 기곡천과 재랑박골, 서쪽의 용소골, 문지골, 갱이골, 보리골 등이 있으며 남쪽 울진군내에 대광천과 동해안쪽 폭포골, 성우골등이 즐비하게 들어서 있다. 호산에서 버스종점을 지나 1km쯤 들어서면 폐광터가 나오는데 여기서 조금 더 올라가면 연이어진 2개의 폭포가 힘차게 흐른다. 조금 더 올라가면 오른쪽 깊은 계곡 아래로 헤아릴 수 없는 폭포지대를 만날 수 있다. 금강산의 축소판을 연상케 하는 이곳은 3단까지는 시야에 들어오나 그 아래로는 워낙 협곡이어서 몇단까지 폭포가 꺽어져 내리는지 셀 수 없을 정도다. 용소골을 탐험할 경우에는 암벽등반 경험자가 동행해야 하며 20m자일 두동쯤은 있어야 위험지대를 통과할 수 있다.',';동해를 향해 비상을 꿈꾸는 매봉; 강원도 삼척과 경북 울진의 경계에 솟은 응봉산은 비상하는 매의 형상을 하고있는 준봉이다. 게다가 울진쪽의 온정골과 삼척쪽의 용소골이 다 비범해 찾는 이들이 끊이지 않는다. 온정골은 달팽이관처럼 회회돌며 떨어지는 용소폭포와 그 아래의 용소, 덕구온천이 명소다. 덕구온천은 원래 눈 덮인 골짜기에서 온천욕을 할 수 있는 노천온천이었는데 홍수로 유실된 이후 관정(管井)을 뚫어 지금의 온천타운으로 재개발되었다. 14km에 이르는 용소골 구절양장은 흙 한 줌 없는 긴 통바위골과 깊이를 헤아릴 수 없는 소, 크고 작은 폭포들이 장관을 이룬다. 그만큼 길이 험하고 위험해 90년대만 해도 일반인들은 들어가볼 엄두를 내지 못하던 곳이었다. 이후 주민들에 의해 길이 다듬어지고 곳곳에 안내판이 설치되면서 많은 사람들이 찾게 되었지만 아직도 초보자에게는 무리다.','36.150819444444444','128.5504277777778','42230350'),('2204151100','두타산','강원도 동해시 삼화동, 삼척시 미로면ㆍ하장면',1357,'m29.jpg','강원도','두타산은 부처가 누워있는 형상으로 박달령을 사이에 두고 청옥산과 마주하고 서 있다. 울창한 수림과 기암절벽에 노송이 뿌리를 내려 산세가 수려한 두타산은 강원도 국민관광지 1호로 지정돼 있다. <br>두타산의 \'두타(頭陀)\'란 \'속세의 번뇌를 버리고 불도를 닦는 수행\'을 말한다. 이는 두타산이 불교와 인연이 깊은 불교의 도량임을 미루어 짐작할 수 있다. 지금은 삼화사,관음암,천은사가 남아 있지만 10여개의 사찰이 있다는 옛기록으로 보아 무릉계는 불교가 크게 번성했던 두타의 도량이었던 같다.',';무릉계를 만들어놓은 바위산과 푸른산;<br>계곡 이름을 무릉계(武陵溪)라고 했다. 얼마나 대단한 경치면 감히 “무릉도원은 바로 여기”라고 내세웠다. 두타산과 청옥산, 고적대, 갈미봉, 1243봉으로 둘러싸인 반석계곡이다. <br>가보면 고개를 끄덕이게될 것이다. 벼루처럼 매끄러운 바위운동장에 무수한 글씨가 새겨져있고 한켠으로는 맑은 물이 렌즈처럼 얇게 흐른다. 골짜기로 들어가면 여기도 폭포 저기도 폭포, 깎아세운 절벽 위엔 층층이 소나무들… 내가 정말 무릉도원에 들어왔구나 싶으리라. <br>;형 지형인 무릉계 물받이의 남쪽 울타리를 이루는 청옥·두타산은 언제나 쌍둥이처럼 붙어다닌다. 뗄 수 없이 돈독하고 가까운 동시에 무릉계라는 보물을 공유하고 있기 때문이다. 그렇지만 생김새는 사뭇 달라 청옥은 듬직한 육산(肉山)인 반면 두타는 울끈불끈 골산(骨山)으로 되어있다. <br>문자속이 있는 이는 쌍둥이 이름이 맞바뀌었나 의심할 것이다. 푸른 옥 청옥은 바위산에 붙여야 맞으며 집착을 버리고 수행의 길로 들어선다는 두타는 저 요란한 무릉계곡을 지긋이 굽어보고있는 후덕한 봉우리에 어울리는데…. <br>모순없는 논리는 진실이 뒷받침한다. 산경표와 대동여지도에는 분명 북쪽것이 두타라고 나와있다. 청옥은 두타고 두타는 청옥인 것이다.','37.584069444444445','128.6011722222222','42170124'),('2207010900','설악산','강원도 속초시 설악동, 인제군 북면ㆍ인제읍, 양양군 서면ㆍ강현면',1708,'m52.jpg','강원도','설악산은 한라산(1,947.3m),지리산(1,915.4m)에 이어 남한에서 세 번째로 높은 산으로 강원도 속초시와 양양군,인제군에 걸쳐 있다.옛 문헌을 보면 지금의 대청봉이 있는 양양, 속초의 산만을 `설악\'이라 제한하였고 귀때기청봉이 있는 인제쪽의 산을 `한계산\'이라 따로 지칭했다. 그 예로 안산 남쪽 장수대 부근에 있는 한계산성이 이를 뒷받침하고 있다. 진부령에서 대청봉까지 이어지는 북주능의 백미는 뭐니뭐니 해도 수많은 암봉들로 구성된 공룡능선인데 이 코스가 바로 북주능의 등뼈 역할을 하는 공룡능선을 가장 짧은 시간에 주파할 수 있는 길이다. 이 능선은 1963년 겨울, 당시 한국의 암벽등반 선구자이던 선우증옥, 정규현, 채태웅씨 등이 처음으로 완등한 이후 산악인들로부터 각광을 받다가 최근엔 일반인들도 쉽게 할 수 있을 만큼 등산로가 잘 닦여있다. 백두산에서 남쪽으로 내리뻗어 이 땅의 기나긴 등뼈를 이루는 백두대간의 허리를 받들고 있는 설악산은 북의 금강산과 남의 오대산 사이에 솟아있는 천하의 명산으로 우리나라 관광명소 1호로 꼽힌다. 지난 1965년 11월 5일 천연기념물지구(163.4㎞), `69년 관광지(16.2㎞) 그리고 \'70년에는 국립공원(174㎞)으로 각각 지정되었다. 그리고 1971년 9월에는 설악산 국립공원 관리사무소가 개설 되었고 `77년 \'78년 두차례에 걸쳐 354.6㎞로 확장되었으며, 그 후 다시 374㎞로 넓이를 확대하였다. 울산암 등산로 초입에 있는 신흥사는 대한불교 조계종 제3교구 본사로 설악산의 대표적 사찰이다. 신라때 자장율사가 노루목근처에 향성사로 창건했다가 조선조때 현위치에 다시 세웠다고 한다.',';금강산보다 몇 수 위인 한국의 알프스;한마디로 한국의 알프스다. 흔히 금강산에 비유하지만 높이도 72미터나 낮고 동서로 긴 능선이 없어 산역은 훨씬 좁다. 그럼에도 금강산이 예로부터 더 유명했던 이유는 교통이 편리한 데다 짚신 신고도 못 올라갈 데가 거의 없을 만큼 산이 순하기 때문이다. 알피니즘의 관점에서는 더욱, 설악산이 금강산보다 몇 수 위다. 높이로는 한라산과 지리산 다음이나 빼어남으로는 분명 남한의 으뜸산이다. 백두대간인 공룡능선을 경계로 서쪽을 내설악, 동쪽을 외설악으로 나누는 것이 일반적이며 오색쪽을 따로 남설악으로 부르기도 한다. 내설악에는 백담계곡, 수렴동, 가야동, 탕수동(12선녀탕계곡) 등의 아름다운 계곡이 있고 외설악에는 계류미 뛰어난 천불동계곡과 협곡을 이룬 가지계곡들, 울산바위, 봉화대, 장군봉, 범봉 등 기골스런 암봉과 기암절벽을 자랑한다. 눈이 많은 까닭에 설산이나 설봉산, 한계산으로도 불렸다. 동국여지승람에는 \"\"한가위에 내리기 시작한 눈이 하지에 이르러 사라지기 때문에 설악이라 한다\"\"는 기록도 있다. 지금도 오월까지는 골짜기에 잔설이 남아있다.','38.119125000000004','128.4653611111111','42210112'),('2208064100','태화산','강원도 영월군 영월읍, 충청북도 단양군 영춘면',1028,'m89.jpg','강원도','신증동국여지승람에 대화산이라 지칭한 태화산은 강원 영월군 영월읍 남쪽에 자리해 있다. 정상에서 북서쪽으로 뻗은 능선 끝에는 남한강이 굽이쳐 흐르고 정상으로 향하는 길에 영월읍을 두루 굽어볼 수 있는 태화산성터가 남아 있다. 고구려 시대에 쌓았던 토성, 태화산성에서는 간혹 당시의 기와 파편이 발견되기도 한다. 태화산 정상에서는 멀리 남으로 소백산과 백두대간 줄기가 조망된다.',';남한강 휘감아 도는 억새의 산;강원도와 충북의 경계를 이루는 태화산은 이름에 걸맞는 크고 아름다운 산이다. 아울러 아담한 억새밭을 가지고 있어 가을산행지로 알맞다. 그렇지만 주위에 있는 원주의 치악산과 단양의 소백산, 월악산국립공원의 그늘에 가려 많이 알려지지는 못한 산이다. 이런 연유로 태화산에서는 아직도 사람의 발길이 닿지 않은 태고의 자연미를 볼 수가 있다. 게다가 남한강이 산자락을 휘감아 흐르고 4억년의 신비를 간직한 고씨동굴를 품에 안고 있어 산행의 묘미를 더한다. 사계절 변화무쌍한 부드러운 능선길은 아름다운 비경을 보여주고 가족단위 산행지로 적격인 산이다. 태화산 산행의 들머리는 주로 영춘, 팔괴리, 고씨동굴 등 3군데이지만 고씨동굴 쪽은 가팔라 주로 영춘이나 팔괴리를 들머리로 많이 잡는다','37.11759444444444','128.4853861111111','42750250'),('2209132600','치악산','강원도 원주시, 횡성군, 영월군',1282,'m86.jpg','강원도','치악산은 강원도 원주시와 횡성군의 경계를 이루는 산으로, 산세가 뛰어난 데다 영동고속국도와 중앙고속국도에 인접해 있어 교통이 편리해 중부권 산행지로 인기가 높다.',';장벽처럼 솟은, 척 봐서 명산;명산은 가까이 가보면 안다. 영동고속국도 원주를 지날 무렵 뭇 산을 제압하는 훤칠한 산이 보인다면 물어볼 것도 없이 치악산인 것이다. 들고을 원주(原州)에서 보면 그건 거대한 장벽이다. 17킬로미터의 장대한 주릉이 그대로 천여미터를 솟아올랐다. 이런 압도적 산세의 뒤편으로는 또 매화산(1083.1m)과 매봉산(1095m) 줄기를 실팍하게 뻗쳐 산물결 첩첩의 겹산을 만들고있다. 하여 사이사이 구룡사 큰골, 부곡분지, 상원골의 깊은 구렁을 형성한다. 한쪽은 개활지 끝의 1자형 산줄기로 바깥 세상에 선을 보이고 반대편은 겹산 첩첩, 웅숭깊은 맛을 들였다. 드러냄과 감춤이 반반씩인 이상적인 산세인 것이다. 구룡사 큰골의 감춤은 소나무의 왕 황장목이다. 증거처럼 절 입구에는 황장금표가 서있다. 상원골에는 \"\"낙엽활엽수의 박물관\"\"이라는 천연기념물(93호) 숲이 있다. 부곡분지로는 고려 선비 원천석을 숨겨 칼로 나라를 세운 조선 태종을 허탕치고 돌아가게 했다. 명산 치악이 가진 덕이다.','37.365125','128.05564722222223','42130310'),('2210011400','방태산','강원도 인제군 기린면, 상남면',1446,'m40.jpg','강원도','국내 최대의 면적을 자랑하는 자연휴양림을 거느리고 있는 방태산은 강원도 인제군과 홍천군의 경계를 이루는 산으로, 교통이 불편한 관계로 아직도 오염되지 않은 깨끗한 계곡을 간직하고 있다. 청정한 자연림에 들어서면 도심에서 불과 몇시간 거리밖에 떨어져 있지 않다는 사실이 믿어지지 않는다. 빽빽한 나무들 사이에 누워 하늘을 올려다보면 한줄기의 햇살도 허용하지 않는 수림의 깊이가 느껴진다.',';약수 많고 승지 많은 한국적 유토피아 ;이땅에서 식물살이가 가장 좋은 산이다. 고랫재 같은 흙에 덮인 후덕한 육산의 싸리나무, 복자기, 소나무, 산벚나무, 만병초… 수종(樹種) 전시장처럼 다양한 나무들과 고사리, 관중, 우산나물, 곰취, 수리취, 얼레지, 연령초, 양지꽃, 홀아비바람꽃…. 하마등처럼 너르평평한 능선 북쪽 기슭에는 적가리와 아침가리라는 승지가 있다. 이폭포저폭포가 틀어막은 전복껍질 모양의 적가리 안통에는 평평한 대지가 펼쳐졌고 활처럼 휘우듬한 아침가리 골짜기는 방동약수 뒷재가 아니면 길이 없다. 남쪽에는 궁궁을을(弓弓乙乙) 내린천이 산자락을 씻으며 흐른다. 종이깔때기 모양의 어두우니 골짜기는 9년 산판을 했다는데도 아직 어둡다. 그 어두움이 뿜어내는 맑은 물 내린천으로 흘러 보태 서쪽으로 갔다 북쪽으로 틀었다 서남쪽으로 나아가 3둔 5갈 여덟 군데 숨어살이를 만들고있다. 빼어나지는 않지만 난리통에 사람 살리기에는 더할 나위 없이 좋고 물 맑으며 푸근한, 아주 속 깊은 산이다.','37.89483611111111','128.35555','42810330'),('2210012400','점봉산','강원도 양양군 서면, 인제군 기린면ㆍ인제읍',1426,'m73.jpg','강원도','한계령 오른쪽으로 보이는 점봉산은 설악산 대청봉과 남북으로 마주보며 설악산 국립공원의 일부를 이루고 있다.주요 관광명소로는 12담 구곡으로 불리는 주전골이 있는데, 좌우로 갖가지 모양의 바위봉우리, 원시림, 맑은 계곡물이 어우러져 절경을 이루며, 특히 주전골 입구의 오색약수터는 빼놓을 수 없는 관광지다. 군사지역으로 출입이 통제되고 있는 것이 안타까울 뿐이다. 지소 조금 아래쪽 안국사로 오르는 길은 돌비탈을 지나야 하고 길도 애매하므로 산행기점은 일반적으로 서창리지소를 택한다.','오색약수 품은 설악산 전망대;점봉산은 오색온천과 약수를 끼고 있긴 하지만 설악의 그늘에 가려 그 위풍을 펴지 못했었다. 하지만 가을이면 가야동을 축소시켜 놓은 듯한 주전골과 설악의 천불동을 옮겨 놓은 듯한 기암들이 어울려 단풍산행지로 각광받는 곳이다. 점봉산의 옛 이름은 덤붕산이라 한다, 때문에 곰배령에서 점봉산으로 올라오다 만나는 작은 점봉산을 작은덤붕이라 부르기도 한다. 점봉산을 기고 있는 오색약수는 철분이 많이 함유된 탄산수로 위장병, 신경통, 빈혈 등에 효혐이 높다고 알려져 있다. 점봉산 산행은 오색, 한계령, 귀둔, 진동리 등에서 시작할 수 있지만 현재는 오색약수 구간만 이용 가능하다. 점봉산일원은 야생식물군락지가 있는 특별보호구로 지정되어 2026년까지 출입할 수 없다.','38.048899999999996','128.42549722222222','42830310'),('2210050800','대암산','강원 양구군 동면, 인제군 서화면',1313,'m21.jpg','강원도','대암산 정상 부근에는 큰 용늪, 작은 용늪이라 불리는 고지습원이 있는데, 작은 용늪은 이미 그 원래의 모습을 상실하여 숲으로 변해버리고 말았다. 큰 용늪은 우리나라에서 유일한 고지습원으로 연중 안개끼는 날이 많은 특수한 환경이 조성되고 있어 생태계 연구에 좋은 자료를 제공하고 있다. 큰 용늪에는 물이끼, 삿갓사초, 꼬리조팝나무, 꽃쥐손이풀 등의 식물군락이 있으며, 손바닥 난초, 비로용담, 끈끈이주걱 등의 희귀식물도 자라고 있다. 그 밖에 식물성 플랑크톤 63종, 돌말 19종과 천연기념물인 산양과 검독수리가 관찰된 바 있으며, 도룡뇽, 무당개구리, 줄흰나비 등도 볼 수 있다. 또 이 지역과 연결된 두타연계곡에서는 열목어를 비롯한 특산 어류 10여 종이 살고 있다. 대암산·대우산 천연보호구역은 분지·습원등 지형적으로 다양한 특징을 지니고 있고, 기후조건이 특이하여 희귀동식물이 자라고 있다. 또한 동식물의 남북한계·동서 구분의 현상이 나타나는 등 식물생태학·식물지리학적·식물분류학적 연구가치가 매우 큰 지역일 뿐만 아니라 다양한 동물상, 특이한 지형·지세 및 기후적 특성 등 다양한 자연 환경을 가지고 있어 학술적 가치가 크므로 쳔연기념물로 지정·보호하고 있다.',';고층습원의 명산;고층습원으로 잘 알려진 대암산은 정상부근에 있는 분지형으로 된 큰 용늪과 작은 용늪이 있다. 이 습원의 크기는 동서 약 150미터, 남북 약 100미터 내외의 부정형으로 서북에서 동남으로 완만한 경사를 이루고 있다. 높은 학술적 가치를 지니고 있는 이 고층습원에서 1968년 5월부터 1969년 8월까지의 기간중 김두영(현 강원도 학생과학관 근무)에 의해 부유생물 47종이 채집되었고, 한편 대암산에 분포한 식물의 종류는 총 59과 123종으로 그 중 고층습원의 특유종이 19종 미기록종 15종이 알려져 있어 생물의 보고이며 1973년 7월 10일 인근의 대우산과 함께 천연보호구역으로 지정되었다. 대암산 정상은 등산 통제구역으로 일반 등산은 생태식물원을 들머리로 한 정상 서남쪽 능선 코스만 가능하다.','35.20723055555556','128.7286777777778','42800320'),('2211050100','가리왕산','강원도 정선군 정선읍 회동리ㆍ북평면, 평창군 진부면',1562,'m2.jpg','강원도','가리왕산은 태백산의 지붕역활을 하고 있으며 경사도가 완만한 등산로로 유명하다. 산 능선에는 고산식물인 주목, 잣나무, 단풍나무등 각종 수목이 울창하며 산삼등 많은 산약초가 자라고 있다.회동리 입구에는 자연휴양림이 조성되어 각종 편의시설이 설치되어 있고 등산로 산행시간은 총 6시간 정도 소요된다. 군립공원으로 지정, 개발계획에 있으며 숙암방면 입구는 약 4km 구간에 철쭉이 밀집 자생하고 있다.','정선아리랑 흐르는 정선의 지붕 강원도 평창군과 정선군은 이 고장 지붕 역할을 하고 있는 가리왕산을 중심으로 험난한 고산준령이 이루어진다고 해도 과언이 아니다. 정선의 주산 가리왕산은 갈왕(葛王)이 난을 피하여 숨어든 곳이라 하여 갈왕산(葛王山)이라 불리다가 일제시대를 거치면서 가리왕산(加里王山)으로 불리고 있다.가리왕산 상봉 서쪽의 중왕산(1381.4m)과 상봉 사이 안부인 마항치(馬項峙)에는 국내 유일의 ‘강릉부삼산봉표(江陵府蔘山封標)’라 새겨진 비가 세워져 있다. 이는 일반인들의 채삼을 금지하는 구역을 뜻하는 것으로 가리왕산이 조선시대 때 산삼의 주산지였음을 알 수 있는 대목이다. 상봉을 중심으로 남동쪽으로 중봉(1436m), 하봉(1381.7m)에 이르기까지 육중한 산세가 부드럽게 이어진다.','37.461508333333335','128.56336666666667','42770250'),('2212010400','명성산','강원도 철원군 갈말읍, 경기도 포천시 영북면ㆍ이동면',922,'m32.jpg','강원도','명성산은 서울에서 동북으로 84Km, 운천에서 약 4Km 거리에 위치해 있다. 산자락에 산정호수를 끼고 있어 등산과 호수의 정취를 만끽 할 수 있는 산이다.일명 \'울음산\'이라 불리기도 하는데 거기에는 안타까운 전설이 전해 내려오고 있다. 신라의 마지막 왕자인 마의태자가 망국의 슬픔으로 이 산에서 통곡을 하자 산도 따라 울었다 한다. 나라를 잃은 슬픔을 산도 알았을까. 그런 연유로 \'울 명\' \'소리 성\'자를 붙여 명성산으로 불리게 되었다는 것이다. 산전체가 암벽으로 이루어져 산세가 당당하고 가파르며 가을이면 억새풀이 장관을 이룬다. 암릉과 암벽이 같이 형성된 산이라서 사시사철 다양한 풍경을 연출해 등산객들로 하여금 철따라 다른 느낌을 느끼게 해 준다. 정상은 민등봉이나 전망이 매우 좋으며, 남쪽으로 이어진 12봉 능선의 모습이 장쾌하다. 능선에서 우거진 억새풀밭을 오르락내리락 하는 사이에 지루한 줄 모르고 걷게 된다.',';황금빛 억새의 산;명성산 산자락에 걸쳐있는 산정호수와 더불어 명승지로서 유명하다. ‘울음산’을 뜻하는 명성산(鳴聲山)이란 이름은 궁예가 자신의 부하였던 고려 태조 왕건에서 패한 후 이곳으로 피신와 크게 울었다는 전설에서 비롯되었다. 그리하여 명성산 산자락에는 궁예봉을 비롯해 궁예가 도망쳤다는 패주골, 왕건의 군사가 쫓아오는 것을 살피던 곳이라 하려 이름 붙여진 망무봉 등, 명성산 곳곳에는 궁예의 전설이 아직 남아 있다.경기도 포천과 강원도 철원에 걸쳐 빚어진 명성산은 궁예왕굴을 비롯하여 자인사, 책바위, 등룡폭포 등의 경치가 뛰어난 곳이 많다. 특히 정상과 연결된 능선은 억새군락지를 이루고 있어 포천시에서는 매년 10월 둘째주 토, 일 양일간 억새축제를 열고 있다.','38.104283333333335','127.33815833333333','42780256'),('2213100200','가리산','강원도 춘천시 북산면ㆍ동면, 홍천군 두촌면ㆍ화촌면',1051,'m1.jpg','강원도','강원도 춘천시와 홍천군의 경계를 이루는 산으로, 산 정상에 서면 탁 트인 시야와 발 아래로 펼쳐진 소양호의 풍경이 등산객들의 발걸음을 멈추게 하는 곳이다. 산자락을 감싸 흐르는 조그마한 폭포의 물소리가 사람들의 마음을 시원하게 해주는 가리산은 우거진 숲과 노송들이 어루러져 비경을 이루고 있다.&#xd;소양호 쪽으로 하산하여 물노리 선착장에서 유람선을 타고 소양댐 선착장까지 나올 수 있어, 산행도 하고 배를 타는 재미가 있다.산이름인 가리는 \'단으로 묶은 곡식이나 땔나무 따위를 차곡차곡 쌓아둔 큰 더미\'를 뜻하는 순우리말로서, 산봉우리가 노적가리처럼 고깔 모양으로 생긴 데서 유래한다. 태백산맥 중 내지(內地) 산맥의 일부를 이룬다. 제1봉 남쪽에서 홍천강이 발원하여 북한강의 지류인 소양강의 수원(水源)을 이룬다.능선은 완만한 편이나, 정상 일대는 좁은 협곡을 사이에 둔 3개의 암봉으로 이루어져 있으며 강원 제1의 전망대라고 할 만큼 조망이 뛰어나, 소양호를 비롯하여 북쪽으로 향로봉에서 설악산을 거쳐 오대산으로 힘차게 뻗어나간 백두대간 등 강원 내륙의 고산준령이 한눈에 보인다. 정상 부근에서는 소양호로 갈 수 있는 가삽고개가 있는데, 그 형태가 계단식 분지형으로 이루어져 있다.북쪽 산록은 소양호에 미치고 동쪽 산록에 홍천광산이 있다. 산기슭에는 숲이 우거져 있고 갖가지 기암괴석이 즐비하며, 산 정상과 계곡에는 향토 수종인 참나무가 주종을 이루며 자라고 있다. 아래쪽에는 두릅나무·철쭉·싸리나무·산초나무 등 관목류와 약용으로 사용되는 피나물·애기똥풀·양지꽃 등 야생화가 서식하고 있다. 강원도에서 진달래가 가장 많이 피는 산으로도 유명하다.&#xd;1998년 가리산 자연휴영림으로 개장되어 통나무집·야영장·체육시설 등 편의시설이 있다. 휴양림 입구에는 높이 8m의 용소폭포가 있고, 주변에 스키장·온천·수타사·팔봉산 등의 관광지가 있다.',';소양강 비경 담은 신비한 암봉;가리산은 강원도 홍천군 두촌면과 화촌면, 춘천시 북산면, 동면에 걸쳐있는 해발 1050.9m의 산이다. 정상부를 이루는 산세가 마치 곡식을 차곡차곡 쌓아둔 ‘낟가리’와 닮았다고 하여 ‘가리산’이라 이름 붙여졌다고 전한다. 대체로 육산을 이루고 있는 산세이나 정상부는 거대한 3개의 바위봉우리로 이루어져 있다. 북서쪽에 자리잡은 소양호의 조망이 일품이며, 서쪽으로는 대룡산 어름이 보인다. 또 정상 아래의 바위 절벽에서 사시사철 솟는 석간수가 유명하다. 가리산은 홍천9경 중 2경으로 꼽힌다.','37.87137777777778','127.95646944444445','42110380'),('2213103900','오봉산','강원도 춘천시 북산면, 화천군 간동면',778,'m60.jpg','강원도','강원도 춘천시 북산면과 화천군 간동면 사이에 있는 오봉산은 해발 779m이고 다섯개의 봉우리가 있다고 해서 오봉산이라고 한다. 기암절벽과 노송이 어울려 한폭의 동양화 같은 산으로 유서깊은 청평사가 있다. 배후령에서 오르게 되는 첫번째 봉우리가 1봉(나한봉), 두번째 봉우리인 관음봉, 세번째 봉우리인 문수봉, 네번째 봉우리인 보현봉, 다섯번째 봉우리인 정상 비로봉이 있다. 이중 제5봉인 정상에서 청평사 방면으로 뻗어내린 암릉이 특히 빼어난 풍광을 지녔다. 이 암릉을 따라 소양호를 바라보며 내려가는 길이 오봉산행의 백미라 할 수 있다.',';봉만미, 계곡미 좋은 남한의 막장;봉만미와 계곡미가 뛰어난 데다 남으로 소양호, 북으로는 파로호가 보이는 명당에 자리잡았다. 고려시대 조경을 자랑한다는 절 청평사와 회전문(回轉門)이라는 특이한 이름의 문도 있다. 이 북쪽으로는 갈 수 있는 산이 없는 막장, 북위 38도다. 명산의 조건을 두루 갖춘 데다 호기심까지 자극하는 대상지가 아닐 수 없다.춘천에서 양구로 향하는 46번 국도상의 배후령을 들머리로 하면 산행 또한 쉽다. 그러면서도 1봉 나한봉, 2봉 관음봉, 3봉 문수봉, 4봉 보현봉, 그리고 정상 비로봉의 핵심부를 놓치지 않는다. 다음 비경의 선동(仙洞)계곡으로 하산, 아홉 가지 소리를 낸다는 구성(九聲)폭포와 청평사를 구경하고 보물 146호의 회전문이 정말 돌아가는지 이름만 그런 문인지를 확인할 수 있다. 춘천으로 나오는 길에는 내륙의 바다 소양호를 선상유람하는 금상첨화까지 있다. 1봉부터 5봉까지의 암봉릉만이 아니라 남릉도 바위투성이다. 위험 구간에는 철주와 쇠줄이 빈틈없이 설치돼있지만 노약자와 동행하는 것은 금물이다. 눈이 오는 겨울에는 더더욱 그렇다. 삐죽삐죽 다섯 봉우리가 솟아있다고 해서 오봉산인데 본래는 이 이름이 아니었다. 옛이름은 경운산(慶雲山)이었다.','35.78431666666666','128.09412222222224','42110380'),('2213142900','삼악산','강원도 춘천시 서면',656,'m49.jpg','강원도','삼악산(三岳山)은 한북정맥상의 포천 백운산 밑에서 동쪽으로 갈라진 지맥이 석룡산, 화악산, 계관산으로 이어지고 옛날 경춘 간 육로교통의 춘천관문이었던 석파령을 넘어 끄트머리에서 솟아 신연강 협곡을 이루어 놓은 명산이다. 또한 협곡에 설치된 의암댐으로 호수가 생겨 물 속에 투영된 산을 볼 수 있어 더 한층 좋다. 매표소에서 계곡을 오르다 보면 등선폭포, 비선폭포, 승학폭포, 백련폭포등 크고 작은 폭포가 있으며, 용화봉, 청운봉, 등선봉을 비롯 3개의 봉우리에서 뻗어내린 능선이 암봉으로 이루어져 절경을 이룬다.기암괴석이 많고 소나무, 참나무등의 수림이 울창하며 계곡미가 빼어나다.삼악산의 산행기점은 세 군데 이다. 등선폭,상원사,강촌역에서 다리건너 바로 시작하는 세 기점이 있다. 대부분의 등산객들이 등선폭쪽에서 산행을 시작하나, 의암댐이 있는 상원사입구에서 시작하여 등선폭포로 내려오는 것이 좋다.',';수도권 당일 열차산행지의 대명사;삼악산은 등선봉, 청운봉에서 이어지는 한 봉우리다. 강촌의 대표적인 산으로 하나의 독립봉으로 사람들이 즐겨 찾고 있으며 접근이 용이하여 당일산행지로서 각광받고 있다. 거대한 성을 연상시키는 등선폭포 매표소를 지나 깎아지른 절벽 사이로 난 폭포길을 들머리로 삼거나 의암댐 매표소에서 산행을 시작해도 무방하다. 폭포길은 철계단이 만들어져 있어 가까이에서 폭포의 웅장함을 엿볼 수 있으며 따스한 햇빛의 호위를 받으며 산행할 수 있다. 반면 의암댐 길은 청정한 노송과 바위들이 어우러진 절경이 빼어난 바윗길이다. 바위능선으로 구성된 삼악산 정상에 서면 북서쪽으로 화악산(1468.3m)이, 그 오른쪽으로 북배산(869.6m)과 계관산(736m)의 능선이 이어진다. 북동쪽으로는 북한강과 소양강을 머금고 있는 의암호가 발아래로 펼쳐지며 용화산(877.8m), 오봉산(777.9m) 등도 보인다.','36.03926111111111','128.01482777777778','42110350'),('2214180500','덕항산','강원도 삼척시 신기면ㆍ태백시 하사미동',1073,'m25.jpg','강원도','\'환선굴\'로 유명해진 덕항산은 강원도 삼척시 신기면에 자리해 있다. 이 산은 동남으로 펼쳐진 병풍암을 비롯하여 깎아놓은 듯 반듯한 암석과 거대한 암벽들이 수려한 산세를 이루며 동으로는 오십천으로 합류하는 12km길이의 무릉천이 흐르고 있어 산행하기 적합한 곳이다.',';언제나 안개에 싸인 환상의 산;어느 산객이 \"\"우리나라에서 그랜드캐년을 닮은 곳이 있다면 거기는 바로 덕항산 자암골\"\"이라고 설파했던 기경(奇景)의 산이다. 경동지괴(傾動地塊)의 표본을 이루는 곳으로 동쪽은 깎아지른 석회암 사면, 서쪽은 1000미터 전후의 고위평탄면을 이룬다. 석회암 사면에는 환선굴, 바람굴, 관음굴 같은 동굴들과 촛대봉, 사다리바위, 나한봉, 수리봉, 금강봉, 미륵봉 같은 기암들이 즐비하다. 골짜기는 거의 언제나 안개에 차있고 그 사이로 언뜻언뜻 험산과 기암이 드러나는 환상적인 풍경이다. 원래 이름은 덕메기[산]이었다. 삼척쪽에서 부르던 것으로 \"\"저 너머에 화전하기 좋은 더기(고원)가 있는 뫼\"\"라는 뜻이라고 한다. 그것이 덕목이로 변해 \'목 항\'자 덕항산으로 표기된 듯하다. 그 더기는 지금 광동댐 수몰민들의 고랭지채소밭이 되어있다. 썩 유명하지 않은 산이어서 지리적, 생태적 조사가 거의 안 돼있다. 산역(山域) 파악이 특히 안 돼 광동댐 이주단지 서쪽에 1130봉이 있는데도 대이리에서 가장 높게 보이는 1071봉을 주봉으로 여긴다. 이는 그 서북쪽에 있는 백두대간상의 환선봉(1079m)보다도 낮다. 산경표에는 댓재 죽현(竹峴) 다음에 건의령(建儀嶺)이 이어진다. 따라서 둘 사이에 있는 덕항산은 댓재에서 건의령까지가 영역이고 상봉은 1130봉이다.','37.308825','129.01262777777777','42230360'),('2214211300','태백산','강원도 태백시, 경상북도 봉화군 석포면',1567,'m88.jpg','강원도','태백산은 경상북도 봉화군 석포면 대현리와 태백시 문곡소도동 그리고 강원도 영월군 상동면 천평리와 접경을 이루며 동경 128。56\" 북위 37。05\"에 자리잡은 해발 1,566.7m의 명산이다. 이 산에서 발원하는 물이 영남평야의 젖줄인 낙동강과 우리민족의 역사와 함께한 한강, 삼척의 오십천을 이루니 국토의 종산이자 반도 이남의 모든 산의 모태가 되는 뿌리산이다.태백산은 천제단이 있는 영봉을 중심으로 북쪽에 장군봉(1567m) 동쪽에 문수봉(1,514.9m), 영봉과 문수봉사이의 부쇠봉(1,549.4m)로 이루어져 있다. 암벽이 적고 경사가 완만하여 남녀노소 누구나 쉽게 오를 수 있는 산으로 정상에는 고산식물이 자생하고 봄이면 산철쭉, 진달래의 군락지가 등산객을 맞이하고 여름에는 울창한 수목과 차고 깨끗한 계곡물이 한여름 더위를 잊기에 충분하며 가을은 형형색색의 단풍으로 수놓으며 겨울은 흰 눈으로 뒤덮인 주목군락의 설경을 보여 주는 곳으로 남성다운 중후한 웅장함과 포용력을 지닌 육산으로 이루어져 있다. 또한 정상에서 바라보는 일출과 낙조는 장엄하여 세속을 떠난 천상계를 연상케 하고 맑은 날 멀리 동해 바다를 볼 수 있는 것도 태백산이 가지고있는 자랑거리이다. 이 밖에도 최고높은 곳에 위치한 한국명수중 으뜸수 용정, 용담이 있다.1989년 5월 13일 17.44㎢의 면적이 도립공원으로 지정되었으며 소도집단시설지구에 콘도형인 태백산 민박촌을 비롯하여 숙박시설,음식점,야영장 등이 마련되어 있으며 석탄의 역사를 한 눈에 볼 수 있는 석탄박물관이 있고, 겨울철에는 대규모의 눈썰매장이 개장된다.',';신라 임금 순행했던 성산이며 영산, 명산;신라 임금이 둘씩이나 순행을 갔던 성산(聖山)이다. 그때는 물론 봉화 태백산이었는 바 기실은 그쪽이 태백산의 정면이다. 산의 대부분이 그 영역인 북쪽의 태백시는 구한말 비결파들이 몰려들기 전까지는 무인지경이었다. 남쪽에서 본 산의 모습은 성스럽기 그지없다. 특히 부쇠봉 산허릿길을 갈 때의 상봉 장군봉은 스투파(塔婆)의 원조라는 인도 산치의 대탑 같다. 봉분(封墳)처럼 둥근 산덩이 위의 네모꼴 단이 저 유네스코가 정한 세계문화유산과 닮은꼴을 이루고있는 것이다. 민속신앙의 성지기도 하다. 주등산로 입구의 당골은 무당들이 사철 끊이지 않는다. 정상에서 산(山)기도를 하면 신기(神氣) 충전이 그렇게 잘 된다고 한다. 제3공화국 이래 \"\"유사종교 정화작업\"\"을 수도 없이 했는데도 그들이 몰려드는 이유다. 이름까지 산을 본딴 태백시는 산에 기댄 축제를 넷씩이나 벌이고있다. 6월 철쭉제, 개천절 천제(天際)를 하이라이트로 하는 태백제, 새해 첫날의 해맞이축제, 1월의 눈축제가 그것이다. 철쭉과 눈꽃이라는 자연환경에다 신라 이래의 제사문화로 관광상품을 만든 것이다. 태백산은 그만한 가치가 있다.','36.89895','126.65721111111111','47920390'),('2215034400','백운산(정선)','강원도 정선군 신동읍, 평창군 미탄면',884,'m44.jpg','강원도','동강을 끼고 있는 백운산. \'태고의 신비\'와 \'천혜의 비경\'까지 갖춘 동강은 강원도 산 속 깊숙이 숨어서 말없이 흘러가고 있다. 그래서 일까. 백운산 산행은 마치 신선이 된 듯한 기분을 선사해준다.백운산 산행을 위해서는 동강을 건너야 한다. 그리고 산행을 마쳤을 때도강을 건너와야 한다. 하지만 물을 건너지 않고 아예 칠족령에서 문희 마을로내려선뒤 보트를 타고 섭새까지 내려오는 방법도 있다. 산과 강을 동시에즐기는 코스다. 하지만, 백운산 산행은 점재 마을에서 시작하는 것이 일반적이다.',';빼어나면서도 웅장한 바구다리산;댐이 건설된다고 나라를 떠들썩하게 했던 동강변의, 동강이 보이는 산이다. 산간 감입곡류(嵌入曲流)의 극치를 내려다볼 수 있으며 산행 전후에 래프팅을 즐길 수도 있다. 남쪽으로 뻗어내리는 용가능선, 서남향의 칠족령능선이 강 건너 소동마을의 누더기 같은 밭자락들, 구하도(舊河道)가 만들어놓은 섬 아닌 섬을 움켜쥐고 있는 듯한 형세다. 용가능선은 개발처럼, 갈수록 낮아지고 좁아지다 끝부분이 넙적한 모양인데 칠족령능선은 여섯 봉우리들이 담장 위 유리조각처럼 뾰족뾰족하다. 정상에 서면 굽이지는 동강의 흐름이 속속들이 보인다. 건너편의 완택산, 고고산, 계봉, 곰봉은 물론 멀리 함백산까지 조망된다. 하지만 석회암 산이어서 칼로 자른 듯한 벼랑이 많다. 지역 사투리로 뼝대라고 부르는데 종종 실족사고가 일어나니 각별히 조심해야한다. 백운산을 바라보는 망대는 소동마을 남쪽의 고성산성(425m)이다. 고구려가 쌓은 것으로 보이는 돌성으로 일대의 비경 감상은 물론, 이런 산간협곡에 왜 성을 쌓았는지 추측할 여지도 준다.','38.07483611111111','127.44448333333334','42770259'),('2215064300','계방산','강원도 홍천군 내면, 평창군 용편면ㆍ진부면',1579,'m8.jpg','강원도','남한에서 한라산(1947.3m) 지리산(1915.4m) 설악산(1708.1m) 덕유산(1614.2m)에 이어 다섯 번째로 높은 계방산은 겨울철 적설등반 산행지로 유명한 산이다.강원도 홍천군 내면과 평창군 진부면에 걸쳐 있는 광대한 산맥을 거느리고 있으나, 북동쪽으로 연결되어 있는 오대산의 명성에 가려 빛을 보지 못했던 명산이다. 높은 산이면서도 유순한 산세와 능선을 가지고 있으며 가을이면 온 산을 단풍으로 물들이고 겨울철에서 무릎이상 빠질정도의 적설량으로 등산인들의 사랑을 듬뿍 받고 있는 산이다. 산기슭에 있는 방아다리 약수는 위장병, 피부병에 효험이 있는데 메밀꽃 필 무렵 마시면 특효가 있다고 한다.',';오대산과 이웃한 남한 5위봉;백두대간의 오대산에서 곁가지를 쳐 남한강과 북한강을 가르는 지릉의 최고봉이다. 평창군의 유명한 가리왕산의 모산이기도 한 오대산 비로봉보다도 더 높아 백두대간을 바라보는 최고의 전망대를 제공하는 계방산은 한라, 지리, 설악, 덕유산에 이어 남한 제5위봉이다. 그러나 남한 제5위봉이라는 사실을 제외하고도 계방산에는 흥미로운 것들이 있다. 차량이 다니는 남한에서 가장 높은 고개 운두령이 그 하나다. 운두령에서 정상까지의 표고차는 488미터로 초보자도 쉽게 오르면서 고도감을 한껏 만끽할 수 있어 계방산의 인기를 높여준다. 남쪽 산자락에는 이승복 생가터와 전국에서 이름난 방아다리약수를 품고 있다. 영동지방의 바닷바람과 대륙에서 불어오는 북서풍이 부딪쳐서 많은 적설량을 보인다. 그래서 아름다운 설경을 연출, 그 진가를 발휘하는 계방산은 겨울 산행코스로 단연 손꼽힌다. 그러나 산행시간은 눈이 있을 때와 없을 때에 많은 차이를 보인다. 보통 때에 비해 능선이든 골짜기이든 2배 이상을 예상해야 한다.','37.728341666666665','128.4655','42720390'),('2215072100','오대산','강원도 평창군 진부면, 홍천군 내면, 강릉시 연곡면',1565,'m59.jpg','강원도','울창한 숲과 이름난 사찰, 약수, 유적지 등이 산재해 있어 관광객과 등산객으로 늘 붐비는 오대산은 강원도 평창군 진부면과 도암면, 홍천군 내면, 강릉시 연곡면의 오대산국립공원의 서부지구에 위치해 있다. 특히 짧은 산행이지만 유서깊은 사찰과 암자를 곳곳에서 볼 수 있는 상원사와 적멸보궁, 정상인 비로봉을 거쳐 미륵암으로 하산하는 코스가 가장 유명하다. 상원사는 6·25때 한암이라는 승려의 산화로 아군의 전략상 소실될 뻔 하였던 위기를 피해 현재까지 그 형태를 보존하고 있는 사찰이다. 국보 36호인 동종이 있으며 신라시대 자장법사에 의해 창건되었다.예로부터 금강산, 한라산, 지리산과 더불어 국내 제일의 명산으로 알려져 온 오대산은 골짜기마다 아름드리 나무가 숲을 이루고 있어 남한 최대의 수림을 자랑하다. 또한 강원도 일대의 산들이 대부분 기암괴석으로 이루어진 것과는 토산으로 이루어져 있어 한국산의 전형을 보여준다. 높이로 본다면 비로봉은 오대산의 최고봉이자 이 산의 정상이라 할 수 있다. 백두대간의 주맥이 설악에서 이어져 두로봉과 동대산으로 연결되는 서쪽 일대에 자리하고 있는 오대산은 명산으로 이름이 난 만큼 유서깊은 사찰과 암자들이 많다. 또한 산에 관련된 신비로운 전설들이 많이 전해 내려오고 있어 오대산의 명성을 더하고 있다. 오대산의 다섯 봉우리는 호령봉, 비로봉, 상왕봉, 두로봉, 동대산이다. 이 다섯 봉우리중 비로봉이 제일 높은 봉우리이고 그 다음이 호령봉이다.',';숲 짙고 암반 좋은 불교 성산;다섯 개의 봉우리를 가진 산이란 뜻의 오대산은 동서 20km, 남북 33km, 660㎢의 광대한 면적을 자랑한다. 주봉인 비로봉(1565.4m)을 중심으로 상왕봉(1493m), 호령봉(1565.5m), 두로봉(1422.7m), 동대산(1433.5m), 동쪽으로 솟은 노인봉(1338.8m) 등의 고봉이 장쾌하게 솟아 있으며, 월정사, 상원사, 중대 사자암, 북대 미륵암, 남대 지장암, 동대 관음암, 서대 수정암 등이 자리잡고 있어 불교성지로 위용을 떨치고 있는 대표적인 명산이다.오대산은 크게 월정사지구, 소금강지구로 나뉘는데 월정사지구는 문화재의 보고를 둘러볼 수 있는 코스라면, 구룡폭포, 낙영폭포 등과 함께 만물상, 식당암 등이 기암들이 들어서 있는 소금강지구는 계곡미를 한껏 느끼며 계곡산행을 즐길 수 있는 코스다. 또한 방아다리약수를 기점으로 약수산행도 가능하다. 오대산은 봄에는 야생화의 보고답게 꽃들이 만발하고 여름에는 시원한 계곡과 울창한 산림, 가을에는 중후한 세련미를 느끼게 하는 오색단풍과 겨울에는 눈꽃으로 뒤덮인 장관을 연출함으로써 사시사철 어느 때 찾더라도 황홀함을 맛볼 수 있다.','36.13529166666667','127.34517222222222','42760360'),('2215081700','백덕산','강원도 평창군 방림면, 횡성군 안흥면, 영월군 수주면',1350,'m41.jpg','강원도','백덕산은 이름 그대로 하얀 눈이 쌓였을 때 절경을 이루는 산이다. 겨울이면 무릎까지 빠지도록 많은 눈이 내린다. 1천m 이상의 주능선 봉오리마다 피어나는 설화(雪花)가 은백색의 세계로 빠져드는 환상을 느끼게 한다.',';설경 빼어난 천연원시림의 산 ;백덕산은 평창군 방림면과 평창읍, 영월군 주천면과 수주면, 횡성군 안흥면의 경계에 솟아있는 해발 1350.1m의 산이다. 천연 원시림을 간직한 주계곡과 함께 설경이 뛰어나 겨울철 산행지로 유명하다. 더욱이 백덕산 남서쪽 연화봉 아래에 설악산 봉정암, 오대산 상원사, 영취산 통도사, 정암사 태백산과 함께 5대 적멸보궁 중 하나인 신라시대 천년고찰 법흥사가 있어 더욱 유명하다.백덕산을 오르내리는 길목인 사자산(1180.4m)은 원래 사재산(四財山)이었다. 이는 옻, 꿀, 삼, 흉년에 먹는다는 전단토 등 4가지 보물이 있어 사재산에서는 굶어 죽지 않는 전설에서 나온 이름이다. 그러나 법흥사를 창건한 자장율사가 부처님의 사리를 지금의 적멸보궁으로 모셔오면서 사자를 타고 왔다 하여 사자산으로 불리고 있다.','37.396430555555554','128.29350277777777','42760320'),('2216075500','팔봉산','강원도 홍천군 서면 팔봉리',328,'m91.jpg','강원도','주능선이 마치 병풍을 펼친 듯한 산세로, 예부터 \'소금강\' 이라 불리어질 만큼 아름답다. 게다가 주능선 좌우로 홍천강이 흐르고 있어 정상에 올라서 바라보는 전망이 더 없이 좋으며, 물놀이도 겸할 수 있는 곳이다.팔봉산은 흔히 두 번 놀라게 하는 산으로 알려져 있다. 낮은 산이지만, 산세가 아름다워 놀라고 일단 산에 올라 보면 암릉이 줄지어 있어 산행이 만만치 않아 놀란다는 것이다.',';홍천강 안고도는 톱날 수석;팔봉산은 산 같지도 않은, 300미터가 조금 넘는 동산이다. 그럼에도 같은 이름의 어떤 산보다 사람들이 많이 찾는, 유명한 산이다. 여덟 봉우리가 모두 바위로 되어있어 하늘금이 둥근 톱날처럼 역동적이고 스릴이 넘치기 때문이다. 그래 작은 산이지만 대개의 등산객들은 팔봉 넘기를 다 하지 못한다. 철계단과 쇠줄까지 쳐있는데도 마지막 봉우리는 포기하고 돌아서기 일쑤다. 작아도 강단(剛斷) 있는 산이다. 발치 3면은 홍천강이 싸고돈다. 강물은 깊푸르나 물가에는 모래벌이 펼쳐졌다. 그냥 모래 하얀 수반(水盤)에 물이 잘박거리는 수석(壽石)인 것이다. 요산요수를 겸하기에 이보다 나은 데가 있겠는가? 강 건너 서쪽의, 늪둔지라는 우각호(牛角湖) 가에는 밤나무숲이 울창하다. 근래 오토캠핑장을 만든다며 많이 베어버렸지만 아직도 옛모습이 꽤 남아있고 옛 강길도 띄엄띄엄 그대로 있다. 이런 명산(名山)영수(靈水)기 때문에 예나 지금이나 교통이 불편한데도 사람들은 철을 가리지 않고 찾아든다.','35.42064722222222','128.75660833333333','42720380'),('2216100300','공작산','강원도 홍천군 동면, 화촌면',887,'m9.jpg','강원도','공작산은 강원도 홍천군 동면과 화촌면의 경계를 이루는 산으로, 공작이 날개를 펼친 듯한 산세에 암봉과 노송이 어우러져 한 폭의 동양화를 연상케 하는 산이다.정상에서 서남쪽 능선을 따라 6km 산자락에 있는 수타사에서 노천리에 이르는 약 8km길이의 수타계곡은 암반과 계곡의 경치가 뛰어나 여름철 계곡 피서지로 이름난 곳이다. 정상에서 바라보면 홍천군 일원이 한눈에 들어오며, 풍치가 아름답고 깎아 세운 듯한 암벽이 장관을 이루는 곳이다. 정상에서 서남쪽 능선 약 6km 아래에 있는 수타사와 노천리까지 이어지는 약 8km의 수타계곡은 갖가지 멋진 바위들과 아름다운 풍경이 비할 데 없다. 산 정상에서 바라보면 홍천군 일원이 한눈에 들어오며, 봄에는 철쭉과 가을철에는 단풍이 노송과 함께 깍아 지른 듯한 바위와의 모습이 보는이의 마음을 사로잡고 눈덮인 겨울산 역시 등산객들을 매료시키는 곳이기도 하다.',';비경의 수타계곡 품은 홍천의 명산;산이 동물 모습을 빼다박으면 영기가 있다고 한다. 영취산, 사자산, 정상부를 봉정이라 불렀던 설악산…. 그래서 자장율사는 이들 기슭에 진신사리를 묻었다. 하지만 진신사리가 다 떨어졌을 때 그런 산이 발견되었다면 무릎을 칠 수밖에 없었을 것이다. 공작산이 그 대표적 사례다. 홍천강 양쪽에 벌여있는 화촌면의 동부 전역을 물받이로 삼고있는 군업천을 거슬러가며 보면 산 머리가 영락없이 새 모양이다. 양 날개를 내삼포리와 응봉산 경계까지 펼치고있는. 안공작재 이서(以西)의 산줄기들은 소용돌이처럼 돌아가면서 홍천강으로 긴 꼬리를 흔들고있다. 이를 발견한 산 감정사의 안타까운 마음이 손에 잡히는 순간이다. 남쪽 경계를 이루는 수타사계곡으로 더 잘 알려져있다. 들판을 흐르던 물이 산 속으로 들어가 비경을 연출하는 까닭이다. 누워있긴 하지만 40m 길이의 공작폭포도 있고 보물(745, 746호의 월인석보)이 발견된 유서 깊은 절도 있으니 갖출 건 다 갖췄다. 이 어찌 명산이 아니라 하겠는가?','37.71601666666667','128.0106361111111','42720350'),('2217011600','용화산','강원도 화천군 간동면ㆍ하남면, 춘천시 사북면',878,'m62.jpg','강원도','해발 878m의 용화산은 간동면 유촌리, 하남면 삼화리와 거레리, 춘천시 사북면 고탄리에 걸쳐있다. 북쪽으로는 파로호를, 서쪽으로는 춘천호를, 남쪽으로는 소양호의 중심에 위치한 산이다. 용화산 준령과 오봉산 사이에 성불령이라는 고개가 있고 여기에 성불사 터가 있다. 옛부터 성불사 저녁 종소리와 용화산 안개와 구름, 기괴한 돌, 원천리 계곡의 맑은 물, 부용산의 밝은 달, 죽엽산의 단풍, 구운소의 물고기 등을 옛부터 팔경이라 불렀다. 산에는 광바위, 심바위, 꼭지바위, 주전자바위, 마귀할미바위, 바둑바위 등 실물을 방불케하는 기암괴석이 있다.',';호수에 포위된 천혜의 바위 요새 ;용화산은 강원도 춘천시 사북면과 화천군 하남면 경계에 솟은 바위산이자 춘천의 의암댐, 소양댐, 춘천댐, 화천댐에 포위된 천혜의 성벽이다. 보통 들머리로 잡는 고성2리 양통골로 용화산에 들어서면 가장 먼저 바위봉우리들이 눈에 들어온다. 춘천시 방면으로는 깎아지른 바위 절벽을 이루고 있는데, ‘새가 난다’하여 이름 붙여진 새남바우를 비롯해 하늘벽 촛대바위, 층층바위, 득남바위 등의 기암과 함께 용화산 정상에서 서쪽으로 흘러내리는 만장봉 일원의 암골미는 용화산의 백미라 할 수 있다. 특히 노송군락을 품고 있는 만장봉 너럭바위에서 바라보는 하늘벽 촛대바위의 경치가 일품이다. 만장봉에는 1976년도에 암벽등반 코스가 개척되어 지금도 등반가들이 종종 찾고 있다. 만장봉과 정상 사이의 바위능선에서는 춘천의 산군이 잘 보이는데, 정상에 다다를 즈음이면 대룡산(899.3m)과 삼악산(655.8m) 정상이 보이는 것은 물론 삼악산 북서쪽으로 뻗은 북배산, 가덕산, 서쪽의 삿갓봉과 응봉이 보인다. 이밖에도 용화산에는 옛날 춘천지방에 있던 고대국가 맥국(貊國)의 성문역할을 하던 배후령, 성불령, 사야령, 큰고개, 모래재 등의 고갯길 10여 곳의 흔적이 남아있다.','35.37916944444444','128.44653055555557','42790310'),('2301072800','희양산','경상북도 문경시 가은읍, 충청북도 괴산군 연풍면,',996,'m100.jpg','경상북도','희양산은 충북의 괴산과 경북의 문경에 걸쳐 거대한 하나의 바위덩이로 이루어진 듯 당당한 위세를 뽐내고 있는 산이다. 정상에서 북쪽은 시루봉, 서쪽으로는 구왕봉으로 이어져 나가며 기세를 진정시키지만, 동남서쪽으로 노출된 암장능 곡클라이밍 코스로 다시 없이 좋아 이미 여러개의 코스가 개발되어 있다. 병풍처럼 둘러쌓인 거대한 화강암벽은 설악산 울산바위에 필적할 만 하며, 암벽 하단부인 2백여m의 슬랩과 암벽은 위압감을 느끼기에 충분하다. 정상 남쪽 아래 유서깊은 봉암사가 있고, 옥석대와 그 주변 일대에 펼쳐진 옥석계곡의 뛰어난 정경은 등산의 또 다른 맛을 준다.',';백두대간의 신령스런 암봉;희양산(999m)은 경북 문경시 가은읍과 충북 괴산군 연풍면의 경계를 이루며 백두대간에 우뚝 솟은 신령스런 암봉이다. 인근의 조령산(1026m)이나 백화산(1064m)보다 낮으나 빼어나기로 보자면 단연 으뜸이다. 희양산 봉암사 개산조인 신라시대의 승려 지증대사(824~884년)는 \"\"산은 사방에 병풍처럼 둘러쳐져 있으니 마치 봉황의 날개가 구름을 치며 올라가는 듯하고, 계곡물은 백겹으로 띠처럼 되어있으니 용의 허리가 돌에 엎드려 있는 듯하다\"\"고 희양산 자태를 칭송했다고 전한다. 정상에서 조망은 장쾌하고 아름답다. 발 아래로 봉암사와 봉암용곡이 보이고, 그 너머로 대야산과 속리산 줄기가 날카롭게 솟아있다. 서쪽으로는 장성봉, 악희봉, 군자산 등 충북 내륙의 산들이 병풍처럼 둘러져 있다. 동북쪽 조망은 끝없이 펼쳐지는 백화산, 운달산, 주흘산 줄기가 연꽃잎이 피어난 듯 아름답기 그지없다.','36.71473055555556','128.0050361111111','47280253'),('2302011300','소백산','경상북도 영주시 풍기읍, 충청북도 단양군 단양읍',1440,'m54.jpg','경상북도','경상북도와 충청북도의 경계를 이루고 있는 소백산은 우리 나라 12대 명산 중의 하나로 \'한국의 알프스\' 라 불린다. 이 산은 총 면적이 320.5km에 달하는 거대한 산줄기로 정상인 비로봉을 비롯하여 연화봉(1,376.9m). 제 2 연화봉(1,357.3m). 국망봉(1,420.8m) 등 1천m 고봉이 줄지어 있어 웅장한 산세를 이루고 있다.',';웅장하면서도 여성미의 산;소백산(1439.7m)은 백두대간이 거느린 명산 중 하나다. 동쪽에서부터 국망봉, 비로봉, 연화봉, 죽령 너머의 도솔봉 등 1000m가 넘는 봉을 연결하는 장쾌한 능선이 20km 이상 뻗어 있다. 이중 도솔봉을 제외한, 소백의 삼봉(국망봉 비로봉 연화봉)은 13km가량 떨어진 채 일렬로 쭉 솟아 있다. 운해라도 끼면 큰 봉우리들은 망망대해의 섬인듯 갖가지 모양으로 구름 속에 떠 있어 장관을 연출한다. 소백산은 5,6월이면 철쭉꽃 붉은 바다를 이뤄 많은 등산인들을 불러들인다. 소백 삼봉으로 이어지는 구간이 단연 압권이다. 8월이면 부드러운 초원길엔 온갖 고산식물로 뒤덮여 하늘에 떠 있는 식물원에 와 있는 듯하다. 비로봉 일대의 주목군락은 원시성을 간직하고 있는 천연기념물이다. 웅장하면서 부드러운 산세의 소백산에서 가장 유서 깊은 골짜기는 희방골로 많은 등산인들이 이곳에서 출발해 산행을 시작한다.','36.957483333333336','128.4848722222222','47210250'),('2303020400','구병산','경상북도 상주시 화북면,  충청북도 보은군 마로면ㆍ속리산면',876,'m11.jpg','경상북도','세종식록지리지에 상주 삼명산의 하나라고 했을 정도로 빼어난 산세를 가지고 있다. 그래서 속리산이 아니면서도 속리산국립공원의 남쪽 경계에 포함되었다. 지금은 거의가 보은군 땅이다. 25번 국도를 타고가다 보면 금방 눈에 띄다. 군계일학인 까닭이다. 자락에는 시루를 엎어놓은 듯한 봉우리까지 있어 정말 신령스런 산이라는 생각이 들게 한다. 그래서인지 구령산(九靈山)이라고도 했다. 구병산은 충북 보은군과 경북 상주군의 속리산 국립공원 남쪽 국도변에 자리잡고 있다. 예로부터 보은 지방에서는 속리산의 천황봉은 지아비 산, 구병산은 지어미 산, 금적산은 아들 산이라 하여 이들을 \'삼산\'이라 일컫는다. 속리산의 명성에 가려 일반인에게는 잘 알려져 있지 않아 산 전체가 깨끗하고 조용하며 보존이 잘 되어 있는 편이다. 보은군청에서는 속리산과 구병산을 잇는 43.9km 구간을 1999년 5월 17일 \'충북 알프스\'로 업무표장 등록을 하여 관광상품으로 널리 홍보하고 있다. 6·25전쟁 때 폐허가 된 토골사 터가 있고 절 터 앞뒤로 수백년 생의 참나무들이 있다.',';아홉폭 바위병풍 두른 산;구병산(876.3m)은 충북 보은군과 경북 상주시의 속리산국립공원 남쪽 국도 25호선 변에 자리잡고 있다. 속리산에서 뚝 떨어져나와 보은군 마로면 적암리와 경북과의 도계에 웅장하고 수려한 아홉 개 봉우리로 이루어진 산이라 \'구봉산\'으로도 불린다. 주능선이 동쪽에서 서쪽으로 길게 이어지면서 마치 병풍을 두른 듯 아홉 봉우리가 연이어져 매우 아름다운 경치를 이루고 있으며 연중 많은 등산인들이 찾는다. 구병산은 숲이 우거져 있어 물도 맑아 여름철 산행지로 적격이며 가을 단풍 또한 볼 만하다. 예로부터 보은 지방에서는 속리산 천황봉, 구병산, 금적산을 지아비산, 지어미산, 아들산으로 불러오고 있다. 보은군청에서는 1999년 구병산에서 속리산을 잇는 43.9km구간을 충북알프스로 업무표장 등록을 하여 널리 알리고 있다. 내속리면 구병리의 삼가초교, 마로면 적암리, 금계천가의 송현리 등이 산행기점이다.','36.46958333333333','127.86173333333333','47250420'),('2303021300','속리산','경상북도 상주시 화북면, 충청북도 보은군 내속리면',1058,'m56.jpg','경상북도','한반도의 등줄기인 백두대간(白頭大幹)과 서해바다까지 뻗어 나간 한남금북정맥(漢南錦北正脈)의 분기점에 솟아 올라 조선팔경의 하나이자 소금강, 또는 제 2의 금강이라 불리는 속리산(1,058.4m)은 행정구역상으로는 충북 보은과 경북 상주에 걸쳐 있는 명산이다.',';첩첩 산 물결 이룬 큰산 ;속리산은 1970년 국립공원으로 지정된 대한팔경 중 하나다. 주봉인 천황봉(1058.4m)을 비롯해 비로봉, 길상봉, 문수봉 등 8봉과 입석대, 문장대, 신선대 같이 빼어난 자태를 자랑하며 우뚝 솟은 8대8석문이 활처럼 휘어져 자리하고 있다. 이러한 화강암의 기봉(奇峰)과 산 전체를 뒤덮은 울창한 산림은 천년고찰 법주사와 잘 조화되어 승경을 이룬다. 가파른 화북면 쪽에 비해 산자락이 너른 내속리면 쪽에는 법주사, 복천암, 중사자암, 상환암 같은 명승고적을 품고 있다. 첩첩 봉우리들 사이엔 은폭동계곡, 용유동계곡, 쌍룡폭포, 오송폭포 등이 있으며, 1016가지의 동식물이 서식하고 있는 자연자원의 보고이다. 천황봉은 조선 3대명수(삼파수, 달천수, 우통수)중 하나인 삼파수의 발원지로 이곳에 내린 빗물은 동쪽 낙동강, 남쪽 금강, 서쪽 남한강으로 흘러간다.','36.543191666666665','127.87080277777777','47250420'),('2304021500','민주지산','충청북도 영동군 상촌면ㆍ용화면, 전라북도 무주군 설천면, 경상북도 김천시 부항면',1242,'m38.jpg','충청북도','민주지산(1,241.7m)은 추풍령 남서쪽 약 25km 지점에 있으며 산행의 기점은 정상의 동북쪽 방향인 한천마을과 남쪽 아래의 대불리로 크게 나눌 수 있다. 삼도봉, 석기봉이 명소이며, 석기봉 동쪽에는 원시숲과 화전민터가 있어 옛 주민들의 생활상을 엿볼 수 있고, 물한리에서 멀지 않은 곳에는 1972년에 지은 황룡사가 있다. 석기봉과 삼도봉으로 이어지는 주능선은 봄이면 온통 산죽과 진달래가 군락을 이뤄 꽃산행을 즐기게 된다. 다른 산의 진달래가 무리지어 군락을 이루는데 반해 이 곳 진달래는 능선을 따라 도열해 있는 것이 특징이다. 물한계곡을 끼고있어 심산유곡으로 아직도 때묻지않은 계곡이 돋보이며, 각종 잡목과 진달래 철쭉 등이 꽉 들어차 장관을 이루고 있다. 옥소(玉沼) 응주암 의용곡폭포 등이 절경을 이루며, 삼도봉에는 충북, 경북, 전북 등 3도인이 모여 세운 3도봉 대화합탑이 있다.',';삼두마애불 비밀 간직한 산;민주지산(1241.7m)은 충북, 경북, 전북 등 3도에 걸쳐 있다. 동으로는 석기봉과 삼도봉, 북으로는 각호산이 좌우로 날개처럼 우뚝 솟아올라 웅장한 기상을 펼치며 백두대간을 굽어보는 산이다. \'동국여지승람\'과 \'대동여지도\'에는 백운산(白雲山)으로 기록되어 있으나 일제 강점기에 민주지산으로 바뀌었다. 물한계곡을 중심으로 한 충청도 쪽 등산로는 민주지산에서 가장 길고 아름답다. 삼도봉을 비롯한 1000미터가 넘는 네 봉우리에서 흘러내린 계곡이 모두 물한계곡에서 합쳐지기에 수량이 풍부하고 경관이 수려하다. 특히 물한계곡에는 황룡사 부근의 용소와 옥소폭포, 의용골폭포, 음주골폭포(미니미폭포) 등이 볼 만하다. 삼도봉과 석기봉을 거쳐 민주지산 정상에 이르는 능선에는 잡목과 진달래, 철쭉 등이 꽉 들어차 장관을 이룬다.','36.03980833333333','127.84925','43740350'),('2304053500','천태산','충청북도 영동군 양산면, 충청남도 금산면 제원면',715,'m82.jpg','충청북도','충북 영동군 양산면과 충남 금산군 제원면의 경계를 이루는 천태산은 기암절벽과 수림이 조화를 이루고 있어 일명 \'충북의 설악\'이라 불리고 있는 산이다. 등산로는 바위지대에다 안내표지와 로프가 설치되어 있어 아기자기한 바위산행을 만끽할 수 있는 묘미가 있는 산이며 뛰어난 자연경관을 자랑하는 산이기도 하다. 이름난 명소가 산재해 있어 가족동반 등산지로도 좋다. 계곡은 비록 짧으나 시원하게 쏟아지는 용추폭포와 진주폭포가 있고, 봄에는 진달래, 벚꽂이 온 산을 뒤덮고 가을에는 단풍 또한 좋다.천태산에는 양산 8경 중 제1경인 영국사가 있으며, 10km 떨어진 곳에 여의정, 강선대, 용암 등이 있어 볼거리가 많은 곳이다. 영국사 앞 등산로 입구에는 천연기념물 제233호로 지정된 수령 천년이 넘는 은행나무가 서 있다. 이 나무는 높이 18m, 둘레가 6m에 달하는 거목이다. 나라를 평안하게 하는 뜻을 가진 영국사는 고려 31대 공민왕이 홍건적의 난을 피해 이 근처에 와서 천일기도를 드린 끝에 난을 평정한 것을 기념하여 절을 짓고 이름을 영국사라 붙였다고 전해지고 있다.',';기암괴봉과 암릉 아름다운 산;천태산(715.2m)은 기암괴석이 도처에 기기묘묘한 형상을 이루며 일대 장관을 연출하는 산이다. 비단으로 수놓은 듯한 기암괴석을 밧줄을 타고 오르는 암벽등반코스 등 여러 곳의 등산로가 개설되어 있어 많은 등산동호인들의 발길이 끊이지 않고, 가족산행지로도 각광받고 있다. 특히 양산팔경이 이곳 영국사를 제1경으로 시작되고 많은 문화유적들이 그 신비함을 더해주는 산이다. 영국사를 오르는 골짜기 풍경이 매우 아름다우며, 기암절벽에서 쏟아져 내리는 용추폭포(3단)와 천년 정도로 추정되는 은행나무가 천태산을 찾는 등산인들을 맞이한다. 천태산에는 보물 4점, 지방유형문화재 2점, 천연기념물 1점 등이 있어 역사가 살아 숨쉬는 곳이기도 하다. 이밖에도 공민왕이 옥새를 숨겨두었다는 옥새봉과 6조가 자리 잡았다는 육조골이 있어 천년고찰 영국사와 함께 역사의 향기를 간직한 곳이다.','35.417719444444444','128.90652500000002','43740390'),('2307050900','금수산','충청북도 제천시 수산면ㆍ단양군 적성면',1016,'m13.jpg','충청북도','금수산, 이름 그대로 비단에 수를 놓은 듯한 모양을 하고 있다. 월악산 국립공원권 최북단에 위치한 이 산의 이름은 본래 백악산이었다. 조선조 중엽 퇴계 이황 선생이 단양 군수로 있던 시절, 너무도 아름다운 경치에 감탄해 금수산으로 이름을 고쳐 부르게 되었다고 한다.특히 가을 경치가 빼어난 아름다운 암산으로, 봄속에 겨울을 만날 수 있는 신비한 산이다.매년 4월초까지 얼음이 얼다가 처서가 지나면 얼음이 녹는 얼음골에는 돌구덩이를 30cm정도 들추면 밤톨만한 얼음 덩어리가 가을까지 나오고 있어 자연의 신비감을 더해준다. 금수산 주능선은 상어 이빨을 연상케하는 암릉길로 스릴 만점이다. 산 중턱에는 바위틈에서 한해나 장마에도 꾸준한 물줄기를 뿜어내고 있어, 산을 찾는 이들의 목을 축여주고 있다. 발길마다 눈길마다 은은히 차고 도는 풍경에 취해 걷다 보면, 어느새 산 정상. 그곳에서 내려다 보면 다소곳이 트인 산세와 충주호의 푸른 물이 어우러져 은은한 채색이 베인 화선지 위에 선 기분이 든다.',';청풍호반 비단물결 이룬 산;금수산(1015.8m)은 산세가 수려하고, 골이 깊고 기암절벽이 절경을 이뤄 사철 등산인들의 발길이 이어지는 곳이다. 비단폭을 깔아놓은 듯한 녹음 속에 계곡의 맑은 물소리, 물확에 떨어지는 폭포소리, 꽃, 녹음, 단풍, 설경 등 어느 한계절도 빼놓지 않고 아름다움을 자랑한다. 금수산은 본디 백운산이었다. 단양군수를 지낸 퇴계 이황이 \'비단에 수 놓은 것처럼 아름답다\'며 감탄, 금수산이라고 했다고 한다. 청풍호반을 끼고 있는 금수산은 북쪽으로는 제천시내까지, 남쪽으로는 단양 말목산까지 뻗어내린 제법 긴 산줄기다. 주능선에는 작성산, 동산, 말목산 등 해발 700~800미터 산들이 여럿이다. 중간마다 서쪽으로 뻗은 지릉에는 중봉, 신선봉, 저승봉, 망덕봉 등 수려한 산들을 거느리고 있다.','36.984725','128.25690555555556','43150330'),('2307083700','월악산','충청북도 제천시 한수면, 덕산면',1095,'m66.jpg','충청북도','월악산 국립공원은 충북 제천시 한수면과 덕산면의 경계를 이루는 산으로 백두대간이 이화령을 지나 조령산, 조령, 마패봉, 부봉, 월항삼봉, 하늘재, 포암산을 거쳐 대미산으로 이어지는 중간선 북쪽에 솟아있는 봉우리이다. 넓이 373㎢에 걸쳐 있는 월악산 능선은 백두대간보다 높고 무엇보다도 바위와 암릉으로 형성되어 있어 대간에 비해 능선이 훨씬 두드러져 있다.제천시 한수면과 충주시 살미면의 경계를 이루는 지점에 자리한 월악수리봉은 일반인들에게는 생소한 이름이지만 알고보면 숨겨진 비경들이 많은 명산이다. 산행을 나선 후 곳곳에서 펼쳐지는 기암절벽의 변화무쌍함은 산악인들의 탄성을 자아낸다. 숨은 절경들은 둘러보며 정상에 오르면 어느새 월악수리봉에 대한 애정이 듬뿍 생겨 다시한번 이 곳을 찾고 싶은 마음이 절로 든다.월악산(月岳山 1095.3m) 뒤안길에는 용하구곡이 30리나 늘어서 있는데 월악시루봉은 용하구곡의 서쪽에 병풍처럼 자리한 산이다. 시루봉을 가려면 일단 덕산면을 거쳐야 한다. 덕산(德山)은 이름 그대로 산의 덕을 본다는 뜻으로 덕산면은 예부터 인삼재배 적격지로 유명하다. 산 곳곳에 빼어난 경관이 산재해 있는데 특히 전망대 바위에서의 조망이 일품이다. 전망대 바위에 오르면 서북쪽의 월악산 정상이 울부짖는 호랑이 형상을 하고 있어 보는 이의 마음을 압도하며 동쪽에는 용하구곡 건너로 하설산, 매두산, 문수봉 산릉이 아름다운 풍광을 연출하고 있다.',';청풍명월 중원의 명산;월악산(1095.3m)은 설악산의 현란한 아름다움과 지리산의 장엄함을 조금씩 가져다 놓은 듯한 산세를 지녔다. 깎아지른 절벽이 가슴 조이게 하지만 부드러운 능선의 푸근함도 함께 주는 산이다. 국사봉으로도 부르는 월악산의 정상은 예로부터 신령스런 산으로 여겨 \'영봉\'이라고 부르고 있다. 거대한 암봉인 영봉 꼭대기에 서면 월악산 산그림자를 담고 있는 충주호반이 한눈에 들어와 장관을 이룬다. 문수봉, 하설산, 매두막, 대미산, 황정산 마폐봉 등 산세가 아름다운 산들과 함께 1984년 월악산국립공원으로 지정되었으며, 고봉준령 사이로 송계계곡, 용하구곡, 선암계곡이 굽이져 흐르며 산악공원의 장관을 보여주고 있다. 또한 신라말 마의태자와 덕주공주가 마주보고 망국의 한을 달래고 있다는 중원미륵사지의 석불입상과 덕주사의 마애불을 비롯하여 덕주산성 등 많은 문화유산을 보유하고 있어 문화, 역사, 자연경관을 두루 갖춘 산악공원이다.','34.7027','127.37821944444444','43150350'),('2307083702','도락산','충청북도 단양군 단성면, 대강면',965,'m26.jpg','충청북도','우암 송시열 선생이 \"도를 깨닫고 스스로 즐길 만한 곳이다\" 해서 도락산이라 명명한 이 산은 경북과 충북의 도경계선에 근접해 있다. 월악산국립공원권에 속해 있는 산으로, 충북 단양군 단양읍과 대강면의 경계를 이루고 있으며 도락산 산자락에는 단양 8경 중 4경인 사인암,상선암,중선암,하선암 등이 있어 관광의 보고이기도 하다.',';성벽 쌓은 듯한 암릉등반 묘미 ;도락산(965.3m)은 월악산국립공원 끄트머리, 소백산국립공원과 이웃한 곳에 있다. \'깨달음을 얻는 데는 나름대로 길이 있어야 하고 거기에는 또한 즐거움이 뒤따라야 한다\'라는 뜻에서 우암 송시열이 산이름을 지었다고 전한다. 정상은 단양군 단성면과 대강면의 경계이다. 산세가 월악산과 비슷하여 곳곳에 암봉이 솟아있고 사방으로 뻗어나간 능선마루는 마치 성벽을 쌓은 것처럼 암릉이 이어져 장관이다. 특히 정상에서 북동쪽으로 이어진 능선에는 신선봉, 채운봉, 검봉 등의 암봉이 줄지어 있어 경관이 좋고, 암릉을 오르내리는 재미 또한 각별하다. 다만 초보자들에게는 도락산 암릉길이 결코 만만치 않다. 산행경험이 풍부한 안내자와 함께 가는 것이 좋으며 눈이 올 경우엔 각별히 주의해야 한다. 일단 산에 들어가면 식수를 구하기 어려우므로 미리 준비해야 한다.','36.85630277777778','128.311325','43800360'),('2402020400','계룡산','대전광역시, 충청남도 공주시 계룡면ㆍ논산시 상월면ㆍ계룡시 신도안면',847,'m7.jpg','대전광역시','계룡산은 백두대간에서 갈라져나온 금남정맥의 한 줄기를 이루는 산으로, 충남 공주시와 논산시의 경계를 이루고 있다. 산세가 마치 닭의 벼슬을 쓴 용의 형상을 했다고 해서 계룡산으로 불리게 되었다고 한다.계룡산은 조선조 초기에 씌어진 예언서인 〈정감록〉의 `왕도입지설\'로 유명한 산으로,정상인 천황봉(天皇峰)을 중심으로 쌀개봉(830.6m), 관음봉(765.8m), 문필봉(735.6m), 삼불봉(777.1m), 연천봉(742.9m)이 주능선에 줄지어 솟아 있다. 계룡산 산자락 곳곳에 문화 유적이 산재해 있는데, 동북쪽에는 동학사가,서북쪽에는 갑사가,서남쪽에는 신원사 사찰이 자리잡고 있다. 특히 갑사에는 보물 제257호인 부도(浮屠)와 보물 제256호인 철당간 및 지주.보물 제478호인 동종(銅鐘)등의 문화재가 있으며, 〈월인석보〉를 찍어낸 목판도 소장되어 있다. 〈월인석보〉는 세종29년(1447년)에 간행된 〈석보상절〉과 세종 31년에 간행된 〈월인천강지곡〉을 합편하여, 세조가 1459년에 간행한 것이다. 상봉을 중심으로 동쪽에 동학사, 서쪽에 갑사, 남쪽에 신원사가 자리하여 현재까지도 보존되고 북쪽의 구룡사는 절터만 남아 있다. 계룡사에는 노루, 담비, 청설모, 황매화 등 희귀 동.식물 1227종이 서식하고 있으며, 계룡 8경으로 꼽히는 천황봉(일출), 삼불봉(설화), 연천봉(낙조), 관음봉(한운), 동학계곡(신록), 은선폭포(운무), 갑사계곡(단풍), 남매탑(명월) 등은 울창한 숲과 기암절벽을 더불어 장관을 이루고 있다.',';충남 제일의 영산이자 명산;계룡산은 수려한 산세와 승지 신도안, 여러 고찰들을 품은 충남 제일의 명산이다. 이미 신라시대 5악의 하나였고 조선시대에는 묘향산, 지리산과 함께 산신제를 올리던 영산이었다. 주봉인 천황봉에서 쌀개봉으로 이어지는 능선미가 타의 추종을 불허한다. 이 맨드라미 같은 용머리가 오종종하니 가운데가 높은 암탉 벼슬처럼 보인다 하여 계룡이라는 이름이 붙었다. 용유소, 이일천, 백룡강, 달문택, 군자택, 명월담, 계룡명암, 수정봉 등의 명소가 곳곳에 벌여있다. 계룡10경의 하나인 은선폭포, 영험함 때문에 무속행사 장소로 각광받는(혹은 받았던) 갑사계곡의 용문폭포, 신도안 용추폭포로 드러나듯 계곡미 또한 빼어나다. 폭포와 기암절벽이 조화를 이룬 계룡산은 단풍으로도 유명하다. 10월 하순에 절정을 이루는 동학사계곡, 남매탑, 삼불봉과 관음봉에 이르는 구간이 백미다.동쪽 동학사, 서쪽의 갑사, 남쪽 신원사 등 사방의 고찰에는 문화재도 많다. 이 중 국보 하나와 보물 넷을 간직한 갑사, 고려말의 세 충신을 모신 삼은각, 동학사는 꼭 들러볼 일이다.','35.528419444444445','127.00879722222223','44250330'),('2403011500','서대산','충청남도 금산군 추부면ㆍ군북면, 충청북도 옥천군 군서면',904,'m50.jpg','충청남도','서대산의 높이는 904.1m이다. 충청남도 남동부의 금강분지를 둘러싸고 있는 금산고원에 속해 있으며, 노령산맥을 이루는 정수이자 충청남도의 최고봉이다. 충남에서는 높이 904.1m으로 가장 높은 산으로서 기암 절벽으로 이루어져 있다.화강암으로 이루어진 원추형 암산인 서대산은 기암절벽과 숲이 어우러지고 제법 험준해 산행의 묘미를 더한다. 정상에 올라서면 웅장하고 온화한 산세가 한눈에 들어오고 멀리 서북쪽으로 대전시내가 펼쳐진다.원흥사, 개덕사등 유명사찰과 정상 직전에 직녀 탄금대, 정상에서 북쪽 546봉으로 이어지는 능선 주변에는 장면대, 북두칠성 바위, 사자굴, 쌀바위 등이 산재해 있다.협곡을 가로 질러 높게 설치된 약 50m의 구름다리 주변은 신선바위, 벼슬바위등 기암 절벽들이 어울려 장관을 이루고 있다.',';견우직녀 전설 품은 충남 최고봉;900미터가 넘는, 큰 산이 많지 않은 충남에서 가장 높은 산이다. 남북으로 길고 동서로 얇으며 홀로 우뚝, 우람한 비래산(飛來山)이다. 그러나 기슭에 개활지를 이루는 평야가 없으며 동쪽으로는 장룡산(654.5m), 매봉(599.5m), 대성산(705.9m)이, 서쪽은 도덕봉(372.8m), 지봉산(464.3m), 만인산(537.8m)이 가로막고있어서 산세를 드러낼 수 없다. 이중환이 말한 명산의 두번째 조건 \"\"큰 강이나 바다를 끼고있을 것\"\"이 새삼스럽게 떠오르는 둔산인 것이다. 산 모양 또한 여의도종합전시장 같아 별로인데 능선 위에 견우탄금대와 옥녀직금대, 닭벼슬바위, 마당바위, 선바위, 남근바위, 쌀바위 등 기암이 많다. 용굴이나 사자굴 같은 동굴, 개덕폭포 같은 폭포도 있으나 교통이 불편하고 이름난 산도 아니어서 아직껏 호젓하다. 대표적인 두 바위 이름에서 예감할 수 있듯이 견우·직녀의 전설을 담고 있다. 탄금대에서 직녀를 그리워하며 거문고를 타는 견우, 직금대에서 옷감을 짜는 직녀가 칠월칠석날 서대산 정상에서 만난다는 스토리다.? 볼거리 : 개덕사와 개덕폭포를 보고 옥녀직금대를 거쳐 고스락에 오른 다음 견우탄금대를 지나 구름다리로 하산하는 가장 일반적인 코스입니다. 개덕폭포 왼편 등성이에서 시작하는데 중간에 전망 좋고 널찍하며 시원한 약수터가 있습니다. 닭벼슬바위 능선 갈림길을 지나면 오른쪽으로 횡단하는 길이 보이는데 바로 옥녀직금대 직행루트니 능선길을 버리고 그쪽으로 향해야합니다. 절벽 중간에 15미터폭의 바위선반이 삼사십미터쯤 이어지는 옥녀직금대는 전망도 그만이려니와 샘과 동굴까지 있습니다. 상봉 바로 아래 자리잡은 좋은 기도터이기도 해 기도객이 사철 끊이지 않습니다. 여기서 정상은 일각 거리도 안 됩니다. 정상 조망은 서북쪽을 제외하고 모두 좋습니다. 그렇지만 견우탄금대만큼은 안됩니다. 저 유명한 직육면체 바위는 대전과 금산 어디서도 선뜻 눈에 띔니다. 바위를 되내려와 가던 방향으로 계속 가면 \"\"구름다리 하산길\"\" 이정표가 나옵니다.금산 인삼축제 인삼축제 집행위원회 (041-751-3799) ? 숲길 명소 : 직녀 탄금대, 장면대, 북두칠성 바위, 사자굴, 쌀바위, 신선바위, 벼슬바위, 장군바위, 용바위, 마당바위, 노적봉 등','36.46054166666667','127.32003611111111','44710390'),('2404170800','대둔산','충청남도 논산시 벌곡면ㆍ금산군 진산면, 전라북도 완주군 온주면',879,'m20.jpg','충청남도','큰 두메의 산\'을 뜻하는 대둔산은 전북과 충남 두 도에 걸쳐있는 도립공원이다. 특이하게도 대둔산은 두 얼굴을 지니고 있다. 주능선을 경계로 완주군 방향인 남쪽은 바위 얼굴이고, 북쪽은 순후한 시골 아낙네의 얼굴을 한 금산군과 논산시의 얼굴이다. 남면의 전북 지역은 가파른 비탈에 기암괴봉이 숲처럼 솟아 있어 아기자기하고 멋스러운데 비해 북면의 충남 지역은 울창한 숲이 우거져 장중해 보인다. 경관이 뛰어나서 소금강이라 불리기도 하는데, 멀리서 바라보면 늘어 선 암벽이 마치 한 폭의 병풍을 연상케 한다. 그리 높지 않은 산이지만 정상인 마천대를 기점으로 충남 논산시,금산군 그리고 전북 완주군에 산자락을 펼치고 있다. 이 산은 임금바위,장군봉,동심바위,신선바위등 온통 바위로 이루어져 있으며, 이 중에서도 임금바위와 입석대를 잇는 높이 70m, 길이 50m, 폭 50cm인 금강구름다리와 삼선구름다리는 대둔산의 상징이기도 하다.',';기암 마천대와 폭포 어우러진 호남의 금강;대둔산은 전북 완주군 운주면과 충남 논산시 벌곡면, 금산군 진산면 사이에 위치한 산이다. 하나의 산을 두고 전북과 충남에서 도립공원으로 지정하였다. 이 산은 최고봉인 마천대를 중심으로 기암괴석들이 제각기 위용을 자랑하며 늘어서 있고, 멀리서 바라보는 산세도 뛰어나 \'호남의 금강\'이라 부르기에 손색이 없다.남과 북으로 두 얼굴을 지닌 대둔산은 등산로 역시 양쪽 지형이 상반된다. 완주(남) 쪽은 기치창검을 든 암봉들이 석림을 이뤄 보는 이로 하여금 저절로 감탄을 자아내게 한다. 대둔산의 명물인 케이블카, 금강구름다리 등이 설치되어 있어 많은 관광객을 유혹한다. 반면에 논산(북) 쪽은 협곡을 거느린 깊은 숲을 이뤄 완주 쪽보다 수량이 풍부하고 폭포가 장관을 이룬다. 군지골의 제1폭포와 화랑폭포, 금강폭포는 그 앞에서 단 10분도 견디지 못할 정도로 피서지로는 제일이다.＊&nbsp;볼거리 : 마천대 정상에서의 전경, 가을철에 반딧불 축제, 낙조대(落照臺)의 일몰 광경＊&nbsp;최적 탐방 시기 :&nbsp;4 ~ 10월 / 봄, 여름, 가을','36.12458888888889','127.32047222222222','44230380'),('2412050400','덕숭산(수덕산)','충청남도 예산군 덕산면',495,'m23.jpg','충청남도','충남 예산에 자리잡은 덕숭산은 기기묘묘한 형상의 괴석들이 많아 절묘한 산세를 뽐내며 1973년 3월 6일 도립공원으로 지정되었다. 호서의 금강산이라 불릴 만큼 아름다운 경관을 갖추고 있는데다 아담한 산세 곳곳에 유명한 암자들이 배치되어 있어 찾는 이들의 발길이 끊이지 않는 곳이다. 그 중 비구니의 도량으로 알려진 수덕사는 고려 충렬왕 34년(1308)에 창건된 사찰로 국보 제 49호로 지정된 대웅전이 있는데 이 건물은 무량수전과 더불어 현존하는 목조건물 중 가장 오래된 것이다. 부처님의 진본사리가 안치된 황화루를 비롯, 김일엽 스님의 거쳐였던 환희대, 만공스님을 기리기 위한 미륵불상등 수행의 역사를 조망할 수 있는 흔적들이 눈길을 끈다. 수덕사와 창건연대가 같은 정혜사는 구한말에 만공 스님이 한국 선불교를 중흥시킨 곳으로 청방, 정강, 용성 등의 대스님이 거쳐갔던 명소다. 덕숭산은 이밖에도 만공탑, 여승당, 보덕사 등 많은 문화재를 간직하고 있으며 주변에 온천이 있어 배낭 하나 메고 가볍게 떠날 수 있는 가족 나들이 코스로 손색 없는 산이다.',';일곱 꽃잎과 조화 이룬 오롯한 꽃술대;당나라 시인 유우석은 \"\"산이 높다고 다가 아니요 선풍(仙風)이 있어야 명산\"\"이라고 했다. 그래선지 덕숭산은 이웃의 큰 산 가야산(678.2m) 그늘임에도 수덕사라는 천년고찰의 본산이 되었다. 동쪽의 수암산(260.1m)부터 시작해 용봉산(381m), 홍동산(308.9m), 삼준산(489.4m), 연암산(440.8m), 뒷산(449.1m), 가야산에 이르기까지 빙 둘러 육산(肉山)들 에워싼 가운데 꽃술대처럼 오롯한 바위산으로 솟아 한 송이 꽃을 이루고있기 때문일 것이다. 꽃술과 꽃잎이 그렇게 조화로울 수 없다. 꽃술이 되바라지게 높지도 않고 꽃잎이 댄퉁맞게 크지도 않다. 그래 서로 숨고 서로 가려주면서 전체를 완성하고 있다. 홍동산 남쪽 \"\"이별의 꽃조개고개\"\" 연인들처럼 애틋하게. 산 곳곳에는 기묘한 모양의 바위들이 흘립(屹立)해있다. 꽃술대 위에 서면 꽃잎들 위로 서해와 서산 간척지, 예당평야가 그림처럼 펼쳐진다. 평지돌출의 작은 산 덕숭산이 작은 산이라는 느낌이 들지 않는 비결은 바로 이것, 에워싼 일곱 산을 아울러 하나의 산세를 형성하기 때문이리라. 작아도 다부진, 금북정맥의 등줄기다. 그렇지만 고개는 낮아 내포지방과 서해바닷가 사람들내왕로가 되어왔다. 선사시대부터 삼국시대까지 가장 살기 좋고 인구밀도가 가장 높았던 지역들. 수덕사와 덕숭산은 크게 될 운명을 타고났다.','34.61841388888889','127.26236666666667','44810360'),('2414022100','칠갑산','충청남도 청양군 대치면, 정산면, 장평면',560,'m87.jpg','충청남도','칠갑산은 해발 561m의 낮은 산이기는 하나 산세가 거칠고 가파르다. 아직은 널리 알려지지 않아서 자연 그대로의 울창한 숲을 이루고 있다. 산위에 오르면 서해가 바라다 보이고 골짜기마다 흐르는 물이 모여 지천과 사천을 이룬다.',';일곱 명당 품은 충남도립공원;칠갑산. 유장한 능선 골골에 명당갑터 일곱을 감추고있다는 산이다. 600미터도 안 되는 높이에 수더분한 육산인데도 이렇게 대단한 잠재력을 지녔다는 것이다. 주릉이 5방으로 뻗어나간 산세나 청양 분지에서 비롯하는 아흔아홉골 지천(芝川)이 범상해보이지는 않는다. 그 청양은 임진왜란과 남북전쟁때 총소리 한 번 나지 않았고 승지로 이름난 마곡사의 유구천을 이웃에 둔 것을 보면 일단은 고개가 끄덕여진다. 국보 둘과 보물 셋을 품은 장곡사에 이르면 확신에 가까워진다. 일곱 중 여섯은 몰라도 적어도 하나는 분명하기 때문이다. 국보 58호의 철조약사여래좌상(석조 대좌 포함), 철조비로자나불좌상(보물 174호), 이들이 들어있는 상대웅전(보물 162호), 금동약사여래좌상(보물 337호)과 그 집인 하대웅전(보물 181호), 그리고 삼베에 그린 미륵불괘불탱(국보 300호)을, 본산도 아닌 이 작은 절이 갖고있다. 봉만미(峰巒美)도 계곡미도 없는 산이지만 전망은 꼽아줄 만하다. 금강 이북의 충남 최고봉 오서산(789.9m)은 물론 서남쪽의 성주산(677m), 동북쪽의 광덕산(699.3m)에 이르기까지 내노라 하는 산들과 호형호제할 수 있는 수준이다. 그리고 남쪽으로는, 유유히 흐르는 금강과 부여가 손에 잡힐 듯 가깝다.','36.41303333333333','126.88491944444445','44790320'),('2501100600','방장산','전라남도 장성군, 전라북도 고창군 신림면ㆍ정읍시 입암면',734,'m39.jpg','전라남도','방장산은 전북 정읍시와 고창, 전남 장성의 경계에 솟아 있다. 내장산의 서쪽 줄기를 따라 뻗친 능선 중 가장 높이 솟은 봉우리이다. 지리산 무등산과 함께 호남의 삼신산으로 추앙받아 왔으며 주위의 이름난 내장산, 선운산, 백암산에 둘러싸여 있으면서도 기세가 눌리지 않는 당당함을 자랑하고 있다. 방장산 중턱에는 방장산 자연휴양림이 위치하고 있다. 2000년 7월 1일 문을 연 것으로 서부지방 산림관리청(전북 남원 소재)에서 순창 회문산 자연휴양림, 무주 덕유산자연휴양림, 진안 운장산자연휴양림, 장흥 천관산자연휴양림, 함양 지리산자연휴양림, 남해 편백자연휴양림과 함께 방장산휴양림을 관리하고있다. 휴양림 내에는 참나무류와 소나무, 편백, 낙엽송, 리기다소나무 등이 많이 자라고 있으며, 고창 방면으로 난 임도를 따라가면 벽오봉(640m)과 고창 고개 중간의 능선에 닿는다. 이곳에서는 고창 읍내와 서해바다가 내려다보인다. 고창고개를 지나 장성갈재 방면으로 조금 더 가면 방장산 정상이다. 방장산 정상에 오르면 신선지경에 이르며 고창읍을 비롯하여 광활한 야산개발지와 멀리는 서해바다가 보이며 동쪽으로는 광주 무등산까지 보인다.휴양림에서 정상까지는 왕복 3시간이 소요되며 석정온천으로 곧장 하산하는 산길도 나있다. 주능선에 오르면 서해로부터 불어오는 시원한 바람을 맞이할 수 있는데 이 덕분에 패러글라이딩 동호인들이 종종 이곳을 찾기도 한다. 정상 서편 용추골에는 용추 폭포가 있으며 하산지에는 게르마늄 천으로 유명한 석정온천이 있어 피로회복에 더없이 좋고, 고창은 전통음식으로도 유명한 고장이다.',';고창벌판에 우뚝 선 호남정맥의 망대;호남고속국도를 타고 남으로 가다보면 호남평야가 끝나면서 길이 산으로 들어간다. 왼쪽에서는 입암산 정상의 농바위가 문인화처럼 인상적인데 오른쪽으로는 포장(布帳)처럼 장대한 산이 솟아있다. 방장산이다. 평지에서 불쑥 솟구친 데다 능선들이 일필휘지로 그린 듯 단순하다. 그만큼 전망이 좋아 고창읍내와 주변 평야는 물론이고 그곳의 명소 모양성까지, 그림지도처럼 생생하게 보인다. \'절집의 원로\'라는 뜻의 이름이지만 관련은 없다. 백제때는 방등산(方等山)으로 불렸다고 하는데 그게 구개음화되어 방증산, 모음동화되어 방장산으로 바뀐 듯하다. \'모 방\'자니 원래는 모등이었을 것이다. 고창의 옛이름이 모양부리니 \'모양의 등\'이라는 뜻이었겠다. 상봉 서남쪽의 벽오봉을 방문산이라고도 하는데 어처구니 없는 오류다. 국립지리원이 만든 5만분의 1 지도 \'고창\'과 \'담양\'의 경계가 두 봉우리 사이로 지나가는데 상봉이 있는 \'담양\'지도에는 이름이 제대로 되었지만 옛날 \'고창\'지도에는 식자공이 \'어른 장\'과 비슷한 \'글월 문\'자를 쳐넣어 방문산이 된 것이다. 그런데 이를 모르고 많은 사람들이 방문산으로 알고있는 바 변산 의상봉의 \'의(倚)\'자를 잘못 읽어 최고봉이 오랫동안 \'기상봉\'으로 불려왔던 것과 비슷한 처지다.','35.44818055555555','126.73833055555555','45790420'),('2501121000','선운산','전라북도 고창군 아산면ㆍ심원면ㆍ해리면',335,'m51.jpg','전라북도','봄이면 동백꽃과 벚꽃으로 유명한 선운산은 \'호남의 내금강\'으로 불리는 산으로 79년 도립공원으로 지정된 명산이다. 본래 도솔산이었으나 백제 위덕왕 24년(577년)에 창건한 선운사(禪雲寺)가 있어 선운산이라 불리게 되었다. 선운산은 이름 그대로 구름 속에 선(禪)을 닦는 산으로 선운사를 비롯해 참당암, 도솔암, 석상암, 동운암 등 유서 깊은 사찰과 암자가 산자락에 자리잡고 있다. 그 중 선운사는 백제 위덕왕 24년(577년)에 검단(黔丹)선사가 창건한 사찰로, 한때 89개 암자를 거느리기도 하였으나 현재는 4개의 암자만 남아있다. 선운사 대웅전 뒤에는 5천여 평의 동백나무숲(천연기념물 제184호)이 있는데 매년 4월 중순이면 붉게 피어나 보는 이의 탄성을 자아내게 한다. 김정호의 \'대동여지도\'에는 선운산이 표시돼 있지만 현재 각종 지도에는 선운산이라 표시되어 있지 않으며, 선운사 뒷산을 \'도솔산\' 또는 \'수리봉\' 으로 표시하고 있다. 선운사 창건 설화는 여러 가지가 있다. 원래 선운사 자리는 용이 사는 용추로 검단선사가 용을 쫓아냈지만 용추를 메울 길이 없자, 용추에 꼭두각시 배를 띄우고 돌을 던져 꼭두각시 놀이를 하게 하였다 한다. 또 그 때 마을에 눈병이 퍼졌는데 숯 한 짐씩을 용추에 버린 뒤 눈을 씻으면 낫는다는 소문을 퍼뜨려 용추를 메워 선운사를 지었다는 전설이 있다.실제로는 검단선사가 그의 친구이자 신라 24대 진흥왕의 왕사인 의운(義雲)선사의 도움을 받아 진흥왕의 시주로 선운사를 창건하였다 한다. 진흥왕이 중생제도를 위해 왕위를 버리고 도솔왕비와 중애공주를 데리고 입산, 수도하였다는 진흥굴(眞興窟. 일명 좌변굴(左邊窟),열석굴(裂石窟))이 도솔암 아래에 남아있다. 낙조대에서 바라보는 서해바다의 조망과 하늘로 날아오를 듯한 모습을 한 천마봉 등 볼거리가 푸짐한 이 산은 암자와 바위, 굴마다 숱한 전설이 깃들어 있어 지루함 없이 산행을 즐길 수 있다.특히 선운산 마애불에는 재미난 전설이 전해지고 있다. 옛날부터 마애불 배꼽 속에 신기한 비결이 들어 있고 그 비결이 나오는 날 한양의 이씨가 망한다는 전설이 있었다. 전라도 감사 이서구(李書九)가 마애불의 배꼽을 열어 보려다가 뇌성벽력이 쳐, 실패한 일이 있었는데 동학혁명이 일어나기 전 동학의 간부 손화중(孫和中)이 배꼽을 열고 그 비결을 꺼내갔다고 한다.',';눕지 않아도 선정에 들 수 있는 산;구름 속에 누워 선을 닦는다는 참선와운(參禪臥雲)의 산이다. 선이란 것이 본래 구름 잡는 것이니 콕 찝어 무엇을 어쩐다는 건지는 모르겠지만 이 산에 가보면 막연히, 그럼직도 하다는 느낌이 든다. 산형이 벌레 잡는 풀 통발처럼 생겼다. 상봉 경수산에서 시작, 도솔산(334.7m), 개이빨산(346.6m), 청룡산(315m), 비학산(308.5m), 구황봉(297.9m)으로 이어지는 운두가 고작 300미터 안팎의 낮은 산인데도 7킬로미터나 되는 평평한 긴 골이 선적 분위기에 젖어들게 한다. 걸음도 마음도 차분해지는 것이다. 대낮에도 어둑한 아름드리 고목 아래를 걷고있어서만은 아니다. 가을이면 그 붉은 잎들 봇물 위에 화엄경을 연출해서도 아니다. 눈밭 속에 이채로운 동백꽃이나 숲 속의 분홍 주단 상사화들의 싯적 꽃말 때문만도 아니다. 신들메를 하고 운두 돌기를 해도 마찬가지다. 안장바위, 병풍바위, 벌바위, 낙타바위, 배맨바위, 용문굴의 띄엄띄엄 기암들과 전설들에다 널띠너른 무장들, 하얗게 빛나는 잿빛 뻘바다에 도무지 서두르고 싶은 생각이 들지 않는다. 상봉 경수산은 저만치 홀로 떨어져있다. 가을날 거기 서면 추수 끝낸 흥덕 들의 까끄라기 태운 연기가 해풍 따라 휘도는 모습을 볼 수 있다. 아아! 선운산은, 눕지 않아도 선정(禪定)에 들 수 있는 산이다.','35.498675','126.5689861111111','45790320'),('2503060700','모악산','전라북도 김제시 금산면ㆍ전주시 완산구ㆍ완주군 구이면',795,'m34.jpg','전라북도','모악산은 전라북도 김제시 금산면과 전주시 완산구와 완주군 구이면의 경계를 이루는 산으로 호남정맥에 솟아 있다.예로부터 호남사경의 하나인 \'모악춘경\'으로 유명한 모악산은 봄이면 온 산을 벚꽃으로 뒤덮는다. 특히, 금산사에 이르는 벚꽃 길은 바람 불어 꽃잎이 휘날리면 마치 눈이 내리는 듯한 환상에 빠질 정도로 화려하다. 그러나 모악산이란 이름에서 알 수 있듯이 \'악\'자를 품고 있는 이 산의 산행은 결코 만만치 않다. 구이쪽에서 정상을 향해 오르는 길은 특히 험하여 정상을 얼마 남겨두지 않을 무렵에는 웬만큼 산에 단련이 된 사람이라 할지라도 숨이 턱에 차 오른다. 모든 산이 그렇듯 모악산 역시 마지막 고비와의 힘겨운 줄다리기를 치른 후에야 비로소 정상에 오르는 기쁨을 맛볼 수 있다.정상에 오르면 전주시내와 호남의 넓은 들판이 한눈에 들어와 보는 것만으로도 풍요로운 마음이 드는 호남평야의 전경을 마음껏 즐길 수 있다. 김제쪽으로 하산하는 길은 비교적 수월해 쉬엄쉬엄 주위의 경치를 감상하며 내려오면 된다. 비록 800m도 채 안되는 모악산이지만 덩치와는 다르게 구비구비에 다양한 풍경들을 연출해 산행하는 이들의 시선을 즐겁게 한다. 1971년 도립공원으로 지정된 이 산은 미륵신앙과 많은 연관을 가지고 있어 산자락 곳곳에 이와 관련된 흔적이 많이 남아있다.',';증산교 낳은 마름모꼴 산릉의 어머니산;이름처럼 포근한 어머니산이다. 안으로 들어가보면 안다. 구성산(489.7m), 청도재, 상봉, 안덕봉(617m)을 잇는 마름모꼴 산릉이 물, 불, 바람 삼재(三災)를 막아주는 형세다. 이런 까닭에 강증산은 동학 난리 끝의 어수선한 상황에서 민중의 상처를 쓰다듬어주는 증산교를 창시할 수 있었다. 마름모꼴 가운데는 금산사가 있다. 국보 하나에다 보물을 무려 여덟이나 품었다. 모악산이 삼재불입지지임을 증명하는 절이다. 아름드리 벚나무 도열한 산사로 가는 길 들머리에는 일주문이 아니라 웬 성문이 길을 막고있다. 큰 마름모 안 가장 깊숙한 곳에 있는 작은 마름모의 꼭지점이다. 그렇게 경내로 들어가 바라보는 국보 미륵전. 그 안의 대불(大佛)은 \"\"불쌍한 중생들이여, 57억년 뒤 나와 함께 환생하리라\"\" 말하고있다. 방등계단 위의 보물 석탑은 백제표 5층탑이지만 풍기는 맛은 신라 감은사지탑 같은 힘참이다. 상봉을 향하는 산길은 온통 시누대밭이다. 화살 곳간. 이런 뒷배가 있었기에 동학농민군은 안통의 물을 모두 모아 흐르는 금산천 원평들에서 부나비처럼 산화할 수 있었다.','35.72858055555556','127.08517222222221','45210450'),('2505040700','덕유산(향적봉)','전라북도 무주군ㆍ장수군, 경상남도 거창군ㆍ함양군',1614,'m24.jpg','전라북도','덕유산은 전북 무주군과 장수군, 경남 거창군과 함양군의 경계를 이루며, 2도 4군 8개면에 걸쳐있다. 한라산.지리산.설악산에 이어 남한에서 4번째로 높고 1000미터 이상의 봉우리가 20개도 넘는 거대한 산이다. 덕유라는 이름은 덕이 있고 크며 넉넉한 산의 모습을 나타낸 말이다. 무학대사가 골치아픈 정권에서 벗어나 첩첩산중 경치 아름다운 산을 물색하다가 발견했다는 산이 바로 덕유산이다.',';덕이 있어 넉넉한 산;무주구천동 33경으로 널리 알려진 산이다. 제1경 나제통문에서 시작해 학소대, 추월담, 수심대, 인월담, 금포탄, 구천폭포 등으로 이어지는 비경이 9000구비에 이른다는 골짜기다. 31경은 이속대(離俗臺), 32경은 백련사(白蓮寺), 33경은 향적봉(香積峰)… \"\"속세를 떠나 흰 연꽃 같은 절을 지난 다음 정향(精香)이 산처럼 쌓인 봉우리에 오르\"\"는 과정이다. 하지만 \'넉넉한 덕\'의 의미는 오히려 동남쪽, 거창쪽 산자락에 가봐야 느낄 수 있다. 활처럼 휘어진 장대한 산줄기가 서북풍을 막아주고 동남풍이 흡족한 비를 뿌리는 거기는 식생이 다른 어떤 지역보다 좋다. 덕분에 곡식은 잘 되고 경치는 수려해 청사정, 모암정, 용암정, 수승대 같은 명품의 정자들을 앉혀두었다. 거창 북상면을 보지 않고 덕유산을 논하는 것은 어불성설이다.','35.86009722222222','127.74650555555556','45730320'),('2505061400','적상산','전라북도 무주군 적상면',1031,'m72.jpg','전라북도','적상산은 사방이 깎아지른 듯한 암벽으로 이루어져 있으며, 그 절벽 주변에 유난히도 빨간 단풍나무가 많이 서식하여 가을철이면 마치 온 산이 빨간 치마를 입은 여인네의 모습과 같다 하여 붙어진 이름이다. 이 산에는 장도바위, 장군바위 등 자연 명소와 함께 최영 장군이 건의하여 축조했다는 적상산성(사적 제 146호)이 있다. 이는 고려 공민왕 23년(1374) 최영 장군이 탐라를 토벌한 후 귀경길에 이 곳을 지나다가 산의 형세가 요새로서 적지임을 알고 왕에게 축성을 건의하여 건설된 것이라 한다. 현재의 성은 조선 인조6년(1628년)에 다시 쌓은 것으로서 둘레가 8.143㎞에 이른다. 적상산성 안에는 고찰 안국사 등 유서깊은 문화유적이 있어 이 곳을 찾아온 사람들에게 운치를 더해 준다.한편 고려 충렬왕 3년(1227년) 월인화상이 창건했다고 전해지는 안국사 및 조선시대 인조 21년(1643년)에 창건한 호국사도 있다.',';붉은화강암 절벽 두른 덕유산 전망대;천미터가 넘는, 낮지 않은 산 정상 일대가 평평한 특이지형이다. 서쪽 사면은 또 붉은 화강암 절벽이 띠를 둘러 예나 오늘이나 사람들의 관심을 끌어왔다. 옛날에는 거기 산성을 쌓고 왕조실록을 두었으며 오늘은 양수발전소 윗저수지를 만들어 원자력발전소 하나 만큼의 전기를 생산한다(사실은 그 하나가 멈췄을 경우를 대비한 예비용이다). 상봉 기봉과 북쪽의 향로봉이 밋밋하게 이어져 봉만미는 없다. 장군바위, 장도바위 등의 기암에다 천일폭포, 송대폭포가 있지만 계류미로 연결되지는 않는다. 산 위의 절 안국사는 또 저수지를 만들면서 자리를 옮겨 볼만한 구석이 없다. 윗저수지가 있는 까닭에 정상부까지 포장도로는 잘 나있다. 그래 거기까지 차를 타고 올라가 덕유산 바라보기는 좋다. 가을 단풍이 여인의 붉은 치마 같아 \'붉을 적\'자, \'치마 상\'자 적상산이라고 했다는데 소가 하품할 소리다. 가을에 붉지 않은 산이 어디 있으며 가을 아닌 계절에는 그럼 뭐라 불러야한단 말인가? 치마바위가 있어 상산으로 불렸는데 두 자로 불안해 앞에 \'적\'자를 덧붙였다는 게 합리적인 해석일 것이다.','35.946377777777776','127.69019444444444','45730330'),('2506112300','변산','전라북도 부안군 변산면, 상서면, 진서면',508,'m46.jpg','전라북도','서해바다와 인접해 있는 변산은 호남평야를 사이에 두고 호남정맥줄기에서 떨어져 독립된 산군을 형성하고 있다. 이 산은 예로부터 능가산, 영주산, 봉래산이라 불리며 호남의 5대 명산중의 하나로 꼽혀왔다. <br>1971년 도립공원으로 지정된 변산에는 기상봉, 망포대, 신선대, 쌍성봉, 옥녀봉, 세봉 등 400m 이상의 산이 6개 있고 계곡에는 와룡소, 가마소, 직소폭포, 성계폭포 등 장엄한 절경을 자랑하는 명소들이 산재해 있다. 이 밖에도 서해안 해식단애(海蝕斷崖)의 절경을 이루는 채석장을 비롯하여 우금바위와 산성, 굴바위, 빙봉 낙조대, 내소사, 월명암, 개암사 등 천태만상의 명소들이 진을 치고 있어 볼거리가 많은 곳이다.',';산 호수 바다 3절미 갖춘 서해의 산;<br>부안읍에서 서해를 향해 내민 변산반도는 방방곳곳이 좋은 명승지다. 바다를 원하면 해수욕장, 산을 오르고 싶으면 안변산, 백패킹의 맛에 빠진 이는 백천내의 맑은 물을 즐길 수 있는 곳, 바로 변산(邊山)이다.<br>용마루에서 서까래 뻗어나가듯 하는 여느 산과는 달리 바깥에 산을 세우고 안은 비운 형태다. 상봉 의상봉(509m)에서 시작한 산줄기는 시계방향으로 돌며 주류산성(331m), 상여봉(390m), 남옥녀봉(433m), 용각봉, 세봉, 관음봉(424m), 신선대(486m), 망포대(494.1m), 쌍선봉(460.7m)을 만들다가 그 안의 백천냇물이 황해로 들어가는 어귀 해창(海倉) 앞에서 의상봉을 바라보며 맺음한다.<br>이 밖은 모두 바다거나 이전에 바다였던 땅이다. 육지와 겨우 목을 댄 사창재 어름을 빼고는, 반면에 안쪽은 폭포와 담소가 곳곳에서 용틀임하는 심심산골이다.','35.67408611111111','126.59888888888888','45800360'),('2511992400','장안산','전라북도 장수군 장수읍, 계남면',1237,'m70.jpg','전라북도','장안산은 장수군과 함양군의 경계선에 있는 백두대간상의 영취산에서 서쪽으로 갈라진 호남정맥의 첫머리에 솟아 있는 기봉이다. 기봉인 장안산에서 섬진강과 금강을 경계로 호남지방과 호서지방까지 뻣어 국토의 약 25%를 점유하고 풍요로운 강산을 이루고 있는 조산, 영산이기에 더욱 아름답게 가꾸어 나가야 한다. 장안산은 이 산맥에 솟아 있는 산중에서도 제일 높고 호남,지방에서는 지리산 덕유산 남덕유산에 이어 4번째로 높은 산이다.이 산은 1986년에 군립공원으로 지정되었다. 기암괴석과 울창한 원시수림을 자랑하는 장안산은 덕산용소와 방화동, 지지계곡 지구로 나뉘어져 아름다운 절경을 이루는 관광지다.',';여름엔 계곡, 가을엔 억새로 유명한 산;장안산은 금남정맥과 호남정맥을 거느리며 백두대간의 기운을 충청도와 전라도에 전하는 호남의 종산이다. 여름에는 피서지, 가을에는 억새와 단풍으로 유명한데 이 일대의 계곡과 숲의 경관이 뛰어나 1986년 장수군 군립공원으로 지정되었다. 이 산에는 26개의 크고 작은 계곡과 7개의 연못, 14개의 기암괴석, 5개의 약수터 등 연못과 폭포가 절경을 이룬다. 장안산 동쪽능선에는 광활한 억새밭이 펼쳐 있어 가을이면 산능선 전체가 억새로 뒤덮인다. 장안산 들머리는 여러 군데가 있으나 덕산계곡에서 범년동으로 가는 길목을 들머리로 하는 곳이 좋다. 등산로 입구에는 안내도와 화장실이 있다.','35.62921388888889','127.59504722222222','45740250'),('2514380500','내장산','전라북도 정읍시 내장동, 순창군 복흥면ㆍ쌍치면',764,'m19.jpg','전라북도','그 산 밖에서 볼 수 없는 천하의 명승을 그 산의 내부에 숨기고 있다\' 는 뜻의 이름을 지닌 내장산. 기암절벽, 계곡, 폭포와 단풍 등 산이 갖춰야 할 품세를 빠짐없이 갖춘 천혜의 가을산이다. 내장산은 전북 정읍시와 순창군의 경계를 이루는 산으로 천하 제일의 단풍 명소로 손꼽히고 있다. 내장사 경내에 있는 정혜루기에 의하면 내장산은 구례의 지리산, 영암의 월출산, 장흥의 천관산, 부안의 능가산(변산)과 더불어 호남의 5대 명산의 하나로 기록돼 있다. 말발굽 형태로 이루어진 능선에 기기묘묘하게 솟은 기암절벽과 울창한 단풍숲이 어우러져 가을철이면 단풍 산행지로 각광을 받고 있다.',';남한 제일의 단풍명산이 바로 이곳! ;우리나라에서 \"\"단풍\"\" 하면 제일 먼저 떠오르는 산이 바로 내장산이다. 동구부터 내장사까지 3킬로미터 남짓 되는 길가가 온통 단풍나무밭이다. 그래 단풍철이면 산 안통이 사람들로 인산인해를 이룬다. 단풍놀이를 온 사람들은 대개 골짜기 단풍만 구경하고 돌아간다. 그러나 진짜는 말굽형의 운두를 돌며 안통의 붉은 카핏을 내려다보는 것이다. 월영봉, 서래봉, 망해봉, 연지봉, 까치봉, 상봉 신선봉, 연자봉(문필봉), 장군봉이다. 써레처럼 생겼다 하여 서래봉이 된 톱날 같은 암봉은 내장산의 최고 명경이다. 그 경치를 감상할 데는 벽련암 중문으로 소설가 문순태 선생이 가장 아끼는 풍경이기도 하다. 서래봉 중턱에는 수령이 700살이나 되는 단풍나무가 있다. 높이가 20m, 둘레는 4m나 된다. 골짜기의 단풍나무는 해방 후 정읍군에서 심은 것이지만 내장산 단풍 역사가 짧은 것만은 아니다. 백제시대 영은사(靈隱寺)가 세워지면서 죽 영은산이라고 불려왔다. 그런데 언제부턴가 내장산으로 바뀌어 오늘에 이르렀다. 그러나 고적은 보물 한 점 없을 정도로 비해 빈약하다. 꼭 봐야할 것은 용굴. 사람들이 쌓은 작은 돌탑들밖에 없는 자연동굴이지만 정유재란때 전주사고의 조선왕조실록을 여기로 옮겨오지 않았다면 유네스코가 지정한 세계문화유산은 존재하지 않았을 것이다.','35.478341666666665','126.8890138888889','45180119'),('2515021000','마이산','전라북도 진안군 진안읍ㆍ마령면',687,'m31.jpg','전라북도','마이산은 옛날 용출산, 동금산 등으로 불려 오다가 이조때 태종이 말 귀를 닮았다고 한 뒤부터 마이산이라 칭하게 됐다. 재미있는 것은 마이산은 바라보는 방향에 따라 그 모습이 달라 보인다는 것이다. 그래서 마이산의 기이한 모습과 특이한 경관 때문에 여러 가지 이름을 갖고 있다. 붓끝같다해서 문필봉, 바위가 많아서 개골산, 방향을 달리해 보면 돛대를 닮아 돛대봉, 용의 뿔 같다해서 용각봉 등으로 불려진다. 마이산은 동서로 큰 암수봉우리 두개가 있다. 동편 숫봉우리는 거대한 남성을 닮았다 하여 서다산(西多山)이라는 옛 이름도 지니고 있는데, 강한 양기를 품고 있어 산길이 험준하여 등산을 할 수가 없다. 서편에 있는 암마이봉은 나긋나긋하게 손짓하는 여성처럼 많은 등산객을 맞이하고 있다. 마이산에서 북쪽으로 흐르는 물은 금강 물줄기를 이루고, 남쪽으로 흐르는 물줄기는 섬진강으로 흐른다. 그 흐름이 반원을 그리고 있어 마이산은 금강과 섬진강의 분수령이 되고 있으며 두 강의 물줄기는 마이산을 중심으로 태극을 이루고 있다. 마이산은 조선을 개국한 이성계와 인연이 깊은 산이다. 이성계는 마이산을 속금산(束金山)이라 불렀다. 일찍이 큰 꿈을 품었던 이성계는 금산 등 전국 각지의 명산을 찾아 기도를 올렸는데, 기도가 끝난 어느 날 밤 꿈에 신이 나타나 금척(모든 제도의 표준임을 말하며를 마음대로 헤아리도록 하라\"\" 라고 했다 한다. 그 뒤 고려 우왕 6년(1380년) 고려의 장군 이성계는 전라도 운봉땅 황산에서 왜구를 무찌르고 개선 길에 마이산을 보고 놀랐다. 꿈에 신에게서 금척을 받은 장소가 바로 마이산이기 때문이었다.',';신기루처럼 솟아오른 말 귀 모양의 타워;산이라기보다는 탑으로 부르는 게 더 맞을 기경이다. 영어의 타워와는 완전히 부합한다. 서봉 암마이산과 동봉 숫마이산이 나란히 서있는데 그 모습이 꼭 말의 귀처럼 보인다. 남북으로 높은 산이 없어 더욱 장관으로 진안 우주들이나 사양제 수면에 비친 모습은 특히 환상적이다. 타포니 지형으로도 유명하다. 바위 표면이 폭격을 맞은 것처럼 패어있는 현상으로 남한 내륙에서는 최대 규모라고 한다. 주성분인 역암이 풍화작용으로 속에서부터 부스러져 생겼다. 신라때는 \'섰다산\'과 가까운 이두 서다산(西多山), 고려시대에는 \'솟을 용\'자 용출산(聳出山)이었고 조선시대부터 마이산이라 불렸다. 계절에 따라서도 달라 봄에는 안개 속에 신기루처럼 솟은 봉우리가 쌍돛대 같다 하여 돛대봉, 여름에는 야산 위로 우뚝한 봉우리가 용의 뿔처럼 보인다 하여 용각봉(龍角峰), 단풍 든 가을에는 마이봉, 겨울에는 눈이 쌓이지 않아 먹물을 찍은 붓끝처럼 보인다 하여 문필봉(文筆峰)이라 부른다. 두 마이산 사이에 있는 절 탑사에는 80여개의 인공탑이 숲을 이루고있다. 둘레 20미터, 높이 15미터에 이르는 것까지 있는데 자연석 돌담불이 140여년 동안을 무너지지 않고 있다.','36.04453055555555','127.45932222222223','45720250'),('2515042400','운장산','전라북도 진안군 주천면ㆍ부귀면ㆍ정천면, 완주군 동상면',1126,'m65.jpg','전라북도','운장산은 전라북도 진안군 주천면, 정천면, 부귀면, 완주군 동상면에 걸쳐 있으며 남쪽과 북쪽으로 흐르는 물은 금강으로 유입되고, 서쪽 계곡으로 흐르는 물은 완주군 동상면을 지나 만경강으로 흘러 금강과 만경강의 발원지 구실도 하고 있다. 북두칠성의 전설이 담겨 있는 칠성대를 지나 한참 더 올라가면 오성대가 있는데 조선조 중종 때의 서출 성리학자 송익필이 은거하였던 곳으로 전해지고 있다.주요 등산코스는 부귀면 궁항리나 황금리로 오르는 코스와 완주군 동상면 신월리로 오르는 코스가 있고 주천면 중사, 외처사동 마을에서 시작하여 동봉으로 오르는 코스도 있다.',';정여립사건 배후조종자 송익필의 산;금남정맥의 최고봉이면서 전라북도 내륙 최고봉이다. 본이름은 구절산이었는데 조선 중기에 서인의 막후실력자 송익필의 자(字) 운장을 따라 운장산으로 바뀌었다. 그가 배후조종했다고 하는 기축옥사로 정여립과 그 추종자(대부분이 전라북도 선비들이었다) 천여 명이 죽임을 당했는 바 그 통에 산이름까지 창씨개명한 듯하다. 정상 좌우에 서봉과 동봉이 있는데 서봉 아래 오성대는, 천민으로서 주인이 역모를 꾀했다고 거짓 밀고해 일약 종3품까지 올라간 송익필의 아버지가 다시 천민이 되면서 도피생활에 들어간 송익필이 머물렀던 곳이라고 한다. 그는 거기서, 빤히 보이는 죽도의 정여립을 얽어맬 음모를 완성했던 듯하다. 산 동쪽의 가장 빼어난 부분은 송익필의 호와 음이 같은 구봉산이다.','35.97781944444445','129.48913888888887','45720400'),('2601072300','월출산','전라남도 영암군 영암읍ㆍ군서면ㆍ학산면, 강진군 성전면',811,'m67.jpg','전라남도','월출산은 국내에서 규모가 제일 작은 국립공원으로 천태만상의 기암괴석이 수석 전시장을 연상케한다. 남성적인 웅장함을 갖춘 북쪽의 가파른 돌산과 여성적인 섬세함을 갖춘 완만한 남쪽산이 조화를 이뤄 지리산, 변산, 천관산, 내장산과 함께 호남의 5대 명산으로 꼽히고 있다. 신라시대에는 월나산(月奈山), 고려시대에는 월생산(月生山) 그리고 조선시대부터 월출산이라고 불리어졌다.',';돌불꽃처럼 치솟아오른 남도의 석화성;프랑스의 세계문화유산 몽쌩미쉘(Mont Saint-Michel) 같은 산이다. 정상 천황봉만 떼어 보면 피라밋 같기도 하다. 천황사쪽 평균경사 37도. 이땅에서 이보다 가파른 산은 없다.천황봉은 물론이고 향로봉, 양자봉, 시루봉, 문필봉(월각산) 등 주요 봉우리들이 모두 돌로 되었고 불꽃처럼 하늘로 치솟아오르고 있다. 나무는 보이지 않고 산죽이나 덤불이 먼지처럼 얹혀 희미한 푸른기를 띠고있을 뿐이다. 풍수에서 말하는 이른바 석화성(石火星), 정상부가 돌로 된 것을 넘어 예리함의 상징 화성까지 띠었다. 나무보다 많고 별보다도 많은 바위는 저마다 무언가를 닮았다. 음굴, 남근바위, 통천문 등 동서로 기암이 늘어서 있어 바위 전시장을 이룬다. 미왕재 등성이에는 억새밭이 이채롭고 무위사, 도갑사, 월남사지, 구림리… 자락 사방의 즐비한 문화유적은 남도답사 1번지를 이룬다. 돌산 위의 수도원 몽쌩미쉘은 노르망디와 브레타뉴반도 사이에 낀 만(灣) 이름이기도 하다. 그래 사람들은 밀물 때는 배를 타고 썰물에는 걸어서 수도원으로 간다. 천황사 앞 개신리나 왕인박사의 고향 구림리 앞들도 원래는 이런 바다였다. 월출산은, 유네스코세계문화유산급 산이다.','34.76660277777778','126.70403055555556','46830250'),('2602132900','팔영산','전남 고흥군 영남면 우천리',607,'m92.jpg','전라남도','고흥읍에서 동쪽으로 25km 떨어진 소백산맥의 맨 끝부분에 위치한 산으로 8개의 봉우리가 남쪽을 향해 일직선으로 솟아 있다.',';빼어나면서도 웅장한 바구다리산;터질 듯한 봉만미를 자랑하는 산이다. \'팔\'자 들어간 산 치고 봉만미 뛰어나지 않은 것이 없지만 홍천이나 서산 팔봉산은 작아서 웅장함이 없는데 600미터의 높이에 여덟 암봉이 솟은 이 고흥 최고봉은 빼어난 위에 웅장하기까지 하다. 2봉의 동북동릉과 8봉 남릉의 균형 잡힌 양 어깨에다 앞에는 삼각뿔 천주봉이 지키고있어 구도 또한 완벽하다. 경인지역에서 가장 멀리 있는 산 중 하나인데도 사람들이 끊임없이 찾는 이유다. 고흥군에서 1봉에는 유영봉(幼影峯), 2봉은 성주봉, 3봉 생황봉, 4봉 사자봉, 5봉 오로봉, 6봉 두루봉, 7봉 칠성봉, 8봉 적취봉이라고 돌명패를 세워놓았는데 순서와 이름의 상관관계에서 보듯 다분히 작위적이다. 원래는 좀 떨어진 1봉에만 이름이 있었고 나머지는 묶어서 성주봉(聖主峯)이라고 불렀던 것을 하나하나 작명을 한 것이다. 전경 촬영 포인트는 점암(占岩)면소가 있는 모룡리다. 그 점암은 고흥사람들이 \"\"바구\"\"라 부르는 바위가 점점이 있다는 뜻인데 점암면에 이런 지형은 팔영산 외에 달리 없다. 그리고 모룡리에는 회계마을이 있는 바 우리말로 \"\"바구다리\"\"라고 한다. 팔영산의 원이름은 바구다리뫼나 바구다리산이었던 것이다. 솟음이 우세해 계곡은 썩 발달하지 못했다. 대신 바다가 있다. 육지에 달린 고구마 모양의 반도 고흥의 산이라 사방으로 호수 같은 바다가 펼쳐진다.','34.617152777777775','127.43645277777779','46770440'),('2604100800','백운산(광양)','전라남도 광양시 봉강면ㆍ옥룡면ㆍ진상면ㆍ다압면, 구례군 간전면',1222,'m43.jpg','전라남도','백두산에서 시작되는 백두대간은 동해안 따라 뻗어 내리다 강원도 태백 피재에서 남서 향으로 방향을 틀어 한반도의 내륙을 따라 남해안으로 달려간다. 백운산은 백두대간에서 뻗어 나온 호남정맥이 남해바다로 잠들기전 마지막 힘을 다해 밀어 올린 산으로, 호남정맥의 최고봉이다.섬진강을 사이에 두고 지리산과 남북으로 마주보고 있는 백운산은 정상에서 서쪽으로 또아리봉(1127m),도솔봉(1153.2m)이, 동으로는 호남정맥으로 이어지는 매봉(866.9m)이, 남으로는 억불봉(1,007.5m)을 거느리고 있는 큰 산맥을 이루고 있다. 백운산 아래 옥룡면은 삼면이 산줄기로 둘러싸인 큰 골짜기로 남쪽만 열려 있는 자루 모양을 하고 있다. 이 골짜기를 불당골이라고 부를 만큼 불교 흔적이 많은 곳이다.지리도참설과 풍수사상의 원조라 할 수 있는 도선국사가 37세부터 35년 동안 옥룡사(지금은 남아 있지 않음)에서 주로 기거하다, 72세에 이 절에서 입적하였다. 백운산 산행기점인 동동 마을 왼쪽 옥룡사 터가 있는 백계산(505.8m)에 도선국사가 심었다는 동백 숲이 천연기념물로 지정되어 있다. 이 산에는 고로쇠나무가 많이 자라고 있는데, 예로부터 고로쇠나무에서 나온 수액이 만병통치약이라고 하여 경칩을 전후로 하여 많은 사람이 백운산을 찾아오고 있다.',';도선의 자취 서린 명당풍수도의 본;풍수지리의 금과옥조 명당도(明堂圖)의 본을 이루는 산이다. 좌청룡, 우백호, 입수, 안산…. 모두 이 산 모양새를 보고 체계화됐다. 국사(國師)제도도 없던 나말여초(羅末麗初)에 살았음에도 국사로 일컬어지는 도선으로 인해서다. 지도를 펴고 600미터 등고선을 따라 형광펜을 칠해보라. 거기서 떠오르는 백운산은 바다로 날아가는 커다란 한 마리 새다. 새의 머리, 도솔봉 남릉은 해발 700미터 끝자락에서 좌우로 갈리고있다. 오른쪽 줄기는 서쪽으로 불룩한 호(弧)를 긋다 그대로 남류(南流), 광양 진산 내우산(內牛山)으로 뻗어가고 왼쪽 가지는 동쪽 불룩 초승달 백계산(505.8m)을 이룬다. 꽃봉오리처럼 감싸인 가운데에는 암술대 모양의 입수(入首)가 있다. 도선이 머물렀던 옥룡사터는 그 입수의 끝, 7천여 그루 동백나무 우거진 가운데 자리한다. 명당을 감싼 좌우 산줄기 양쪽에는 동천과 봉강천이 흐르고 두 내를 다시 억불봉능선과 비봉산릉이 에우고있다. 도선으로부터 비롯된 명당풍수도의 오리지널이 바로 이 산인 것이다. 원래 백계산으로 불렸다. 옥룡사터 뒷산만이 아니라 광양, 순천, 구례의 세 군에 걸치는 큰 산덩이가 백계산이었다. 도선의 행적을 적은 글에 나오는 옥룡사는 언제나 \"\"백계산 옥룡사\"\"로 표현되었다. 이 비범한 산은 전국 각지에 있는 흔하디 흔한 흰구름뫼가 아니었다.','38.07483611111111','127.44448333333334','46230310'),('2607102100','추월산','전라남도 담양군 용면, 전라북도 순창군 복흥면',731,'m84.jpg','전라남도','담양읍에서 13km 정도 떨어진 높이 731.2m의 추월산은 전라남도 기념물 4호이자 전라남도 5대 명산중의 하나로 손꼽힌다. 담양군의 최북단인 용면 월계리와 전라북도 순창 북흥면과 도경계를 이룬다. 많은 수림과 기암괴석, 깎아세운 듯한 석벽이 마치 성을 쌓은 듯이 둘러있고 서쪽에 겨우 사람 하나 통행 할 정도의 길이 트여 있다.',';단풍이 아름다운 산;가을이면 산봉우리가 보름달에 맞닿을 정도로 높다고 해 이름지어진 추월산은 마치 충북의 월악산을 담양에 옮겨놓은 듯 기암절벽의 절경과 함게 절벽끝에 아슬아슬 매달린 듯한 보리암은 보는 것만으로도 가슴이 움츠러들게 만든다.보리암의 창건자나 연대는 분명하지 않지만 전설에 따르면 보조국사 지눌이 지리산 천왕봉에서 나무로 깎은 세마리의 새 중 한마리가 날아와 앉은 곳이 추월산 보리암이라고 한다. 또한 임진왜란때 절명한 김덕령 장군의 부인 흥양 이씨가 왜병에게 쫓기자 보리암의 절벽 아래로 몸을 던져 순절했다는 곳이다.지명에서 알 수 있듯이 단풍나무가 많아 온산이 붉게 물드는 가을이 가장 아름다우며 산을 오르다 아래로 보이는 담양호의 푸른 물결은 보는 이의 가슴을 시원하게 뚫어준다. 월계리,밀재, 쌍태리 기점으로 등산로가 나 있으며 어느 코스든 3시간 가량이면 충분하다. 이중 월계리에서 보리암을 거쳐 정상에 오른 다음 동굴대피소 쪽으로 돌아 월계리로 원점회귀하는 코스가 가장 인기 있다.','35.39993333333333','126.97604166666667','46710380'),('2607102300','강천산','전라북도 순창군 팔덕면, 전라남도 담양군 용면',586,'m6.jpg','전라북도','순창읍에서 10km의 가까운 거리에 있는 강천산은 호남의 소금강이라고 불릴 정도로 도처에 기봉이 솟아 있고, 크고 작은 수많은 바위 사이로 폭포를 이루고 있으며, 4km에 이르는 깊은 계곡과 계곡을 뒤덮은 울창한 숲은 자연 그대로의 아름다움을 고이 간직하고 있다.<br><br>원래는 생김새가 용이 꼬리를 치며 승천하는 모습과 닮았다 하여 용천산(龍天山)이라 불렸다. 또한 유서깊은 강천사와 삼인대 5층 석탑, 금성산성 등 문화유적이 산재하고, 비경이 많이 숨겨져 있다. 일명 광덕산이라고도 불리는 강천산은 1981년 국내에서 최초로 군립공원으로 지정된 곳이기도 하며, 길이 76m의 현수교가 지상 50m 높이에 설치돼 있어 웅장함을 더해주고 있다.<br><br>볼거리는 11월 초순에 절정을 이루는 단풍과 4월 초순에 만개하는 산벚꽃이 유명한데, 산 입구의 강천호 주변뿐 아니라 등산로 어디에서나 즐길 수 있다. 산 암봉 아래에는 887년(신라 진성여왕 1) 도선국사(道詵國師)가 세운 강천사가 있다.<br><br>이 곳의 석탑은 전라북도 유형문화재 92호로 지정되었고, 절 입구의 모과나무는 전라북도기념물 97호이다. 그 밖에 순창 삼인대(三印臺:전북유형문화재 27), 금성산성(金城山城:전북기념물 52) 등의 문화유적이 있다. 내장산(內藏山:763.5m)·백양사(白羊寺)·담양댐 등과도 가깝다.',';계류미 뛰어난 호남의 묘향;<br>1981년 사상 최초로 군립공원이 된 산이다. \'군립\'이라는 규모에 걸맞게 600미터가 채 안되지만 \'공원\'답게 뛰어난 계류미를 자랑한다. <br><br>위는 육산, 아래는 골산(骨山)이어서 바위들이 거의 산중턱 아랫녘에 몰려있다. 하여 5킬로미터 암벽협곡으로 비룡계곡의 비룡폭포, 물통골의 약수폭포, 소목골 용두폭포, 계곡 본류로는 병풍바위의 인공폭포, 장대한 9장군폭포가 쏟아져 내리고 있다. 여기에 용바위, 호두암, 투구봉의 바위들과 금강굴, 수좌굴, 형제굴의 동굴이 어우러지고 강천사와 삼인대의 전설까지 깃들어있으니 한 마디로 작은 묘향산, 장엄하면서도 빼어난 역장역수(亦壯亦秀)의 기경이라 할 것이다. <br><br>예전에는 용천산이라 불렸는데 송익필이라는 사람의 시 \'숙(宿)강천사\'가 뜨면서 강천산으로 바꿨다고 한다. 정말 어처구니없는 창씨개명이 아닐 수 없지만 익필의 자(字)로 산이름을 삼은 진안 운장산이 가장 멋진 부분까지 호 구봉에 뺏긴 것에 대면 그래도 낫다 할 것이다. 그 송익필은 선조때 서인의 막후실력자였다.','34.434797222222215','127.04781666666666','45770350'),('2611193200','조계산','전라남도 순천시 승주읍ㆍ송광면',887,'m74.jpg','전라남도','높이 887m의 비교적 낮은 산인 조계산은 1979년 12월 도립공원으로 지정되었는데, 산세가 부드럽고 아늑한 것이 특징이다. 산 속 깊은 계곡에는 젖줄과 같은 맑은 물이 흐르며, 만수봉과 모후산이 송광사 일대를 병풍처럼 둘러싸고 있어 마치 어머니 품처럼 포근함을 느낄 수 있다. 전국 3대사찰의 하나인 송광사와 고찰인 선암사가 주능선을 중심으로 동서에 자리하고 선암사 계곡을 흐르는 동부계곡은 이사천으로 남부계곡은 보성강으로 흘러들게 된다.선암사 둘레에는 월출봉, 장군봉, 깃대봉, 일월석 등이 줄지어 솟아있어 장관을 연출한다. 조계산 산행은 송광사나 선암사 어느 쪽에서 시작해도 비슷한 시간대에 다양한 코스를 즐길 수 있으며, 산세가 험하지 않고 평탄한 길이 많아 연인끼리 또는 가족단위 소풍코스로도 알맞다. 송광사 3대 명물중의 하나인 800년이 넘은 천연기념물 쌍향수도 이곳을 찾아오는 사람들의 눈길을 끌고 있다.',';양쪽에 대가람 둔 좌우 대칭의 산;드물게도 좌우가 대칭인 산이다. 가운데의 장막골을 축으로 양쪽 산줄기와 물줄기들이 반대방향으로, 같은 수로 뻗어있다. 그 기슭에는 가람이 둘 있다. 승보사찰 송광사와 태고총림 선암사다. 상봉 장군봉 코밑의 선암사는 옥 같은 미녀가 잔을 올리는 옥녀헌배형(玉女獻杯形) 명당이라고 한다. 그래 들머리 유천부락 앞에는 옥녀봉이, 뒤에는 배봉(盃峯)이 있는데 근래 주암댐이 건설되면서 동네 앞에 조정지댐의 상사호가 만들어져 전설이 더욱 설득력있게 되었다.반면 송광사는 선암사를 둘러싼 대칭 저쪽 산들까지 외연으로 포괄하는 겹산 명당에 자리잡았다고 한다. 가까운 울타리 망수봉, 연산봉, 대장봉, 조계봉이 내산(內山), 선암사의 울타리 시루산, 장군봉, 깃대봉, 고동산을 외산으로 여기는 것이다. 이런 까닭에 뒷산 송광산(연산봉 일대)을 버려두고 \'조계산 송광사\'라 이름붙일 수 있었다. 1979년에 도립공원으로, 1998년에는 사적 및 명승 8호로 지정되었다. 송광사는 보조국사 지눌, 선암사는 대각국사 의천의 자취가 서려있으니 그래도 될 만하다. 조계산은, 유명한 두 도량으로 하여 덕을 보는 산이다.','34.575297222222225','127.290025','46150250'),('2612140500','깃대봉','전라남도 신안 흑산면 홍도',382,'m16.jpg','전라남도','전라남도 신안군 흑산면 홍도리에 위치하고 있는 홍도는 대흑산 본섬의 부속 도서로서 다도해 해상 국립공원으로 매가도라고도 한다. 홍도는 본 섬을 비롯한 20여 개의 부속 섬이 절정을 이루어 남해의 소금강으로 불린다. 그 중에서 녹섬의 해돋이는 가히 장관이 아닐 수 없다. 파도와 바닷물이 출렁거리는 가운데 2개의 바위 사이로 해가 떠오른 광경은 말로 표현할 수 없을 정도로 아름답다. 여기에 덧붙여 홍도의 낙조 또한 놓칠 수 없는 비경이다.<br>어미섬의 주봉인 깃대봉(해발 367m)과 남쪽의 깃대봉 주변에는 아름드리 동백나무 숲, 후박나무, 식나무 등 휘귀식물 5백여종이 있으며 2백여 종의 동물과 곤충이 함께 서식하고 있다. <br>깃대봉 산행은 가파르기 그지 없고 철쭉,동백등 이름모를 나무들이 온통 빽빽이 자라고, 주봉에 닿으면 뾰족한 모양이 마치 바늘같다. <br>남서로 양상봉의 연봉이 한 폭의 동양화를 펼쳐 놓은 듯하고 동쪽으로는 설풍서전의 울창한 숲이 장관이다.',';다도해의 보석 홍도가 깃대봉이다;<br>다도해해상국립공원의 작은 섬이자 섬 전체가 천연기념물(170호)인 홍도는 360.7미터 높이의 깃대봉과 231.8미터의 양산봉이 개미처럼 떠있는 섬이다. 섬 전체가 홍갈색 규암질 바위여서 홍도(紅島)인데 바다 위에 떠있는 매화꽃 같다고 해서 매가도로도 불렸다. <br>홍도는 해수욕, 스쿠버다이빙, 유람선 일주, 등산까지 모든 것을 즐길 수 있는 천혜의 관광지이다. 그러나 해안선 길이가 20.8킬로미터밖에 안돼 등산은 홍도 1구와 2구 주민들이 왕래하던 루트, 깃대봉 넘는 것이 고작이다. 하지만 유람선을 타고 빠돌(자갈)해수욕장을 출발하면 섬 전체를 돌며 깃대봉을 바라볼 수 있다. <br>섬인 관계로 태풍 등 기상조건에 좌우되어 배가 출항을 못하는 경우도 많으니 2박3일에 플러스 알파가 있어야 홍도를 갔다올 수 있다. 주의해야할 점은 섬 전체가 천연기념물로 지정돼 있어 풀 한 포기, 돌 하나도 가지고 나올 수 없다는 사실이다. 바닷바람을 받으며 자라는 홍도풍란은 대표적인 희귀식물이다.','35.504197222222224','127.03904444444444','46910360'),('2617051500','백암산','전라북도 순창군 복흥면, 전라남도 장성군 북하면',741,'m42.jpg','전라북도','백암산은 드넓은 호남평야를 마주하고 솟아오른 높이 741.2m의 산으로 내장산 국립공원에 속한다. 옛부터 봄이면 백양, 가을이면 내장이라 했듯이 산하면 내장, 고적하면 백암이라 할 정도로 백암산의 절경은 내장산에 뒤지지 않는다. 백학봉과 상왕봉, 사자봉, 등의 기암괴석이 곳곳에 있으며, 산세가 험준한 편이다. 특히 비자나무숲과 회색 줄무늬 다람쥐가 유명한 이곳에는 대한 불교 조계종 18교구 본산인 대사찰 백양사도 있다.',';층꽃나무 무리짓는 단풍의 명산;백암산은 내장산,입암산과 함께 내장산국립공원에 속해 있다. 기암괴석으로 이루어진 사자봉과 백학봉을 사이에 두고 상왕봉이 우뚝 솟아 맞은편 내장산 신선봉과 어깨를 겨룬다. 예부터 백양사의 비자나무숲과 벚꽃나무는 가을의 내장산 단풍과 더불어 유명하며 산세가 부드러워 어렵지 않게 등산을 즐길 수 있다.산 기슭에는 대한불교조계종 18교구 본사인 백양사가 있는데 632년(무왕 33년) 창건하여 백암사라 부르다 조선 선조때 환양이 백양사라 고쳐불렀다고 한다. 전설에는 환양이 백학봉 아래에서 제자들에게 설법하고 있을때 백양 한마리가 이를 듣고 깨우침의 눈물을 흘려 백양사라 불렀다고도 전해진다.','34.88178611111111','128.55453611111113','45770370'),('2618021900','천관산','전라남도 장흥군 관산읍, 대덕읍',724,'m79.jpg','전라남도','산이 바위로 이루어져 봉우리마다 하늘을 찌를 듯 솟아있는 천관산은 지리산, 월출산, 내장산, 내변산과 함께 호남의 ５대 명산중 하나다.아기바위, 사자바위, 종봉, 천주봉, 관음봉, 선재봉, 대세봉, 석선봉, 돛대봉, 구룡, 갈대봉, 독성암, 아육탑 등을 비롯 수십개의 기암괴석과 기봉이 꼭대기 부분에 비죽비죽 솟아 있는데, 그 모습이 주옥으로 장식된 천자의 면류관 같다하여 천관산이라 불렀다고 한다.',';닭의 장태 모양의 하늬바람산;비사릿대로 만든 닭의장태 모양의 산이다. 400미터 등고선을 기준으로 하여 산의 얼개를 파악해보면 그 비사릿대, 능선이 스무 개나 된다. 하여 전체적으로 거대한 돔을 이루어 보는 이를 압도한다. 시월 첫째주말에 억새제를 열 만큼 억새를 자랑한다. 바닷바람 때문에 나무가 자라지 못하기 때문이리라. 상봉 연대봉에서 환희대 사이의 주릉 등서리에만 있을 뿐인데도 전국의 인파가 몰려든다. 육지에서 찾아갈 때는 관산읍이 들머리가 되는 까닭에 관산의 산으로 알려져있지만 애초에는 대덕읍 회진(會津)과의 인연이 더 깊었을 듯하다. 하늬바람산이라는 뜻의 천풍산(天風山)으로도 불렸기 때문이다. 장흥반도 끝머리의 이 포구는 아주 오랜 옛날부터 남해항로의 중요 거점이었다. 그래 백제 근초고왕이 임나군과 합동으로 전라남도 지역을 점령할 때 여기서 만나 원정을 마무리지어 \'모일 회\'자를 쓴 것으로 보인다. 그런데 후일 관산이 커지자 정상능선의 어떤 바위가 갓 모양으로 생겼느니 어쩌니 하면서 천관산으로 바꾸지 않았을까?','36.298030555555556','127.80124444444444','46800253'),('2621041300','두륜산','전라남도 해남군 삼산면ㆍ북일면ㆍ북평면ㆍ현산면',700,'m28.jpg','전라남도','한반도의 최남단에 위치한 두륜산(700m)은 백두대간에서 뻗은 호남정맥이 바다에 이르면서 마지막으로 솟아 오른 산이다. 전남 해남군 삼산면과 현산면의 경계를 이루는 산으로 일명 대둔산(大芚山)이라고도 불린다. 임진왜란 당시 전국의 산야를 누비며 왜적을 몰아낸 서산대사는 이곳 두륜산을 \'만고에 깨지지 않고 삼재가 미치지 않는 산\' 이라 했다. 삼재가 들지 않는다는 것은 홍수나 재해에서 안전하다는 뜻이다. 실제로 두륜산은 북으로는 월출산이 하늘을 받쳐주고 남으로는 달마산이 지축을 맺어 주고 있어 옛 조상들로부터 풍수지리적으로 인정받은 산이다. 상상의 산이며 산의 조종으로 알려진 곤륜산과 백두산에서 연유했다는 뜻에서 두 산의 한자씩을 따 두륜산이라 이름 지었다고 한다.',';바닷가재 여의주 머금은 듯 기이한 형국;가장 남쪽의 \'산이라 할 만한 것\'이다. 육산 덩어리여서 듬직하기는 하나 잘났다고 할 수는 없다. 그런데도 산 보는 데 일가견이 있던 서산대사가 자신의 의발(衣鉢)―옷가지와 밥그릇을 여기 갖다노라 한 것을 보면 뭔가 있기는 한 듯하다. 그냥 들어가서는 발견할 수가 없다. 봄 긴 골짜기 장춘(長春)계곡을 걸어가봐야 한다. 다음, 정상이 아니라 반대편으로 올라가봐야 한다. 향로봉(469m). 그리고, 가부좌를 틀고 앉아 산의 형세를 살펴봐야 한다. 좌청룡은 도솔봉(673.2m)에서 내려오고 있다. 우백호는 고계봉(638m) 줄기다. 입수(入首)는 두륜봉(629.3m)에서 비롯했는 바 모두 대흥사 앞 계곡에서 머리를 맞대고있다. 그 입수가 솟구쳤다 내려앉은 가랑이 사이의 명당에는 서산대사의 사당 표충사(表忠祠)가 있다. 대사의 의발은 오대산 상원사 같은 위치에 모셔졌고 두륜산은 그만한 지덕(地德)이 있었던 것이다. 고계봉, 상봉 가련봉, 두륜봉, 국립지리원 지도에 대둔산으로 표기된 도솔봉(673.5m), 연화봉(613m), 혈망봉(379m), 향로봉의 7봉이 명찰 대흥사를 둘러싸고 있는 또아리 지형이다. 400미터 등고선을 이어보면 거대한 바닷가재가 여의주를 머금고있는 형세다. 이런 기이함 있었기에 두륜산은 대흥사를 키울 수 있었고 그 덕에 명산의 반열에 오를 수 있었다.','34.47191388888889','126.63756111111111','46820310'),('2622132600','무등산','광주광역시 동구, 전라남도 담양군 남면ㆍ화순군 이서면',1187,'m35.jpg','광주광역시','광주시가지에서 동쪽으로 불과 10km 거리에 자리하고 있는 무등산은 도립공원으로 지정되어 있다.산의 형세가 험하지 않고 대부분이 흙으로 이루어져 있어 누구나 쉽게 오를 수 있으며, 곳곳에 맑은 물이 흐르고 있다. 특히 산위에는 서석대, 규봉, 입석대등의 웅장한 바위들이 있으며 산기슭과 중턱에는 약사암, 증심사, 원효사 등의 이름난 절들이 자리잡고 있다. 1972년 도립공원으로 지정되었으며 산 아래에는 각종 놀이 및 편의시설이 들어서 있다.',';계곡 빼어난 영남의 금강산;무등산은 산줄기와 골짜기가 뚜렷하지 않고 마치 커다란 둔덕과 같은 산세를 지닌 홑산이다. 가장 큰 특징은 너덜지대로, 천왕봉 남쪽의 지공너덜과 증심사 동쪽의 덕산너덜은 장관을 자랑한다. 천태만상의 암석들이 운집한 정상, 천왕봉을 중심으로 펼쳐지는 바위들의 웅장함은 남도민의 신앙대상이 되어온 신산임을 반증한다. 특히 입석대, 서석대, 규봉의 바위군상은 보는 이를 압도할 만큼 대단하다. 허나 무등산은 전반적으로 완만한 산세이며 대부분이 흙산으로 이루어져 있다. 멀리서 본 전경은 뫼 \'山\'자를 연상케 하며 호남정맥 흐름의 중심에 솟아 있다. 골짜기들은 맑고 깊은 물을 품어 광주의 젖줄 노릇을 해 왔으며, 위치나 산세 면면이 남도의 으뜸이라 할 만한지라 빛고을 광주를 품기에 부족함이 없는 산이다.','35.100611111111114','127.01924722222222','46710330'),('2702090600','남산','경상북도 경주시 남산동ㆍ내남면',495,'m17.jpg','경상북도','경주 남산은 곧 신라라해도 과언이 아니다. 그만큼 신라 건국에서부터 멸망에 이르는 동안의 수많은 유적과 신라를 지탱해 온 불교유적의 보고이다. 신라의 건국설화에 나오는 나정(羅井)에서부터 종말기의 포석정이 남산 기슭에 자리잡았다. 그 사이의 시간 간격이 900년이다.',';시선 머무는 곳마다 유적이요 유물이다;경주 남쪽에 솟은 남산은 신라인들의 신앙의 대상이었다. 금오산(495.1m)과 고위봉(494m) 두 봉우리에서 흘러내리는 40여 개의 계곡과 산줄기로 이루어졌으며 동서 4km, 남북 8km로 길게 뻗어내린 타원형이다. 100여 곳의 절터, 80여 구의 석불, 60여 기의 석탑이 산재해 있는 노천박물관으로 신라 태동의 성지 서남산, 미륵골·탑골·부처골 등 수많은 돌부처가 있는 동남산으로 구분된다. 자연경관도 뛰어나 변화무쌍한 많은 계곡이 있고 기암괴석들이 만물상을 이루어 등산객의 발길만큼이나 수많은 등산로가 있다. 그래서 남산을 아는 사람들은 \"\"남산에 오르지 않고서는 경주를 보았다고 말할 수 없다\"\"고 한다. 남산은 자연의 아름다움에다 신라의 오랜 역사, 신라인의 미의식과 종교의식이 예술로 승화된 곳이다.','35.80781111','128.0706028','47130120'),('2704390100','금오산','경상북도 구미시, 칠곡군 북삼읍, 김천시 남면',977,'m14.jpg','경상북도','구미역에서 남서쪽으로 약 4km 떨어져 우뚝 솟은 금오산은 1970년 도립공원으로 지정된 산이다. 산 전체가 바위로 이루어져 기암절벽과 경사가 심한 산세를 이루고 있으며, 산아래 대혜폭포까지 케이블카가 설치되어 있다.',';봉만미 뛰어난 금까마귀의 신화;금오산은 신화다. 태양 속에 산다는 세 발 달린 까마귀가 금빛 날개를 펼친 모습이다. 때는 석양이었으리라. 본 자리는 동쪽이었을 거고. 이름지은 사람은 고구려인이었을 터. 그렇다면 그는 분명 낙동강 건너 도리사의 아도였을 것이다. 신화가 입혀진 산은 그에 걸맞는 풍모를 지녔다. 하늘 장막을 쳐들고 솟아오른 봉만의 무쌍함이 있고 바윗골 안통 범접 못하게 폭포를 배치했다. 2.5km의 골짜기 물이 대혜담에 머무르다 명금폭포로 떨어지게 만들었다. 이걸 활용해 사람들은 또 성을 쌓았으니… 빼어난 자연과 인위가 어우러진 최초의 도립공원이다. 상봉 현월봉과 그 옆의 약사봉(958m), 용비늘바위라고 하는 보봉(933m)이 900미터를 웃돈다. 남문 옆에는 남봉(873m)이, 현월봉 건너에는 서봉(851m)이 있어 2km 둘레의 성안을 싼다. 금오동천은 선비들의 놀이터다. 암반계류와 담소(潭沼)가 기암 사이로 펼쳐진다. 아래에서부터 벅시소, 용시소, 구시소… 마지막으로 선녀탕이 12m 와폭 끝에서 맴돌이한다.','35.76755555555555','129.2252861111111','47850253'),('2706133700','황악산','경상북도 김천시 대항면 운수리',1111,'m98.jpg','경상북도','황악산은 김천시에서 서쪽으로 12km 떨어진 곳에 위치한 산이다. 옛부터 학이 많이 찾아와 황학산이라 불리었으나, 직지사의 현판 및 택리지에 황악산으로 되어있다. 울창한 소나무 숲과 깊은 계곡에 옥같이 맑은 물, 가을의 단풍과 겨울의 설화가 아름답다. 일대는 국민관광지로 지정되어 더욱 개발되고 있다. 전체적인 산세는 특징없이 완만한 편이나 온 산에 수림이 울창하고 산 동쪽으로 흘러내리는 계곡은 곳곳에 폭포와 소를 이뤄 그윽한 계곡미를 이루고 있다. 특히 직지사 서쪽200m 지점에 있는 천룡대에서부터 펼쳐지는 능여계곡은 이산의 대표적인 계곡으로 봄철에는 진달래, 벚꽃, 산목련이 볼만하고 가을철 단풍 또한 절경을 이룬다.황악산 정상에서 직지사를 내려다 보면 무수한 지능선이 하나씩 계곡안에서 소멸된 뒤 마지막 남은 두가닥 능선이 좌우에서 직지사를 크게 싸안으면서 산과 절의 화합은 완성된다. 1111m에 이르는 황악산의 높은 봉우리와 그 아래 학의 날개처럼 펼쳐지는 계곡이 좁은 수로를 통하여 동으로 빠져나가고 그 길목에 직지사는 자리잡고 있는 것이다.직지사는 어떻게 보면 황악산 정기가 맺은 전혀 다른 종류의 꽃봉오리 같아 보인다. 직지사는 새로 세운 대형 일주문에 동국제일가람이라는 커다란 편액을 붙여놓은 대로 국중의 사찰 가운데서도 열손가락에 들만한 거찰이다.',';동국제일가람 직지사 품은 대간의 줄기;황악산은 비로봉(1111.4m)을 중심으로 백운봉(770m), 신선봉(944m), 운수봉(740m)이 치솟아 직지사를 포근히 감싸고 있다. 산세는 평평하고 완만하여 비단같이 부드러운 편이며, 초입 일대 계곡 양쪽으로 늘어선 노송과 참나무가 하늘을 가려 장관을 이룬다. 이 산은 김천시에서 서쪽으로 12km 떨어진 백두대간 가운데 위치한다. 예부터 학이 많이 찾아와 황학산이라고도 불렀으나, 직지사 현판과 택리지에는 황악산으로 표기되어 있다. 울창한 숲과 깊은 계곡에 옥처럼 맑은 물, 가을 단풍과 겨울 설화가 아름답다. 정상에 서면 서쪽으로 민주지산, 남쪽으로 수도산과 가야산, 동쪽으로 금오산, 북쪽으로 포성봉이 보인다. 황악산의 주봉을 비롯한 봉우리들은 저마다 산줄기를 동쪽으로 뻗어내려 내원계곡, 운수계곡을 형성하고 있으며, 두 계곡이 합수되는 지점에 직지사가 위치해 마치 황악산의 모든 정기를 받고 있는 느낌을 준다.','36.118075','127.96682222222222','47150380'),('2707010800','대야산','경상북도 문경시 가은읍, 충청북도 괴산군 청천면',931,'m22.jpg','경상북도','대야산은 백두대간에 자리잡고 있으면서 대간능선이 꿈틀이고 지나며 아름다운 보석들을 흩뿌려 놓은 문경의 산들 중에서도 그 명성을 높이 사고 있는 명산이다. 경북 문경시(聞慶市) 가은읍(加恩邑) 완장리(完章里)에 속한 대야산은 대간 마루금을 경계로 충북 괴산군(槐山郡) 청천면(靑川面) 삼송리(三松里)와 접하고 있다. 내/외선유동을 거느리고 있는 대야산은 2002년 세계 산의 해를 맞아 문경의 주흘산, 황장산, 희양산과 함께 산림청에서 선정한 한국 100대 명산에 올라서 있다. 예로부터 명산으로 받들어 온 대야산은 여러 기록들에 ‘大耶山’으로 적고 있으며 특히 철 종 조의 대동지지[(大東地志(1861년 이후 추정)]에는「大耶山 曦陽山南支上峯曰毘盧爲仙遊 洞主山西距淸州華陽洞三十里(희양산남지상봉왈비로위선유동주산서거청주화양동삼십리: 대야산은 희양산의 남쪽 갈래로 제일 높은 봉우리가 비로봉이고, 선유동의 주산이다. 서쪽의 청주 화양동이 30리다)라고 기록하고 있어 대야산 정상을‘비로봉(毘盧峯)’으로 부르고 있음을 알 수가 있다.',';기암괴석과 선유동 계곡의 조화;백화산과 희양산을 지나 속리산 사이에 솟은 대야산은 속리산국립공원내에 포함되며, 백두대간 상의 산으로 경북과 충북 양쪽에 내외 선유동을 두고 있을 정도로 계곡이 특히 유명하다. 대야산 자락에서 흘러내린 물은 용추계곡을 형성, 문경 8경의 하나가 된다. 용추골은 대야산과 이웃한 둔덕산에서 흘러내린 물과 합류하여 넓은 암반이 아름다운 선유동 계곡을 빚어 놓았다. 특히 깎아지른 암봉과 기암괴석이 산세를 더욱 아름답게 한다.문경 8경중의 하나인 용추의 모습은 대야산 제일의 명소로 친다. 거대한 화강암반을 뚫고 쏟아지는 폭포 아래에 하트형으로 패인 소(沼)가 매끈한 암반을 타고 흘러내리면서 여러개의 소를 만들어 놨다. 또한 달 뜨는 밤이면, 바위와 계곡에 달빛이 비친다 해서 월영대(月影臺), 숙종 때의 학자인 이재를 기리기 위해 1906년에 세운 선유동 계곡의 정자인 학천정 등이 대야산을 더욱 기기묘묘한 아름다움으로 가득차게 한다.? 소요 시간 :&nbsp;5시간? 최적 탐방 시기 :&nbsp; 4~9월 /&nbsp; 여름(용추계곡) 인기있는 여름 산행지로 7-8월에 가장 많이 찾는다? 볼거리 : 용추계곡, 대문바위, 문경새재, 문경온천, 문경석탄박물관, 운강기념관, 선유동계곡시원한 계곡과 반석이 특¡이다. 특히 용추의 기묘한 모습은 보는 이의 탄성을 자아낸다. ? 숲길 명소 : 산행은 일반적으로 이화령을 넘어 문경시를 지나 가은읍 벌바위에서 시작한다. 계곡을 따라 난 신작로를 걸어가면 서쪽으로 기암이 두드러진 산이 올려다보인다. 이 계곡이 용추계곡인데 입구에 \'문경팔경\'이라고 새긴 돌비석이 있다. 용추계곡의 비경 중 으뜸으로 꼽히는 용추폭포는 3단으로 되어 있으며 회백색 화강암 한가운데로 하트형의 독특한 탕을 이루고 있다. 용추의 양쪽 옆 바위에는 신라시대 최치원이 쓴 세심대·활청담·옥하대·영차석 등의 음각 글씨가 새겨져 있다. 용추에서 약 20분을 오르면 바위와 계곡에 달빛이 비친다는 월영대가 나온다.','36.66919722222222','127.92951944444445','47280253'),('2707040400','황장산','경상북도 문경시 동로면',1079,'m99.jpg','경상북도','백두대간의 한 뼈대를 이루며 높이 솟아있는 이 산은 이름이 여럿 있다. 황정산(黃庭山)이라고도 하고 작성산(鵲城山), 또는 황장봉산 등으로 표기되고 있으나 황장목이 많아 황장산으로 통칭되고 있다.<br><br>소나무의 한 종류인 황장목은 균열이 적고 단단해 임금의 관(棺)이나 대궐을 만드는데 많이 쓰인 귀한 나무이다. 이 때문에 조선조 숙종 때인 1680년에 이 산에서의 벌목과 개간을 금지하는 봉산(封山) 표석이 동로면 명전리 벌천계곡 하류에 세워졌다. 또 산 깊숙한 문안골 계곡에는 우람한 석문이 있는 작성산성이 있는데 축조방식으로 보아 고구려 시대 것으로 추정된다. 산 아래 금천에는 버들치 등 1급수 어류가 살고 있다.','황장목이 많아 황장산이다. 황장목은 송진이 안으로 스며들어 심재(心材)가 노란 소나무로 조선시대에는 국가에서 관리했으며 그 증거, 황장금표(黃腸禁表) 표석이 북쪽 산자락 명전리에 있다. <br><br>백두대간 마루금이 지나가는 산으로 외관은 썩 빼어나진 않지만 능선 여기저기에 바위가 많다. 베바위, 멧등바위, 투구봉, 감투봉, 수리봉, 치마바위 등이며 수리봉에는 긴 암릉도 있다. 동서로 길게 뻗은 홑산인데도 문안골, 우망골, 토시골 등의 좋은 계곡이 있다. 특히 문안골은 수량이 많을 뿐 아니라 50평쯤의 반석도 있다. 상선암, 중선암, 하선암이 있는 북쪽 단양천 유역과 함께 월악산국립공원의 동쪽 끄트머리다. <br><br>작성(鵲城)이 있어 작성산이라고도 한다. 포곡식(抱谷式)산성으로 성문이 비교적 잘 남아있으며 이런 까닭에 그 골짜기에 문안골이라는 이름이 붙었다. 산은 삼국시대에 고구려와 신라의 경계였고 산을 온전히 품은 동로면은 고려시대까지 작성현으로 불렸다.','35.24056388888889','127.61371944444444','47280350'),('2707083600','주흘산','경상북도 문경시 문경읍',1108,'m76.jpg','경상북도','서울의 진산 자리를 놓고 삼각산과 다투다가 휘적휘적 내려와 버렸다는 전설이 있을 만큼 빼어난 산이다. 정상에서 남봉으로 뻗어내린 1000m를 넘나드는 능선이 특히 준걸해 흡사 삼각산 백운대에서 보현봉에 이르는 장쾌한 능선을 빼다 놓은 듯하다. 일반등산로는 정상으로 알려진 1075봉을 중심으로 6방으로 나있는데 이 중 상봉인 주흘영봉과 부봉을 지나 동화원로 이어지는 줄기의 능선미가 일품이다. 월항삼봉으로 해서 하늘재로 내려서는 코스도 좋은데 월악산에서는 이 둘의 하늘금이 리듬체조의 리본처럼 역동적으로 보인다. 산이 솟음이 우세한 형국이라 썩 발달한 계곡은 없다. 대신 곡충골의 여궁폭포와 파랑소, 조곡골의 꽃밭서덜이 이채롭다. 너덜 사이를 듬성듬성 뚫고 올라온 진달래가 꽃을 피운 모습은 어디서도 찾아보기 힘들다. 도립공원으로 지정돼있는 문경새재는 주흘관, 조곡관, 조령관의 관문과 아울러 자연보도로도 유명하다. 근래에는 여기에 드라마 ;왕건; 세트장과 산악영화제가 보태졌다.','','36.78856666666667','128.10126666666667','47280250'),('2708013300','청량산','경상북도 봉화군 명호면',870,'m83.jpg','경상북도','봉화읍에서 동남쪽으로 26km 떨어진 청량산(869.7m)에는 금탑봉을 비롯하여 아름다운 봉우리 12개와 8개의 동굴이 있다.자연경관이 수려하여 옛부터 소금강이라 전하여지는 명산으로써 태백산에서부터 시작되는 낙동강 줄기가 절벽을 감아돌아 절경을 빚어내고 있으며, 신선이 내려와 바둑을 두었다는 신선대와 선녀가 가무유희를 즐겼다는 선녀봉을 비롯하여 12봉의 기암괴석으로 이루어져 있고, 신라때부터 근세에 이르기까지 김생, 퇴계이황등 선현들이 수도를 하던 유불선교 발상지로 널리 알려져 있을뿐만 아니라 고려 공민왕 10년에 제2차 홍건적의 난을 피하여 왕이 이곳에 와 마지막요새로써 산성을 축조하였고, 난이 끝난후 왕이 이곳을 떠나자 주민들이 왕을 추모하기 위하여 공민왕당을 세우고 봄, 가을로 공을 드리자 대란이 있을때 마다 소리가 울려 재난을 피할수 있었다는 전설이 있으며, 이곳 공민왕당을 오르는 등산로는 말 다섯 마리가 한꺼번에 지나다녔다는 五馬道가 있다.',';과장이 절대 아닌 한 송이 연꽃;한송이 연꽃으로 일컬어지는 낙동강변의 명산이다. 이런 비유는 흔히 과장이기 일쑨데 이 산만큼은 허투루 한 소리로 여겨지지 않는다. 금탑봉의 술대를 사방에서 에워싼 축융봉, 경일봉, 보살봉, 정상 장인봉의 꽃잎들 가운데 앉혀진 청량사가 더할 나위 없이 포근하다. 높이가 서울 삼각산보다 더 높다. 게다가 주요 봉우리들이 얇은 푸나무옷을 걸친 듯한 바윗덩이라 봉만미(峰巒美)가 그만이다. 보살봉의 경우 암벽등반 장비 없이는 오를 수 없을 정도로 가파르다. 그럼에도 산역이 좁아 반나절이면 돌아볼 수 있다. 능선을 반시계방향으로 돌 때 종착지가 되는 정상에서의 낙동강 경치가 시원스럽다. 발 아래 광석나루는 옛날은 물론 다리가 놓인 지금도 낙동강 최고 절경으로 꼽힌다. 밖에서 보는 산의 모습은 그냥 산수화다. 북곡리 윗뒷실마을이 전망대인데 역광 받아 빛나는 하늘금 아래 어둑한 벽의 푸르스름한 색깔이 뇌리에서 사라지지 않는다.','35.148830555555556','128.56954444444443','47920370'),('2710070100','가야산','경상남도 합천군ㆍ거창군, 경상북도 성주군',1433,'m3.jpg','경상남도','가야산은 경남 합천군 가야면과 거창군 가북면, 경북 성주군 가천면 수륜면을 한몸에 품고있다. 우리나라 12대 명산중의 하나로 산세가 천하에서 으뜸이고, 지덕은 해동에서 제일이라 하여, 대한 8경에 속하는 명산이다. 가야산 지역이 옛날 가야국이 있었던 곳이고 이 산이 가야국에서 가장 높고 훌륭한 산이었기 때문에 자연스럽게 가야의 산이라 불렀다고 한다. 가야산은 소머리 같다 해서 우두산(산 머리의 큰 바위 아래에 소의 코라는 뜻의 우비정이란 샘도 있다) 이라는 이름외에 상왕산, 설산, 중향산 등으로도 불리워졌다. \'택리지\'에 기암괴봉을 불꽃에 비유하여 석화성(石火星)이라고 하였는데, 가야산은 보는 방향에 따라서 한송이 연꽃으로도 보였다가 서쪽으로 겹겹이 솟은 산봉우리 사이사이 또는 골짜기에 하얀구름이 잠기면 많은 섬이 떠 있는 바다가 된다.해발 1천m가 넘는 고봉들이 불꽃처럼 솟아 있는 자태하며, 북에서 남으로 이르는 장쾌한 대덕유의 줄기와 아스라히 떠오른 구름위로 지리산을 볼 수 있는 조망, 홍류동천의 아름다운 계곡 등 장중하고 덕성스러운 모습을 곳곳에서 볼 수 있다.가야산 고스락에 서면 금오산, 팔공산, 비슬산이 보이고 화왕산, 자굴산이 보이는가 하면 가까이에 두무산, 오도산, 비계산, 조금 멀리에 백운산, 수도산, 대덕산 등이 보인다.여기에 우리나라 3보 사찰중 하나인 해인사가 들어서고, 조선시대 때 강화도에서 팔만대장경을 옮겨온 이후 불교의 성지로 자리메김하였다. 근래에는 백련암에서 수도했던 성철 스님으로 인하여 더욱 유명해졌다.',';산봉·계곡미, 문화 갖춘 가야의 진산;경상남북도 경계에 있는 가야산은 우리 산줄기의 용마루 백두대간 위가 아니면서도 1400m가 넘는 드문 산이다. 이름처럼 가야의 진산으로서 그 자락에 대가야(합천이나 고령), 고령가야, 성산가야, 전기 가야연맹의 일원이었을 김천을 품었다. 정상 일대와 남산이라 할 매화산이 바위로 덮여있어 명산의 반열에 들었다. 둘을 이어주는 두리봉, 깃대봉, 마령, 단지봉의 육산(肉山)에서는 사철 맑은 물을 흘려보내 자궁형 산세 가운데를 흐르는 홍류동을 절경으로 꾸며놓았다. 아울러 산 한가운데 세계문화유산 팔만대장경을 두었으니 산봉과 계곡, 문화, 무엇 하나 빠진 게 없다.이 갖춘 산을 치인리까지 버스를 타고가 정상을 다녀온 뒤 해인사 구경으로 끝낸다면 너무 허망할 것이다. 그건 매화산 청량사에서 시작, 자궁의 운두를 한 바퀴 돈 다음 보아도 늦지 않다. 26킬로미터 거리에 2박3일이 걸리지만 공들인 값은 한다. 그렇게 만나는 법보사찰의 국보 셋과 보물 다섯이 여느 눈과는 다르게 들어오리니...','35.82256111111111','128.12294166666666','47840330'),('2717030900','성인봉','경상북도 울릉군 울릉읍 서면ㆍ북면',987,'m53.jpg','경상북도','면적 72평방 킬로미터에 둘레가 44.12킬로미터인 울릉도는 포항에서 뱃길로 188킬로미터 떨어진 섬으로 독도를 포함해서 본토에서 가장 멀리 있는 섬이다. 섬 주변은 대부분 화산암의 해안절벽으로 되어 있는데 바로 이 섬 중심부에 성인봉이 자리해 있다. 작은 땅, 울릉도 위에 하나의 봉우리가 솟아 있으니 성인봉이 곧 울릉도인 셈이다. 울릉도는 오래전부터 왕조들의 정책에 의해 백성들을 살 수 없게 하였던 곳이나 백성들이 몰래 숨어 들어 끝끝내 우리 땅으로 지켜낸 우리 민족의 기상이라고 할 수 있다. 울릉도에 관한 기록은 신라시대로 거슬러 올라간다. 〈삼국사기〉와 〈삼국유사〉에 신라 22대 지증왕 때 울릉도에 관한 기록이 있다. 〈삼국사기〉에는 지증왕 13년에 우산국(于山國)이 항복했고, 하실라 군주 이사부(異斯夫)가 나무로 만든 사자를 싣고 가서 항복을 받았다고 기록되어 있는데 〈삼국유사〉의 기록은 조금 다르다. 〈삼국 유사〉에 따르면 아슬라주 동쪽 바다에서 순풍으로 이틀 걸리는 곳에 우릉도(于陵島)가 있고 이 섬에 사는 오랑캐들은 교만하게 바닷물이 깊은 것을 믿고 조공을 바치지 않아 이창 박이종(朴伊宗)이 나무사자로 위협해 항복시켰다고 한다. 울릉도는 겨울에는 따뜻하고 여름에는 시원해서 누구라도 살기 좋고 모든 것이 풍요롭다. 특히 \'3무\'라고 해서 도둑,거지,뱀이 없고 \'5다\'라고 하여 향(香),풍(風),미(美),수(水),석(石))이 많기로 이름나 있다. 해안가로 나가면 구멍바위(공암), 거북바위, 사자바위, 곰바위, 말바위, 국수를 널어놓은 듯한 국수바위 등 기암괴석을 쉽게 볼 수 있다. 성인봉 북쪽 하산 길에 있는 이십 여만 평의 나리분지에는 억새 밭과 나리꽃 군락이 서쪽으로 솟아 있는 알봉(538)과 어우러져 비경을 자아낸다. 울릉도 서쪽 끝 태화동에는 울릉도의 대표적 사당인 성하신당이 자리잡고 있다. 이곳 주민들은 매년 음력 2월에 농사와 어업의 풍년,풍어를 빌고 있다.전설에 의하면 성하신당은 조선 태종 때 안무사로 왔던 김인우가 세웠다고 한다. 안무사 김인우가 심한 풍랑으로 본토에 돌아가지 못하고 있을 때 신의 지시를 받고 젊은 남녀 한 쌍 태하동에 억지로 떼어놓고 본토로 돌아갈 수 있었는데 몇 년 뒤 울릉도에 다시 와 보니 두 사람이 껴안은 채 백골이 되어 있어 그들의 원혼을 달래기 위해 세운 사당이라 한다. 저동에서 봉래폭포로 이어지는 등산로에는 바위틈에서 찬바람이 나오는 〈천연에어컨〉이 땀을 시켜 준다. 천연에어컨에서 정상으로 이어지는 등산로를 따라 약 40분 오르면 세 갈래 물줄기가 원시림을 뚫고 쏟아지는 봉래폭포를 만나게 된다. 나리분지에서 산행이 끝나는 지점인 천부선착장을 따라 서쪽으로 2백미터정도 걷다보면 바위굴 속에서 찬바람이 나오는 풍혈(風穴)이 있다. 봉래폭포쪽 천연에어컨보다 못하지만 여름 땀을 씻어내기에는 충분하다.',';성인봉은 우산의 최고봉이다;울릉도는 섬이다. 섬은 화산으로 이루어졌다. 산이 곧 섬인 것이다. 그런데 산 이름이 없다. 성인봉, 나리봉, 두리봉 같은 봉우리뿐이다. 미륵산, 천두산, 비파산처럼 \'산\'이 없는 것은 아니다. 그러나 이들은 성인봉의 부속봉일 뿐 대표성을 갖지 못한다. 울릉도를 포괄하는 산 이름은 없다. 이름은 역사 속에 있다. ;삼국사기; 지증왕조에 이사부가 점령했다는 우산국의 우산이다. 따라서 성인봉은 우산의 최고봉이라 하겠다. 900m가 넘는데도 화산지형이라 등산로는 셋밖에 없다. 동굴이나 협곡의 위험지역이 많기 때문이다. 따라서 등산은 성인봉 오르기 한 번으로 만족하고 섬 일주 백패킹으로 허전한 마음을 채운다. 비경과 볼거리는 거의 다 거기에 있다. 나아가 배를 타고 섬을 한 바퀴 돌아본다. 최다설지역인 까닭에 겨울에는 산악스키투어도 할 만하다. 성인봉∼나리령 능선의 섬조릿대숲 위를 미끄러져 갈 때는 겨울바다가 정태춘의 \'떠나가는 배\'를 불러줄 것이다.','36.007575','128.6873611111111','47940250'),('2720052300','운문산','경상북도 청도군 운문면, 경상남도 밀양시 산내면',1195,'m63.jpg','경상북도','동으로 가지산과 이어져 있는 운문산은 산세가 웅장하며 나무들이 울창하여 등산객이 많이 찾는 산이다. 이 곳에는 운문사를 비롯한 크고 작은 절과 암자가 있고, 주변 경치가 매우 아름답다.',';영남알프스 전망이 일품인 운문사의 산;거울에 비친 下자형 산줄기 영남알프스의 윗금 서쪽끝을 이루는 산이다. 거대한 봉분 같은 단순한 모양새이지만 억산과 가지산의 좌우 준봉에서 북으로 뻗어간 긴 능선들 덕분에 운문사 들어앉은 깊은 골을 갖추었다. 그러나 남쪽으로는 여지없는 홑산이어서 크단한 바위산덩이 한바우산으로 불린다. 저는 볼품이 별로 없지만 정상 전망 하나는 일품이다. 가지산 새끼 백운산 뒤로 포장을 친 듯한 능동∼재약산 줄기와 그 너머로 어깨를 드러낸 간월산의 장엄한 모습이다. 가을이면 그 등성이에 억새가 물결친다. 산이름이 운문사에서 비롯한 사실에서 보듯 보물 많은 절 운문사를 위해 존재하는 느낌이다. 가지산 역시 마찬가지인 바 현지인들은 지금 가지산으로 불리는 것이 본래는 운문산이었다고 주장한다. 운문사가 있는 장군평에서 보이는 건 가지산이니 허투루 돌릴 말은 아니다. \'석가의 지혜\'라는 뜻의 가지산(迦智山) 또한 신라말 도의선사가 선종이라는 신 교설(敎說)을 들여오면서 바꾼 이름에 다름아니지 않은가?','35.61550555555556','128.959725','47820350'),('2721022000','주왕산','경상북도 청송군 청송읍ㆍ부동면, 영덕군 지품면ㆍ달산면',722,'m75.jpg','경상북도','국립공원 주왕산은 병풍처럼 펼쳐진 기암절벽이 장관.',';지금은 전설로만 남은 무협소설의 동천;하늘을 나는 재주 없이는 들어갈 수 없는 동천(洞天). 협곡의 입구로는 급류가 쏟아나오고 깎아지른 양쪽 절벽은 높이를 가늠할 수 없다. 무협소설에나 등장함직한 풍경. 그렇지만 이땅에도 그런 산이 있었다. 70년대의 어리석은 사람들이 제1폭포 앞뒤 절벽을 파 길을 내지 않았더라면 주왕동천은 아직껏 들어가본 사람이 없었으리라. 금은광이나 가메봉 옆 잘루목을 넘어갈 수는 있었어도 정면 동구로 들어간 이는 전무했을 것이다. 엄청난 가뭄으로 주왕계곡 물이 모두 말라붙기 전에는. 그래서 전설 어린 명소들은 모두 동구 아래 모여있다. 전설의 시대가 끝난 뒤에 발견된 터라 폭포 이름 또한 그냥 제1·제2·제3폭포다. 나아가 계곡 끝의 907봉을 무시하고 아직껏 721봉에 대표성을 부여하고 있다. 동천으로 들어가지 못한 이들이 올라갈 수 있는 가장 높은 봉우리였으니까. 주나라 왕을 갖다붙인 전설도 그렇다. 신라 역사에는, 왕위 계승 0순위였으나 뜻을 이루지 못한 주원왕 김주원이 있었고 이에 불만을 품은 아들 헌창의 반란이 나라를 거덜낸 사실이 분명한데 엉뚱하게도 천여년 전에 망한 먼 나라 후주 이야기로 도배를 했다.','36.733513888888886','127.770275','47750250'),('2724130500','내연산','경상북도 포항시 송라면ㆍ청하면ㆍ죽장면, 영덕군 남정면',711,'m18.jpg','경상북도','보경사와 청하골 계곡으로 유명한 내연산은 상생폭포, 관음폭포, 연산폭포 등 12개의 폭포를 거느리고 있는 산으로 산 전체가 거의 육산으로 완만한 능선으로 이어져 있다. 내연산 산행 들머리는 유서 깊은 보경사로 이 절은 신라 진평왕 25년에 지명법사가 창건하였다고 한다.지명법사가 진나라에서 유학하고 돌아올 때 신비한 팔면경을 가져와 진평왕에게 진언, 내연산 아래 큰 연못에 거울을 묻고 그 위에 금당을 세운 뒤 사찰을 세워 보경사라 이름을 지었다고 한다.',';계곡 빼어난 영남의 금강산;낙동정맥 줄기가 주왕산을 옆으로 지나쳐 내려오다가 동해안 쪽으로 뻗어가 솟은 산이 바로 내연산이다. 경상북도 포항시와 영덕군의 경계에 있는 내연산은 문수산(622m), 삼지봉(내연산 정상, 711.3m), 향로봉(932.4m), 우척봉(천령산, 774.8m)으로 능선이 이어져 있다. 완만하게 능선이 이어지는 육산이라 밋밋한듯 보이기도 하지만, 굽이굽이 20리나 되는 긴 골에는 12폭포가 자리하고 있다. 내연산의 백미는 기암절벽과 조화를 이뤄 절경을 자랑하는 청하골의 12폭포이다. 청하골(내연골) 초입의 상생폭포를 제1폭포로 하여 보현폭, 삼보폭, 잠룡폭, 무룡폭을 거쳐 제6폭포인 관음폭과 제7폭포인 연산폭 일대에서 계곡미의 진수를 보여준다.','36.278644444444446','129.28986111111112','47113330'),('2803010100','연화산','경상남도 고성군 개천면ㆍ영현면',524,'m58.jpg','경상남도','암천을 따라 고성읍 서북쪽 12km 거리에 있는 산으로 옥녀봉, 선도봉, 망선봉의 세 봉우리로 이루어져 있으며 산의 북쪽 기슭에는 유서깊은 옥천사와 백련암, 청연암, 연대암 등의 암자가 있으며 특산물로는 송이버섯과 산딸기 등이 유명하다. 옥천사 대웅전 뒤에 위치한 옥천샘은 사시사철 마르지 않고 항상 수량과 수온이 일정하며 이 샘의 물은 위장병, 피부병에 효험이 있다. 1948년 샘 위에 옥천각을 세워 보존하고 있다.',';연꽃을 닮은 산;연꽃을 닮았다고 해 이름지어진 연화산은 고성의 산을 대표함에 부족함이 없다. 고성읍 서북쪽에 위치했으며 1989년 개천면과 영현면을 포함한 일대가 도립공원으로 지정되었다. 옥천사는 천년고찰 가람의 배치가 섬세한 화엄 10대 사찰의 하나다. 연화산에 오르면 동쪽으로 쪽빛 바다의 당항포가 한눈에 들어오고 연봉속에 파묻힌 옥천사의 전경과 불교유물전시관을 볼 수 있다. 산세가 순탄하고 길이 잘 닦인 산이어서 가벼운 마음으로 산행을 즐길 수 있다.','35.535669444444444','127.79538611111111','48820380'),('2805090900','금산','경상남도 남해군 상주면ㆍ이동면ㆍ삼동면',705,'m12.jpg','경상남도','남해 금산은 남해섬을 대표하는 산으로, 한려해상국립공원이 말 그대로 거의 다 바다로 지정되어 있는데 유일하게 산이 해상 공원에 포함된 것이 금산이다. 금산은 비단을 두를 뻔한 산으로 유명하다. 금산의 본래 이름은 보광산(普光山)이다. 이성계가 왕이 되고자 보리암 아래 있는 \'이태조기단\'에서 백일기도를 드리면서 자신이 왕이 되면 이 산을 비단으로 덮겠다는 약속을 했다. 이성계가 조선을 개국한 뒤, 약속을 지킬 일을 생각하니 난감했다. 이때 사려 깊은 신하가 산 이름을 하사하면 비단보다 오래 갈 것이라고 제안해 이름을 비단 \'금(錦)\'자를 써 이전의 산 이름을 금산으로 바꿈으로 이성계는 자신의 약속을 절묘하게 지킬 수 있었다고 전해지고 있다. 매표소에서 보리암으로 이어지는 등산로 왼편으로 사선대가 올려다 보인다. 사선대는 먼 옛날 동서남북의 네 신선이 조그만 암봉에서 놀았다는 곳이다. 사선대 맞은편에는 절벽을 이룬 웅장한 바위는 만장대이다.',';남녘 바다에 솟은 비단산;남해에는 비단으로 몸을 감싼 산이 있다. 비단 금(錦)자에 뫼 산(山)자를 이름으로 한 금산이다. 금산은 원래 원효대사가 산자락에 보광사라는 사찰을 지음으로 해서 보광산이라 불렸다고 한다. 그런데 이성계가 임금이 되기 전 이 산에서 기도를 하며 임금이 되게 해주면 금산 전체를 비단으로 둘러주기로 약속했다. 그러나 막상 그 넓은 산을 비단으로 두를 일을 걱정하다 진짜 비단이 아닌 비단 금자를 사용해 금산이라 이름을 지어줌으로 약속을 지켰다고 한다. 금산에 오르면 원효대사가 신라 신문왕 3년에 창건했다는 보리암과 가야의 김수로왕의 부인인 허태후가 인도 아유타국에서 가지고 온 돌로 만들었다고 전해지는 삼층석탑뿐 아니라 관음봉, 화엄봉, 일월봉, 자라바위, 좌선대, 상사바위, 부소암, 쌍홍문 등의 바위와 망월대가 있다. 금산 정상에서는 날씨가 좋은 날에는 금산 38경이 모두 보인다고 할 정도로 조망이 뛰어나다.','36.209450000000004','128.00976944444446','48840320'),('2806020900','무학산','경상남도 창원시 교방동',761,'m36.jpg','경상남도','백두대간의 끝자락인 지리산 삼신봉에서 시작되는 낙남정맥의 상좌격인 무학봉은 마산의 진산(鎭山)으로 마산만과 진해만을 굽어보며 바다를 향해 학이 날개를 펼친 듯 아름다운 형상을 하고 있다. 명산이 갖추어야 할 면모를 두루 갖추고 있는 이 산은 바닷가에 위치한 산답게 시원한 조망을 만끽할 수 있으며 주능선 등로엔 억새밭과 암봉 전망대가 있어 편안한 느낌을 준다. 대곡산 아래쪽에는 `만날고개\'가 있는데 이곳은 가정형편이 어려워 댓가를 받고 시집 보낸 딸을 그리워하던 어미와 그 딸이 그리움을 참지 못해 고갯마루에 올랐다가 우연히 만났다는 애틋한 전설이 전해지는 고개다. 무학산의 옛이름은 풍장산이었는데 신라말 최치원이 이곳에 머물면서 산세를 보니 학이 나는 형세같다하여 무학산이라 불리우게 되었다한다.',';남쪽 바다 굽어보는 창원의 진산 ;무학산은 낙남정맥의 기둥줄기로 남북으로 길게 흘러 동쪽으로 창원시를 끌어 안고 있으며 발치 아래는 호수 같은 진해만과 어울려 한폭의 수채화를 그려 놓은 듯하다. 세개의 산줄기가 모여 이루어진 삼각뿔의 무학산은 춤추는 한 마리의 학의 형상에 비유된다. 정상은 풀 한 포기 없는 바위덩이로 형성되어 있다. 무학산은 마산 산악인들의 고향으로 알프스 북벽 등반이 이곳에서 시작되었고 히말라야 거봉도 여기서부터 연결되었다. 한때 전국을 강타한 자유등반의 거센 물결의 발원지도 무학산이다. 무학산의 본래 이름은 \'말 마\' \'자 척\'의 두척산(斗尺山), 우리말로는 마재다. 세마재로 불리기도 했다.','35.97418888888889','129.10069166666665','48125102'),('2807063600','재약산','경상남도 밀양시 단장면ㆍ산내면, 울산광역시 울주군 상북면',1119,'m71.jpg','경상남도','재약산은 영남 알프스 산군중의 하나로 영남 밀양 청도 일대에 위치해 있다. 해발 1,000미터 이상의 준봉들로 이루어진 재약산(사자봉)은 산세가 부드러우면서도 정상 일대에는 거대한 암벽을 갖추고 있다. 125만평에 이르는 재약산 동쪽의 사자평 고원은 광할한 분지가 온통 억새풀로 뒤덮혀 있다. 우리나라에서 가장 넓은 억새벌판이다. 억새풀이 밀집해 자라는 곳만도 5만평에 이른다. 재약산은 해발 1,108m의 수미봉과 1,189m의 사자봉으로 이루어져 있다. 사자평고원은 두 봉우리 사이의 해발 800m 지점부터 완만한 타원형의 언덕들로 이어진다.사자평 억새는 어른 가슴정도 밖에 안 올 정도로 키가 작다. 산아래 밭둑이나 길가의 억새에 비하면 절반밖에 되지 않는다. 잎새도 가늘고 투박하다. 꽃이삭은 거친 산정의 바람에 닳아서인지 뭉툭하고 짧다. 그래서 가는 바람에는 이삭 끝의 낭창거림을 보기 어렵다.',';표충사 에워싼 타원형의 여덟 봉만;왼손으로 쓴 下자 형국 영남알프스의 점에 해당하는 산이다. 그만큼 깊이 숨어있는 산중 속의 산으로 빙 둘러 타원형 능선이 길지를 품고있다. 표충사. 국보 75호 청동함은향완(含銀香玩)과 보물 467호 삼층석탑, 사명대사 유물 200여점을 보관하고있는 절이다. 산은 흡사 이 길지와 거기 있는 보물을 지키기 위해 생겨난 듯하다. 필봉, 상투봉, 상봉 사자봉(1189m), 수미봉(1108m), 코끼리봉(899m), 재약봉(953.8m), 향로산(979.1m), 쌍봉(821.8m)의 여덟 봉만(峰巒)이 알 품은 새우의 모양을 하고있는 것이다. 800미터 등고선을 이어보면 자궁 속의 아이처럼 보이기도 한다. 인간을 감동시키는, 절묘한 자연의 생김이다. 120만평의 억새초원 사자평으로 유명하다. 그러나 거기 밭을 치고 염소를 키웠던 탓에 대초원의 풍모는 없다. 명불허전(名不虛傳). 그럼에도 가을이면 뭇 사람들 그 풍경만 보러 몰려든다. 병든 신라 왕자가 이 산 약수를 마시고 병이 나았다 하여 재약산이라고 했다는 전설이다. 원래는 그 약수 이름을 딴 영정사(靈井寺)의 산이었는데 임진왜란의 영웅 사명대사 유물을 길지로 옮기면서 절 이름과는 영 어울리지 않은 표충사(表忠寺)가 주인이 되었다.','35.54541666666667','128.98055555555555','48270350'),('2809040100','지리산','전라북도 남원시, 전라남도 구례군, 경상남도 하동군ㆍ산청군ㆍ함양군',1915,'m77.jpg','전라북도','명산일수록 숱한 이름속에 둘러쌓여 있기 마련이다. 예로부터 지리산은 백두대간의 맥이 크게 끝나는 곳으로 \'택리지\'에서는 두류산이라고 하였으며 진시황 시절 삼신산의 하나로 \'방장산\'이란 이름을 쓰기도 했다. 그리고 \'지이산\'은 \'지혜가 다른 산\' \'천재지변을 미리 아는 지혜 있는 산\'이라 표현하는 등 이름의 숱한 전설이 스며 있다. 「금강산은 빼어나되 웅장하지 못하고, 지리산은 웅장하되 빼어나지 못하고」라는 서산대사의 비유가 있듯 지리산은 날카롭고 빼어남은 부족하나 웅장하고 두리뭉실한 기운이 돋보인다. 행정구역상 경남 산청군 시천면 중산리 山 208번지에 소재한 천왕봉(1,915.4m)을 주봉으로 반야봉(1,731.8m), 노고단(1,507m)이 대표적이며, 천왕봉에서 노고단을 잇는 100리 능선에는 1천 5백미터가 넘는 고봉이 10개, 1천미터가 넘는 봉우리가 20여개나 있을 정도로 높고 크다. 평평한 고원지대도 많이 발달해 야생화나 철쭉 등이 장관을 이루기도 한다. 산세가 험하지 않으면서 봉우리가 80개에 달하다보니 봉우리 사이로 계곡이 발달했다. 계곡물이 많고 경사도가 심하지 않는 특징이 있다. 중산리계곡, 대원사계곡, 거림계곡, 장당계곡, 뱀사골계곡, 화엄사계곡, 심원계곡, 피아골계곡, 한신(백무동)계곡, 칠선계곡 등 유명 계곡만도 20여개가 있다.',';3도 여섯고을에 걸친 거대한 산국;지리산은 크다. 높고도 넓고 그리고 깊다. 3도 여섯 고을―함양, 산청, 하동, 구례, 남원, 운봉[현]에 그림자 드리운 거대한 산국(山國)이다. 1000미터 이상의 주릉만 해도 110리나 된다. 실상사 서쪽 덕두산(1151.5m)에서 천왕봉 북쪽 쑥밭재(1315.4m)까지다(도상거리 기준이며 노고단∼천왕봉 줄자 실측 결과는 34.2km다). 삼남의 지붕 용마루가 된다. 용마루에서는 열댓 개의 내림마루가 흘러내리고 있다. 내림마루 사이에는 또 그만큼의 골짜기들이 있다. 하여 모두 1억4천만평의, 장엄한 산덩이를 이룬다. 그 안에는 10경이 있다. 노고단 운해, 피아골 단풍, 반야봉 낙조, 벽소령 명월, 세석평전 철쭉, 불일폭포, 연하천 선경(仙景), 천왕봉 일출, 칠선계곡, 섬진강 맑은 물이다. 최고 전망대는 왕시루봉(1240.2m)이다. 거기서 섬진강은 모래밭의 살얼음처럼 반짝이고 천왕봉은 하늘 저 높은 곳에서 제석봉과 촛대봉을 거느리고 내려다보고 있다. 불교문화의 보고이기도 하다. 쌍계사, 연곡사, 화엄사, 천은사, 실상사, 벽송사, 그리고 돌탑 둘만 뎅그런 단속사지다. 모두 합해 국보 일곱에 스물다섯 개의 보물을 갖고있다. 금강산, 한라산과 함께 삼신산의 반열에 올라있다. 방장산, 두류산, 불복산이라 불리기도 했다. 뜻으로는 지혜(智慧)로운 이인(異人)이 나타날 산이다.','34.845844444444445','128.1824722222222','48860360'),('2810040200','금정산','부산광역시 금정구ㆍ북구, 경상남도 양산시',801,'m15.jpg','부산광역시','부산시의 동래온천 북쪽 4km되는 곳에 있으며, 일부는 경남 양산군에 속해 있다.무한의 보고인 바다와 더불어 산자락은 풍요로운 삶의 터전이 되고 있는 부산의 모산이기도 하다.산세는 능선이 완만하게 뻗어내려 요란스러움이 없고, 고담봉을 비롯하여 부채바위,나비바위,대륙봉 등 암장이 있으며, 능선 언저리에는 곳곳에 억새 밭이 있고 날등 어디서 보나 낙동강과 부산시내를 내려다 볼 수 있어 가슴이 후련하다. 고당봉,의상봉,상계봉,서문을 연결한 날등에는 외침을 대비한 조선 숙종 29년에 쌓은 국내 최대규모의 금정산성이 자연석으로 축조되어 있고, 동쪽 산록에는 대찰 범어서와 많은 암자가 있다.범어사는 합천 해인사, 양산 통도사, 순천 송광사, 구례 화엄사와 더불어 우리나라 5대 사찰 중의 하나로 많은 불교 역사유적을 간직한 유명한 사찰이며 인근에금강공원과 동래온천이 있다.산정에는 높이 3장(丈:1장은 10자) 정도의 돌이 있고 샘은 둘레가 10여 자[尺]이고 깊이가 7치[寸]로서 늘 물이 차 있으며 가뭄에도 마르지 않고 금빛이 났는데, 금색 물고기가 5가지 색의 구름을 타고 하늘에서 내려와 그 샘에서 놀았다는 전설에서 산이름이 유래되었다고 전해진다.',';부산을 지키는 산성 명산;항도 부산의 진산 금정산은 시원한 조망과 아기자기한 산성, 명찰 범어사가 어우러진 산이다. 금정산이란 이름은 산꼭대기에 금빛을 띤, 샘이 있다는 데서 유래한다. 수많은 부산시민이 찾는 금정산은 높은 산세에다 동래온천장, 금강공원, 산성유원지 등 각종 위락시설들까지 있어 휴식처로 손색 없는 산이다. 병풍바위, 은벽, 대륙봉암장 등 부산 클라이머들을 키워낸 좋은 바위들도 많다. 또 금정산성은 비교적 잘 보존되어 훌륭한 역사교육의 장이기도 하다.','36.15221944444444','128.52153611111112','26410103'),('2810181300','천성산','경상남도 양산시 하북면, 상북면, 웅상읍',920,'m81.jpg','경상남도','통도사 인터체인지에서 부산쪽으로 7km 떨어진 곳에 있는 산으로, 경부고속도로 위로 가설된 용연 육교를 지나 3km쯤 가면 내원사로 가는 골짜기에 다다르게 된다. 여기서부터 기암괴석과 울창한 숲이 우거져 금강산의 계곡을 방불케하는 천성산이 시작된다.',';봉만·계류미에 고층습원까지 있는 갖춤꼴;\"\"가파른 연봉들 첩첩이요 깊고 깊은 골짜기 굴 같다(連峰疊　 洞府深邃)\"\"는 산이다. 웅상쪽에서 보면 깎아지른 듯한 산세가 단순·웅장한 홑산인데 양산쪽으로는 힘찬 산줄기를 여럿 뻗어내리면서 그 위에 수많은 암봉을 올려놓았다. 능선들 사이 골짜기들은 암반계류 담소(潭沼)가 즐비하다. ;신증동국여지승람;의 저 표현이 하나도 어긋남 없는, 봉만미와 계류미가 다 같이 뛰어난 명산인 것이다. 예전 지도에 \"\"천성산\"\"이 붙어있었던 북봉(약 830m) 일대는 또 억새의 천국이다. 그 천국 여기저기 벌여있는 고층습원에는 나라를 떠들썩하게 했던 꼬리치레도롱뇽과 끈끈이주걱 같은 희귀 동식물이 산다. T자 모양으로 흐르는 특이지형 법수계곡 상류의 이색지대다. 이땅에서 일출을 가장 먼저 볼 수 있는 곳으로도 이름나 있다. 그런 만큼 조망이 뛰어나 영남알프스 아홉 준봉이 하나하나 또렷또렷 보이고 남으로 부산 금정산은 물론이려니와 멀리 김해 신어산, 마산 무학산까지 두루두루 가늠할 수 있다. 천성산이라고 불리게된 인연은 원효대사가 이 산으로 천 명의 중생을 입산시켜 모두 성인이 되게했다는 데서 비롯됐다. 한편으로는 그들이, 밥상을 던져 목숨을 구해준 은혜를 잊지 못해 찾아온 당나라 승려들이라는 설도 있는데 당나라를 가지도 않은 원효대사를 가지고 너무 장난을 친 듯하다. 상봉은 최근까지 원효산이라고 했다.','35.40159722222222','129.10628055555554','48330340'),('2814140100','화왕산','경상남도 창녕군 창녕읍 옥천리 일대',758,'m95.jpg','경상남도','경남 창녕에 자리한 화왕산은 험준한 산이다.특히 봄이면 진달래와 철쭉, 여름에는 녹음과 계곡물, 가을에는 억새, 겨울에는 설경이 유명하다. 봄철 진달래 경치와 가을철 억새가 유명한데, 봄철이면 진달래 군락지를 이루고 있는 화왕산성 주위의 비탈과 관룡산으로 이어지는 능선 일대는 마치 분홍물감을 쏟아부은 듯하다. 매년 4월 하순에서 5월 초순까지 그야말로 산 전체가 불타오르듯 만발한 진달래의 붉은 기운으로 뒤덮인다.화왕산 최대의 명물이라면 정상 주변의 넓고 평평한 억새밭인 \'십리억새밭\'이다.그 십리 억새밭이 평지에서 급경사 벽으로 뚝 떨어지는 경계선인 능선을 따라 화왕산 성벽이 쌓여 있으며, 그 바깥 경사면 거의 모두가 진달래밭을 이루고 있다. 매년 10월이면 이곳에서 화왕산 억새제가 개최된다. 화왕산은 선사시대 화산으로 추정되며, 3개의 못(龍池)가 있으며, 창녕조(曺)씨가 득성하였다는 득성비가 화왕산성(사적제64호)가 있다. 또 서쪽 능선으로는 사적 65호인 목마산성이 보인다. 능선의 동쪽 5km 거리에 관룡사가 있다.',';봄 진달래 가을 억새 향연의산;창녕읍의 진산으로 관룡산과 더불어 화왕산 군립공원을 이룬다. 화왕산 하면 억새를 떠올릴 만큼 억새의 대명사이기도 하다. ６만여평의 대평원에 십리 억새밭. 억새의 크기가 사람 키 높이를 훨씬 넘는다. 이것을 한 바퀴 도는 데 한 시간 남짓 걸린다．가을에는 이곳에서 국내 최대의 야간축제가 벌어진다. 전국 각지에서 1만여명이 운집한 가운데 산신제와 의병추모제를 비롯, 통일기원 횃불행진을 펼쳐 일대 장관을 이룬다. 화왕산은 진달래 명산이기도 하다. 관룡산 정상으로 이어지는 6.5km 능선 등산로를 따라 진달래가 이어진다.','35.54716111111111','128.53164166666667','48740250'),('2816111100','미륵산','경상남도 통영시 산양읍ㆍ봉평동',458,'m37.jpg','경상남도','통영시 서남단의 미륵도에 위치한 야트막한 산이나 미륵신앙의 본거지로 불교인들 사이에는 꽤 알려진 산이다. 그래서인지 이 작은 산에는 용화사, 관음사, 도솔암, 미래사 등 크고 작은 사찰과 암자가 많다. 또 임해봉(臨海峰)이라는 이름의 정상은 지난날 봉화대로서 다도해를 지킨 역사적 장소로도 기억될 만 하다. 미륵산은 한국 제일의 미항이며 충무공이 왜적을 격파한 전승지로 유명한 통영과 국내 유일의 해저터널로 연결되어 있다. 일명 `판대굴\'로 불리는 이 해저터널은 일제시대 일본인이 건설한 것이나 예측된 수명을 넘어 지금도 사용되고 있어 당시 일본의 기술력을 짐작할 수 있는 표본으로 각광받고 있다. 정상에 오르면 비진도, 거제도 , 한산도, 칠천도 등 한려수도를 보석처럼 장식하는 크고 작은 섬들을 한 눈에 조망할 수 있어 그 아름다움에 당황할 정도이다.',';호젓한 산길의 미륵산;통영시 남쪽, 미륵도 중앙에 우뚝 솟은 위풍당당한 산이다. 용화산이라고도 하는데 이 산에 고찰 용화사가 있어 그렇게 부른다고도 하고, 미륵불이 당래에 강림할 용화회상이라 해서 미륵산과 용화산을 함께 쓴다고도 한다. 자락에는 고찰 용화사와 산내 암자 관음암, 도솔암이 있고 효봉 문중의 발상지 미래사가 있다. 그리 높은 산은 아니지만 명산으로서 덕목을 두루 갖추고 있으며 울창한 수림 사이로 맑은 물이 흐르는 계곡이 있고 갖가지 모양의 기암 괴석과 바위굴이 있다. 고찰과 약수, 봄 진달래와 가을 단풍이 빼어나고 산정에 오르면 한려해상의 다도해 조망이 표현할 수 없을 정도로 아름답게 보이며, 청명한 날에는 일본 대마도가 바라다 보인다.','36.025305555555555','127.03954166666666','48220250'),('2816132100','지리산(통영)','경상남도 통영시 사량면',399,'m78.jpg','경상남도','\"환상의 섬\" 사량도 그 중간에 우뚝솟은 또 다른 \"지리산\"(399.3m) 힘겹게 오른 옥녀봉서 바라보는 한려수도와 하산후의 싱싱한 회맛 눈과 입이 즐겁다 환상의 섬！ 사량도가 더욱 아름답게 새로이 태어났다.감추어졌던 사량도의 비경들이 이제 수많은 산꾼들과 여행자들에게 흐뭇하게 그 매혹적인 자태를 드러내게 된 것이다. 통영시에서 펼친 관광개발로 대항해수욕장이 조성되고 여객선 터미널이 새롭게 단장되고 위험했던 등산로가 야무지게 정비되는 등 찾는 이들의 안전과 편의를 개선하여 사량도는 수많은 관광객들로 붐비고 있다.사량도는 통영시 사량면에 해당하는 섬으로 우리나라 남단 다도해 한려해상공원에 둘러싸인 아름다운 섬이다. 사량도는 섬 자체가 뱀 모양으로 생겼고 뱀이 많다고 해서 붙인 이름이라 하는데, 한 남자가 이룰 수 없는 사랑에 괴로워하다 상사병으로 죽어뱀이 되었다는 이야기도 전해온다.삼천포시 앞바다의 잔잔한 물결을 가르고 사량도 상도에 도착하면 섬 가운데 우뚝 솟은 지리산을 볼 수 있다.본래는 우리에게 잘 알려져 있는 전라도와 경상도에 걸친 장대한 지리산이 바라다보여 「지이망산」이라 불리다가 그 말이 줄어 「지리산」이 된 것이다. 높이는 얼마되지 않지만 한려수도의 빼어난 경관과 어우러져 그 어느 명산 못지 않게 절묘한 경관을 간직하고 있다.산에 오르는 길은 여럿 있으나 돈지포구를 시발점으로 지리산 옥녀봉을 거치는 능선을 타고 진촌으로 빠지는 코스를 택하는 것이 이 산의 진면목을 가장 잘 즐길 수 있는 방법이다.돈지는 수려한 경관의 바위산과 푸른 물살이 넘실대는 바다를 배경으로한 한폭의 그림같은 순박한 섬마을이다. 마을을 빠져나와 산을 오르기 시작하면 돌밭길이 나오는데 시야에 들어오는 바다 풍경 덕에 돌길이 지루하지 않고 아기자기하기만 하다. 행여 주위 경관에 시선을 빼앗겨 발이라도 헛디딜까 걱정이 될 정도다.',';지리산 바라보이는 사량도 지리산;지리산은 한려해상국립공원에 있는 사량도에 위치한 산으로 본래 이름은 지리망산이다. 이 명칭은 국립공원 1호인 지리산이 조망된다는 뜻으로 붙여졌다고 한다. 윗섬과 아랫섬으로 나뉘어져 있는데 이들 두 섬 사이를 동강이라고 부른다. 지리산은 사량도의 주섬인 윗섬에 자리하고 있다. 지리산의 여러 봉우리 중 옥녀봉이 빼어난 산세와 조망을 제공해 가장 유명하다. 그러나 암봉으로 이어진 능선길은 다소 위험한데 초보자를 위해 우회로가 있다. 옥녀봉은 유명한 전설을 간직한 봉우리기도 하다.어릴 때 어머니를 여읜 옥녀가 예쁘게 성장하자 천륜을 저버린 아버지가 옥녀를 범하려 해 옥녀가 험한 봉우리에서 몸을 바다로 던졌다고 한다. 봉긋한 산봉우리 형상이 여인의 가슴을 닮았을 뿐 아니라 풍수지리설로도 산세가 여인이 거문고를 타는 옥녀 탄금형이라 옥녀봉의 지명 유래에 힘을 보태준다.','34.845844444444445','128.1824722222222','48220370'),('2819072400','황석산','경상남도 함양군',1193,'m97.jpg','경상남도','황석산이 위치해 있는 함양은 \'썩은 갈치가 다 모이는 곳\' 이라 할만큼 상대적으로 교통이 불편한 곳으로 사람의 발길을 덜 타는 오지이다. 그래서 이 산은 손때 묻지 않은 자연미를 그대로 보존하고 있는 곳이다. 황석산 정상부로 가는 길은 억새능선이 장관을 이루고 정상부에 이르면 쌍립한 암봉의 멋스러움이 등산의 피로를 어루만져준다. 인접한 거망산 종주길도 경관이 일품인데 그 사이사이에 위험한 암릉길이 있으므로 20m정도의 보조자일을 준비하는 것이 안전하다.',';암릉과 억새가 조화로운 산;황석산은 거창 남녘에 솟은 범상치 않은 바위산이다. 백두대간 줄기에서 뻗어 내린 네 개의 산 기백·금원·거망·황석 가운데 가장 끝 자락에 솟구친 이 봉우리는 덕유산에서도 선명하게 보인다．가을철에는 거망에서 황석으로 이어지는 능선에 광활한 억새밭이 장관이다.금원, 기백산과의 사이에는 유명한 용추계곡이 있다. ６·２５ 때 빨치산 여장군 정순덕이 활약했던 곳이 바로 이웃하고 있는 거망산이다. 황석산성은 함양 안의 사람들의 지조와 절개를 상징하는 중요한 유적지이다. 정유재란 당시 왜군에게 마지막까지 항거하던 이들이 성이 무너지자 죽음을 당하고 부녀자들은 천길 절벽에서 몸을 날려 지금껏 황석산 북쪽 바위 벼랑은 핏빛으로 물들어 있다．안의에서는 화림동 여덟 개의 못과 여덟 개의 정자가 유명하다．특히 농월정, 동호정, 거연정, 군자정 등은 전라도 못지 않은 정자 문화를 대표한다．','35.655175','127.75546944444444','48870360'),('2820020300','황매산','경상남도 합천군 대병면, 가회면, 산청군 차황면.',1113,'m96.jpg','경상남도','합천호 푸른물속에 산자락을 담그고 하봉, 중봉, 상봉 등 세 봉우리로 정상을 이루어 수중매로 불리는 황매산(1,108m)은 합천읍에서 서남쪽으로 20km 지점에 위치해 있다.산아래의 황매 평전은 목장 지대와 고산 철쭉 자생지가 있으며, 통일 신라시대의 고찰인 염암사지(사적 131호)가 있다. 황매산은 군리 공원으로 1983년 지정되어, 가회면 둔내리에서 영암사지에 이르는 등산로를 개설하였다. 대병면 하금리 하금천에는 야영장을 개설하여 합천호와 이 지역을 찾는 관광객의 편의를 도모하고 있다.',';영화 둘 찍었던 억새·철쭉·호반명산;합천호반을 지나다 보면 남쪽 하늘금에 굉장한 산 하나가 솟아있다. 이 근처에도 저런 높은 산이 있었나 싶을 만큼 준걸한 암봉이 호숫물에 어린다. 지도를 펴보면… 황매산이다. 자료를 찾아보면… 하늘금만 이쁜 게 아니고 억새와 철쭉도 유명한 군립공원이다. 얼마나 대단한 산이면 영화를 두 편이나 찍었다. 공전의 히트를 기록했던 ;태극기 휘날리며;와 ;단적비연수;다. 전자는 낙동강 방어선과 두밀리 전투장면이었으니 가장 한국적인 지형을 품고있다는 얘기고 후자는 환타지 무협영화니 풍광이 환상적이어서였으리라. 주릉 위에는 신불평원보다 더 너른 황매평전이 있다. 열두목장이 둘만 남아 대부분이 황무지처럼 버려져있지만 엘리어트의 \'황무지\'를 좋아하는 이라면 오히려 이런 풍경이 더 마음에 들리라. \"\"잔인한 계절\"\"이 오면 거기에 무더기무더기 철쭉꽃 핀다. 매화가 있을 리 없는 위도와 고도. 원래 이름은 \'거친 뫼(荒山)\'였을 것이다. 초목에 물 안 오른 이른 봄날엔, 밑에서 보나 위로 올라가 보나 거친 산이다.','35.51866666666667','127.95974166666667','48890450'),('2902194100','한라산','제주도 제주시, 서귀포시',1947,'m93.jpg','제주도','한라산은 우리나라 최남단에 위치해 있으면서 남한에서 가장 높은 산이다. 해발 1950m, 면적 151.35㎢ 로 1970년 3월 24일 국립공원으로 지정된 이 산은 3대 영산중의 하나로 다양한 식생분포를 이뤄 학술적 가치가 높은 동식물의 보고이기도 하다.',';한라산이 곧 제주도다;한반도 남쪽의 최고봉, 해발 1950m의 한라산은 제주도 사람들의 숨결과 역사를 그대로 안고 있는 산이다.한라산이란 이름은 원래 \'은하수를 끌어당길 수 있다(雲漢可拏引也)\'는 뜻으로 붙여진 이름이다. 그만큼 산이 높다는 점을 강조한 것이다. 그밖에도 \'부악(釜岳)\', \'두무악(頭無岳)\' \'영주산(瀛州山)\', \'진산(眞山)\' 등 아름다운 여러 이름들을 갖고 있다.이 섬에 사람들이 살기 시작한 이후부터 제주 사람들에게 한라산이 곧 제주도였다. 제주도 사람들은 역사와 자연과 기후, 그리고 전설까지도 한라산과 함께 공유한다. 원추형의 한라산 그 정점을 다섯 갈래로 분할하는 등산로 곧 영실, 어리목, 돈내코(현재 폐쇄상태), 관음사, 성판악 코스는 산으로 이어지는 길일 뿐만 아니라 백록담의 그 신성을 제주 사람들과 연결하는 질긴 끈이라 할 것이다.한라산 곳곳에는 화산활동으로 생긴 수많은 원추형의 작은 화산들이\'오름\'들을 이루고 있는데, 그 수는 무려 360여 개나 된다. 이들은 백록담을 호위하듯, 아니면 그 품에 안기듯 솟아있다.','38.146033333333335','128.46919444444444','50110134');
